(1, 'malioboro-jogjakarta', 1000, '2023-02-10 22:19:15', '2023-10-08 22:19:09', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Siapa yang tak kenal Malioboro? Salah satu tujuan wisata utama di Tanah Jawa ini, kini telah menjadi icon tak terpisahkan dari Kota Yogyakarta. Kawasan Malioboro terletak sangat strategis yaitu diantara Kraton Ngayogyakarta Hadiningrat dan Tugu Pal Putih.</p>\r\n\r\n<p>Bagi sebagian besar wisatawan baik lokal maupun mancanegara, Malioboro sudah tak asing sebagai tempat berwisata belanja paling diminati di Yogyakarta. Denyut aktivitas perdagangan sangat terasa di tempat ini. Namun demikian latar belakang sejarah Malioboro pun tak kalah mengesankan.</p>\r\n\r\n<p>Jalan Malioboro didirikan bertepatan dengan pendirian Kraton Yogyakarta. Dalam bahasa Sansekerta, kata &quot;malioboro&quot; bermakna karangan bunga. Hal itu mungkin ada hubungannya dengan masa lalu ketika Kraton mengadakan acara besar maka Jalan Malioboro akan dipenuhi dengan bunga. Kata malioboro juga berasal dari nama seorang kolonial Inggris yang bernama Marlborough yang pernah tinggal disana pada tahun 1811-1816 M.</p>\r\n\r\n<p>Keberadaan Jalan Malioboro tidak terlepas dari konsep kota Yogyakarta yang ditata membujur dengan arah utara - selatan, dengan jalan-jalan yang mengarah ke penjuru mata angin serta berpotongan tegak lurus. Pola itu diperkuat dengan adanya &quot;poros imajiner&quot; yang membentang dari arah utara menuju ke selatan, dengan kraton sebagai titik tengahnya.</p>\r\n\r\n<p>&quot;Poros&quot; tersebut diwujudkan dalam bentuk bangunan, yaitu Tugu (Pal Putih) di utara, ke selatan berupa jalan Margatama (Mangkubumi) dan Margamulya (Malioboro), Kraton Yogyakarta, Jl. DI. Panjaitan, berakhir di panggung Krapyak. Jika titik awal (Tugu) diteruskan ke utara akan sampai ke Gunung Merapi, sedang jika titik akhir (Panggung Krapyak) diteruskan akan sampai ke Samudera Hindia.&nbsp;</p>\r\n\r\n<p>Di era kolonial (1790-1945) pola perkotaan itu terganggu oleh Belanda yang membangun benteng Vredeburg (1790) di ujung selatan jalan Malioboro. Selain membangun benteng belanda juga membangun Societeit Der Vereneging Djogdjakarta (1822), The Dutch Governor&#39;s Residence (1830), Javasche Bank dan kantor Pos untuk mempertahankan dominasi mereka di Yogyakarta. Komunitas Belanda di Yogyakarta berkembang pesat sejak masa pemerintahan Sultan Hamengkubuwana VII ( 1877 - 1921).</p>\r\n\r\n<p>Hal tersebut berkaitan erat dengan tumbuh dan berkembangnya perkebunan tebu, berbagai jenis pabrik, perbankan, asuransi, perhotelan, dan pendidikan. Perkembangan pesat juga terjadi pada masa itu yang disebabkan oleh perdaganagan antara orang Belanda dengan orang Tionghoa. Dan juga disebabkan adanya pembagian tanah di sub-segmen Jalan Malioboro oleh Sultan kepada masyarakat Tionghoa dan kemudian dikenal sebagai Distrik Cina (Kawasan Pecinan).</p>\r\n\r\n<p>Perkembangan pada masa itu didominasi oleh Belanda dalam membangun fasilitas untuk meningkatkan perekonomian dan kekuatan mereka, Seperti pembangunan Stasiun Tugu oleh Staat Spoorweg (1887) di Jalan Malioboro, yang secara fisik berhasil membagi jalan menjadi dua bagian. Sementara itu, jalan Malioboro memiliki peranan penting di era kemerdekaan (pasca-1945), sebagai orang-orang Indonesia berjuang untuk membela kemerdekaan mereka dalam pertempuran yang terjadi utara-selatan sepanjang jalan.</p>\r\n\r\n<p>Waktu Terbaik untuk Berkunjung</p>\r\n\r\n<p>Toko-toko dan PKL di Malioboro mulai beroperasi sekitar pukul 09.00 - 22.00 setiap harinya<br />\r\nPada musim liburan, Malioboro akan padat dengan pengunjung. Baik di jalan protokol yang dikarenakan padatnya kendaraan atau pada area pedestrian yang akan disesaki pengunjung dan kendaraan bermotor yang sedang parkir.<br />\r\nCara ke Lokasi</p>\r\n\r\n<p>Dari Stasiun Tugu: berjalanlah sekitar 200 meter ke arah selatan. Anda akan langsung menemukan jalan dengan deretan pertokoan sepanjang 1 km dan itulah Jalan Malioboro<br />\r\nDari Monumen Tugu Yogyakarta: ambillah perjalanan ke arah selatan (jalan satu arah) melewati Jl. Margo Utomo (Jl. Mangkubumi). Ikuti jalur tersebut sampai melewati traffic light Jembatan Kewek dan Hotel Inna Garuda. Setelah melewati jalan tersebut Anda akan memasuki Jalan Malioboro.<br />\r\nFasilitas</p>\r\n\r\n<p>Pusat perbelanjaan, pedagang kaki lima, tempat makan, hotel<br />\r\nPusat informasi<br />\r\nMushola<br />\r\nWC umum<br />\r\nArea parkir untuk bus, mobil, sepeda motor, dan sepeda</p>\r\n</body>\r\n</html>\r\n', '', 'MALIOBORO JOGJAKARTA', '', 'Jalan Malioboro adalah nama salah satu jalan dari tiga jalan di Kota Yogyakarta yang membentang dari Tugu Yogyakarta hingga ke perempatan Kantor Pos Yogyakarta. Secara keseluruhan terdiri dari Jalan Pangeran Mangkubumi, Jalan Malioboro dan Jalan Jend. A. Yani. Jalan ini merupakan poros Garis Imajiner Kraton Yogyakarta.', '', 1, 'location', 'cdn/2023/10/malioboro-yogyakarta-malioboro-yogyakarta-nightlife-4294-malioborookm.jpg', 'Jl. Malioboro, Sosromenduran, Gedong Tengen, Kota Yogyakarta, Daerah Istimewa Yogyakarta 55271, Indo', '-7.7925764', '110.365843', 'MALIOBORO JOGJAKARTA', '', 'MALIOBORO JOGJAKARTA', 2, 0, '01:30:00', 5400, 4.8, 'D.I. Yogyakarta', 0, 0, 0),
(2, 'tourism-zone-malioboro-1', 1000, '2023-02-10 22:19:15', '2023-10-09 19:25:17', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Sebagai seorang turis yang baru pertama kali menginjakkan kaki di Yogyakarta, tentu saja Anda akan memilih untuk mengunjungi tempat ramai dibandingkan dengan tempat sepi. Meskipun Yogyakarta terkenal akan aneka wisata yang harganya terjangkau, namun tetap saja masih ada angka kriminalitas di Yogyakarta.&nbsp;<br />\r\n<br />\r\nBila Anda berkunjung ke Yogyakarta, sudah seharusnya datang ke kawasan Malioboro. Tempat ini memang menjadi pusatnya turis, sehingga akan selalu ramai meskipun pada waktu malam hari. Jadi, Anda tidak perlu takut akan tindak kejahatan atau kriminal.<br />\r\n<br />\r\nDi kawasan ini, Anda bisa menemukan banyak tempat wisata yang belum pernah Anda lihat sebelumnya. Anda juga akan menjajal aneka kuliner yang rasanya lezat. Tentunya semua ini bisa Anda dapatkan dengan harga yang sangat terjangkau.<br />\r\n<br />\r\nMenelusuri Malioboro malam hari bersama pasangan bisa menjadi momen yang sangat romantis. Ditambah sorot lampu jalan dan udara malam yang dingin, jangan heran jika Anda bisa merasakan suasana bak di luar negeri.<br />\r\n<br />\r\n<strong>Ada Apa Saja di Kawasan Turis Malioboro?</strong><br />\r\nSudah dijelaskan sebelumnya bahwa lokasi wisata ini menawarkan berbagai destinasi wisata menarik di sekitarnya. Ingin tahu apa saja wisata yang ada disini? Berikut daftarnya.</p>\r\n\r\n<ul>\r\n	<li>Tugu Yogyakarta<br />\r\n	Sebagai pusat Kota Yogyakarta, tak heran jika ada tugu Yogyakarta di Tourism Zone Malioboro. Tugu ini pasti sudah sering Anda lihat di sosial media sebelumnya karena sangat viral di kalangan masyarakat luar Yogya. Lokasinya juga sangat dekat dari Malioboro, hanya sekitar satu kilometer. Tugu ini berbentuk mirip seperti monas, hanya saja ukurannya lebih kecil. Menjadi lambang Kota Yogyakarta, tugu pal putih terletak di lokasi strategis, yakni perempatan Jalan Margo Utomo dan Jalan Jenderal Sudirman. Meskipun hanya menawarkan objek berupa tugu, tapi lokasi ini tidak pernah sepi pengunjung. Saat hari libur, sebaiknya datang ke sini pada sore hari untuk berswafoto. Bila Anda datang malam hari, jangan menyesal bila tidak bisa mengambil foto terbaik saking padatnya.</li>\r\n	<li>Taman Pintar<br />\r\n	Salah satu wisata di kawasan Malioboro yang tak pernah sepi pengunjung adalah Taman Pintar. Selain sebagai kota budaya, Yogyakarta memang mendapat julukan sebagai kota pelajar. Maka dari itu, tak heran jika terdapat wisata edukasi disini. Saat memasuki wisata ini, Anda akan mendapat banyak ilmu pengetahuan baru dengan cara yang menyenangkan. Anda juga bisa bermain sepuasnya dengan wahana yang tersedia disini. Memang, wisata ini sangat cocok bagi Anda yang membawa anak kecil atau pra remaja.</li>\r\n	<li>Benteng Vredeburg<br />\r\n	Saat ke Yogyakarta, jangan sampai Anda tidak mengunjungi Benteng Vredeburg. Alamatnya terletak di Jalan Margomulyo Nomor 6. Keaslian struktur bangunan ini masih tetap terjaga, sehingga bisa menjadi bukti nyata sejarah peninggalan penjajahan era Belanda.</li>\r\n	<li>Pasar Beringharjo<br />\r\n	Tourism Zone Malioboro juga memfasilitasi Anda yang suka belanja. Anda bisa membeli aneka barang menarik di pasar tradisional sekaligus tertua yang ada di Yogyakarta. Pasar Beringharjo memiliki nilai historis yang tinggi karena menjadi pusat perekonomian masyarakat Yogyakarta pada awal berdirinya keraton. Jangan heran jika pasar ini selalu dipadati pengunjung. Anda bisa menemukan barang antik, pakaian, batik, jajanan pasar, hingga makanan khas Yogyakarta disini. Letaknya juga sangat strategis, yakni di Jalan Margomulyo Nomor 16, sebelah Malioboro.</li>\r\n	<li>Museum Sonobudoyo<br />\r\n	Kelima, Anda bisa mengunjungi Museum Sonobudoyo. Sesuai namanya, museum ini bertujuan untuk mengelola dan mengembangkan koleksi purbakala. Anda bisa menambah wawasan dengan melihat aneka benda antik yang bernilai budaya tinggi disini. Anda juga bisa menyaksikan pertunjukkan pameran di museum ini dengan waktu yang berbeda-beda. Bila Anda datang pada hari Selasa &ndash; Kamis, Sabtu &ndash; Minggu, pertunjukkan akan diadakan pukul 08.00 sampai 15.30 WIB. Sementara, hari Jumat Anda bisa melihat pertunjukkan pukul 08.00 sampai 14.00 WIB. Hari Senin dan libur nasional, museum ini tutup.</li>\r\n	<li>Museum Kereta<br />\r\n	Di Tourism Zone Malioboro, Anda juga bisa menemukan Museum Kereta. Sesuai namanya, museum ini menawarkan berbagai koleksi sejarah dalam bidang transportasi darat yang sangat cepat, yakni kereta. Anda bisa melihat kendaraan utama yang digunakan kesultanan Yogyakarta zaman dahulu. Selain itu, ada juga banyak kereta lain dengan nama yang unik. Masing-masing kereta yang dipajang di museum ini tentu saja memiliki cerita dan kekhasannya tersendiri. Disini, Anda juga bisa menyaksikan upacara besar, mulai dari penobatan sultan, pernikahan anak sultan, hingga pengantaran jenazah sultan ke peristirahatan yang terakhir.</li>\r\n	<li>Keraton Yogyakarta<br />\r\n	Sesuai namanya, Keraton Yogyakarta merupakan istana resmi tempat beristirahat keluarga keturunan darah biru. Sebenarnya, lokasi ini bukan tempat wisata karena masih difungsikan sebagai tempat tinggal sultan dan rumah tangga istana. Sebagai simbol kejayaan kesultanan Yogyakarta, Anda bisa mengunjungi wisata ini setiap hari pukul 09.00 sampai 14.00 WIB. Anda bisa melihat aneka bukti sejarah kesultanan, mulai dari replika pusaka keraton, pemberian raja Eropa, koleksi sultan Yogya sebelumnya, hingga alat musik tradisional gamelan.</li>\r\n	<li>Masjid Siti Djirzanah<br />\r\n	Terakhir, Anda bisa berwisata religi di Masjid Siti Djirzanah. Sekilas, masjid ini memang tampak seperti kelenteng karena desain bangunannya sangat megah dan mengusung corak Tiongkok. Berlokasi di Jalan Margomulyo Nomor 25, masjid ini berdiri kokoh dengan tinggi 12 meter. Letaknya sangat strategis di sisi barat Malioboro, lebih tepatnya antara toko elektronik dan pertokoan batik. Hingga kini, masjid ini masih diperuntukkan untuk ibadah sekaligus wisata islami. Bukan hanya gaya arsitekturnya mengadaptasi budaya Tiongkok, fasad masjidnya juga ada tulisan bahasa Mandarin. Di bawah fasad ini, terdapat jam raksasa berbentuk lingkaran dengan bubungan yang mirip kelenteng.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Tourism Zone Malioboro', '', 'Malioboro, Yogyakarta merupakan salah satu kawasan wisata paling ramai yang menjadi tujuan utama turis. Maka, tak heran jika kawasan ini sering disebut sebagai Tourism Zone Malioboro. Selain menawarkan aneka tempat wisata menarik, Anda juga bisa mencicipi sederet kuliner lezat disini.', '', 1, 'location', 'cdn/2023/10/tourism-zone-malioboro.jpg', 'Jl. Margo Mulyo Jl. Jend. Ahmad Yani No.106, Ngupasan, Gondomanan, Yogyakarta City, Special Region o', '-7.7982487', '110.3652793', 'Tourism Zone Malioboro', '', 'Tourism Zone Malioboro', 2, 0, '01:00:00', 3600, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(3, 'plengkung-gading-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:27:03', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Yogyakarta menjadi salah satu daerah di Indonesia yang memiliki peninggalan sejarah yang cukup banyak. Salah satu yang paling terkenal ialah candi Borobudur yang menjadi bagian dari keajaiban dunia. Adapula beberapa peninggalan sejarah lainnya yang tak kalah menarik di daerah ini.<br />\r\nBanyak wisatawan dari berbagai negara yang berkunjung ke daerah ini hanya untuk mengunjungi daerah-daerah bersejarah termasuk beberapa peninggalannya. Mereka berlomba untuk mendokumentasikan hal menarik tersebut sehingga bisa dipublikasikan bagi banyak orang.<br />\r\nSalah satu yang cukup menarik yang ada di Yogyakarta ialah adanya Plengkung Gading. Bangunan ini merupakan sebuah peninggalan sejarah yang memiliki bentuk seperti pintu gerbang yang melengkung. Itulah mengapa disebut dengan istilah Plengkung yang berarti melengkung.<br />\r\nDi kawasan Plengkung Gading Anda juga akan menemukan menara sirine yang digunakan hanya dua kali saja. Pertama digunakan pada 17 Agustus untuk mengingat detik-detik proklamasi dan digunakan juga pada saat bulan Ramadhan menjelang berbuka puasa. Hal ini menjadi keunikan tersendiri dari kawasan tersebut.<br />\r\nAnda juga dapat menikmati keindahan malam di dekat bangunan ini yang menyuguhkan lampu-lampu yang indah di sekitarnya. Anda akan dibawa pada suasana tempo dulu yang didukung oleh bangunan yang mempertahankan gaya kuno. Kamu bisa mengembalikan foto di sana dengan suasana yang sangat unik ala zaman kolonial Belanda.<br />\r\nJika kamu menyukai suasana yang vintage atau jadul maka tempat ini sangat cocok untukmu menikmati suasana zaman dahulu. Plengkung gading ini bisa menjadi latar foto yang sangat menarik dan klasik. Sedikitnya Anda juga bisa mengetahui sejarah bahwa Yogyakarta memang menjadi tempat yang memiliki asal-usul yang sangat menarik.<br />\r\nJika Anda ingin berwisata keliling kota Yogyakarta maka jangan melewatkan untuk mengunjungi bangunan yang satu ini. Berkunjung pada siang ataupun malam hari tetap tidak masalah karena suasana di sana tetap ramai dan memiliki pemandangan khas. Anda bisa pergi ke sana bersama pasangan atau orang-orang terdekat Anda.<br />\r\nHal ini sangat membantu Anda untuk menciptakan momen yang cukup menarik dengan mengunjungi bangunan bersejarah. Anda bisa berwisata ke tempat dan suasana yang lebih berbeda daripada umumnya. Selain terhibur Anda juga akan merasakan suasana yang unik dan menarik.</p>\r\n</body>\r\n</html>\r\n', '', 'Plengkung Gading', '', 'Plengkung Gading adalah sebuah bangunan gapura yang digunakan sebagai pintu masuk ke dalam jeron benteng Keraton Jogja. Bangunan ini merupakan satu dari lima plengkung yang digunakan sebagai pintu masuk ke dalam benteng.\r\nPlengkung lainnya yang ada di Keraton Yogyakarta adalah Plengkung Tarunasura (Plengkung Wijilan), Plengkung Nirbaya, Plengkung Madyasura (Plengkung Buntet), Plengkung Jagasurya (berada di sebelah barat alun-alun utara), Plengkung Jagabaya (Plengkung Tamansari).\r\nDari lima plengkung tersebut, yang lebih dikenal masyarakat adalah Plengkung Gading dan Plengkung Wijilan. Kenapa cuma dua saja yang dikenal masyarakat? Karena, bentuk dari kedua plengkung itu masih terjaga keasliannya.\r\nAda juga plengkung yang sudah ditutup sejak tanggal 23 Juni 1812, namanya Plengkung Madyasura. Plengkung ini ditutup untuk menghindari serangan musuh. Sehingga, Plengkung Madyasura dibongkar pada masa pemerintahan Sultan Hamengku Buwono VIII. Bangunan tersebut kemudian diganti menjadi gapura berbentuk gerbang biasa.', '', 1, 'location', 'cdn/2023/10/6.jpg', 'Jl. Patehan Kidul No.4, Patehan, Kraton, Yogyakarta City, Special Region of Yogyakarta 55133, Indone', '-7.8137278', '110.3629074', 'Plengkung Gading', '', 'Plengkung Gading', 0, 0, '00:30:00', 1800, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(4, 'bringin-kembar-yogyakarta-1', 1000, '2023-02-10 22:19:15', '2023-10-12 10:19:15', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Di tengah hiruk pikuknya Kota Jogja yang semakin tersentuh modernsasi, ternyata masih banyak mitos-mitos yang tetap dipercaya sekalipun oleh masyarakat modern. Salah satu mitos yang selalu membuat penasaran pelancong di Jogja adalah mitos dari si&nbsp;beringin kembar&nbsp;di Alun-alun kidul, Yogyakarta.</p>\r\n\r\n<p style=\"text-align: justify;\">Keraton Yogyakarta di apit oleh dua buah alun-alun, yaitu alun-alun utara (Altar) dan alun-alun kidul (Alkid). Kedua alun-alun ini sama-sama memiliki dua buah beringin kembar yang berada di tengah alun-alun. Kedua beringin kembar&nbsp;tersebut dianggap sakral oleh masyarakat Yogyakarta. Namun, ada sebuah mitos yang membuat para pelancong/wisatawan yang lebih tertarik dengan beringin kembar di alkid.</p>\r\n\r\n<p style=\"text-align: justify;\">Alun-alun kidul sendiri lokasinya tidak jauh dari keraton. Dari Keraton, berjalanlah ke arah selatan yang nanti akan melihat Plengkung Gading yang merupakan gerbang masuk alun-alun kidul.</p>\r\n\r\n<p style=\"text-align: justify;\">Alun-alun kidul paling ramai dikunjungi saat malam hari. Baik wisatawan maupun warga lokal Jogja memadati setiap sudut alun-alun. Kebanyakan mereka duduk bergerombol sambil ngobro dan bercengkaram bersama kerabat dan teman-teman sambil menikmati jajanan yang ada di sekitar alun-alun.</p>\r\n\r\n<p style=\"text-align: justify;\">Salah satu daya tarik yang membuat orang datang ke alkid adalah adanya mitos beringin kembar. Yaitu mitos siapa saja yang berhasil berjalan di antara dua beringin dengan mata tertutup, maka konon keinginan dan hajatnya akan terkabul. Ritual mitos ini disebut Masangin.</p>\r\n\r\n<p style=\"text-align: justify;\">Meskipun terdengar mudah, ternyata banyak juga yang gagal lho. Tidak sedikit juga banyak yang sudah berkali-kali mencoba dan berhasil, namun ketika kembali ke Alkid, tetap saja penasaran untuk mencobanya kembali.</p>\r\n\r\n<p style=\"text-align: justify;\">Tradisi Masangin sendiri sudah ada sejak zaman dulu saat Kesultanan Yogyakarta masih Berjaya. Alanya Masangin dilakukan saat tradisi topo bisu yang dilakukan setiap malam 1 suro. Tradisi Topo Bisu dilakukan oleh para prajurit dan abdi dalem dengan mengelilingi benteng tanpa mengucap satu katapun.</p>\r\n\r\n<p style=\"text-align: justify;\">Para prajurit dan abdi dalem dengan mengenakan pakaian lengkap adat jawa berbaris rapi. Mereka memulai ritual Topo Bisu dari halaman Keraton menuju pelataran alun-alun lalu melewati kedua beringin kembar tersebut. Hal tersebut diyakain untuk mencari berkah dan meminta perlindungan dari serangan musuh.</p>\r\n\r\n<p style=\"text-align: justify;\">Dari situlah mitos Masangin berkembang. Jika kita dapat melintasi dua pohon beringin dengan mata tertutup, maka semua apa yang kita inginkan akan terkabul.</p>\r\n\r\n<p style=\"text-align: justify;\">Selain itu, area alun-alun kidul yang cukup lapang ini juga digunakan sebagai pusat latihan dan kegiatan para prajurit Keraton. Para prajurit biasanya mengasah konsentrasi dengan berjalan di tengah antara dua beringin kembar.</p>\r\n\r\n<p style=\"text-align: justify;\">Mitos ini semakin kuat dengan adanya kepercayaan bahwa di tengah pohon tersebut terdapat jimat tolak bala untuk mengusir musuh. Konon, ketika tentara koloni melewati tengah pohon, maka kekuatan mereka langsung sirna. Karena itu muncul juga kepercayaan siapapun yang berhasil menyebrangi kedua beringin tersebut, ia mampu menolak bala.</p>\r\n\r\n<p style=\"text-align: justify;\">Selain Masangin, daya tarik Alkid di mata para wisatawan adalah adanya aneka permainan dan meriahnya kerlap-kerlip lampu warna-warni yang menghiasi di odong-odong yang memadati suasana alun-alun kidul. Ditambah dengan suara canda tawa orang-orang yang berusaha sekuat tenaga mengayuh mobil kayuh.</p>\r\n\r\n<p style=\"text-align: justify;\">Kuliner-kuliner malam khas Jogja pun banyak ditemui disini. Di tengah semilirnya angin malam, tentu tergoda untuk mencicipi wedang bajigur, wedang ronde, jagung bakar, cilok, dan lainnya. Jika ingin makan berat, wisatawan juga tidak perlu berjalan jauh menuju area Wijilan yang terkenal dengan menu gudegnya.</p>\r\n\r\n<p style=\"text-align: justify;\">Sumber : visitingjogja.com</p>\r\n</body>\r\n</html>\r\n', '', 'Bringin Kembar Yogyakarta', '', 'Bringin Kembar Yogyakarta merupakan salah satu daya tarik wisata Alun-alun Kidul. Kedua beringin kembar tersebut dianggap sakral oleh masyarakat Yogyakarta. Mitosnya, siapa saja yang berhasil berjalan di antara dua beringin dengan mata tertutup, maka konon keinginan dan hajatnya akan terkabul. Ritual mitos ini disebut Masangin.', '', 1, 'location', 'cdn/2023/10/bringin-kembar.jpg', '59Q7+67G, Patehan, Kraton, Yogyakarta City, Special Region of Yogyakarta 55133, Indonesia', '-7.8119357', '110.363194', 'Bringin Kembar Yogyakarta', 'Bringin Kembar Yogyakarta', 'Bringin Kembar Yogyakarta', 1, 0, '01:30:00', 5400, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(5, 'rumah-hantu-malioboro-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:40:38', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Jika biasanya wahana rumah hantu hanya muncul pada perayaan Sekaten di Alun-alun Utara, kini wisatawan bisa mencobanya setiap kali berkunjung ke Yogyakarta. Rumah Hantu Malioboro ini berlokasi di Jalan Malioboro, Kota Yogyakarta, tepatnya di samping outlet Batik Keris yang berada di seberang di depan Gedung BPD DIY.&nbsp;<br />\r\nRumah Hantu Malioboro merupakan wahana misteri yang digelar oleh JKTGO dan Rumah Hantu Indonesia. JKTGO sebelumnya dikenal sebagai pencetus rumah hantu drive thru pertama di Indonesia. Konsep rumah hantu dengan akses menggunakan kendaraan ini dibuka di Jakarta dan Surabaya bertajuk Halloween Night: Terowongan Casablanca dan Misteri Dusun Penari. Namun, berbeda dengan pendahulunya, Rumah Hantu Malioboro tidak mengusung konsep drive thru, melainkan rumah hantu konvensional yang aksesnya dengan jalan kaki. Selain Rumah Hantu Malioboro, JKTGO dan Rumah Hantu Indonesia juga menggelar wahana serupa di Manado bernama Rumah Hantu Manado Songko.<br />\r\nHarga tiket masuk Rumah Hantu Malioboro adalah Rp35.000 untuk akses di hari kerja (weekday) dan Rp50.000 untuk akses di akhir pekan (weekend) dan libur nasional. Pembelian tiket bisa dilakukan secara langsung di lokasi ataupun online tanpa ada perbedaan harga.</p>\r\n</body>\r\n</html>\r\n', '', 'Rumah Hantu Malioboro', '', 'Yogyakarta merupakan salah satu kota tujuan yang paling banyak dikunjungi oleh masyarakat Indonesia. Yogyakarta pun memiliki beragam destinasi, salah satunya Rumah Hantu di Jalan Malioboro. Wahana Rumah Hantu ini merupakan yang terbesar di Indonesia. Wahana rumah hantu buka mulai pukul 16.00--21.30 WIB dan harga tiket masuknya 35 ribu.', '', 1, 'location', 'cdn/2023/10/12.jpg', '6938+P4X, Jl. Malioboro, Sosromenduran, Gedong Tengen, Yogyakarta City, Special Region of Yogyakarta', '-7.7956378', '110.3653538', 'Rumah Hantu Malioboro', '', 'Rumah Hantu Malioboro', 0, 35000, '00:45:00', 2700, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(6, 'fort-vredeburg-museum', 1000, '2023-02-10 22:19:15', '2023-10-12 12:27:05', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\"><b>Museum Benteng Vredeburg</b>&nbsp;adalah sebuah&nbsp;museum&nbsp;yang terletak di depan&nbsp;Gedung Agung&nbsp;dan&nbsp;Kraton&nbsp;Kesultanan Yogyakarta. Sekarang, benteng ini menjadi sebuah&nbsp;museum. Di sejumlah bangunan di dalam benteng ini terdapat&nbsp;diorama&nbsp;mengenai&nbsp;sejarah Indonesia.</p>\r\n\r\n<p style=\"text-align: justify;\">Harga Tiket Masuk Benteng Vredeburg yaitu Rp.3.000,-/orang dengan jam operasional setiap hari mulai pukul 07.30-16.00 WIB.</p>\r\n\r\n<p style=\"text-align: justify;\">Benteng ini dibangun sebagai pusat pemerintahan dan pertahanan residen&nbsp;Belanda&nbsp;kala itu, dengan dikelilingi oleh sebuah&nbsp;parit&nbsp;(<i>jagang</i>) yang sebagian bekas-bekasnya telah direkonstruksi dan dapat dilihat hingga sekarang. Benteng berbentuk persegi ini mempunyai&nbsp;<i>bastion</i>&nbsp;(menara pantau) di keempat sudutnya.</p>\r\n\r\n<p style=\"text-align: justify;\">Pada tahun 2014 Dinas Kebudayaan Daerah Istimewa Yogyakarta menerbitkan buku berisi koleksi unggulan museum di Daerah Istimewa Yogyakarta, di antaranya adalah koleksi unggulan yang dimiliki oleh Museum Benteng Vredeburg. Koleksi unggulan Museum Benteng Vredeburg adalah sebagai berikut:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Diorama&nbsp;pelantikan&nbsp;Soedirman sebagai Panglima Besar TNI, diorama ini memperlihatkan situasi pelantikan Soedirman menjadi Panglima Besar TNI oleh Presiden Soekarno di Gedung Agung, Yogyakarta, Indonesia.</li>\r\n	<li style=\"text-align: justify;\">Minirama Kongres Boedi Oetomo, minirama ini berlatar tempat di&nbsp;<i>Kweekschool</i>&nbsp;Yogyakarta yang sekarang menjadi&nbsp;SMA 11&nbsp;di Jalan A. M. Sangaji. Organisasi&nbsp;Boedi Oetomo&nbsp;menggelar kongres di tempat tersebut pada tahun 1908.</li>\r\n	<li style=\"text-align: justify;\">Mesin Ketik&nbsp;Surjopranoto. Surjopranoto adalah pemimpin aksi mogok kerja buruh pabrik gula di Yogyakarta. Mesin ketik ini digunakan untuk menulis ujaran yang mengobarkan semangat pemogokan tersebut.</li>\r\n	<li style=\"text-align: justify;\">Kendil, tiga buah kendil ini konon ceritanya pernah digunakan oleh Soedirman ketika tinggal di rumah Ibu Mertoprawira.</li>\r\n	<li style=\"text-align: justify;\">Dokumen Soetomo, berisi daftar alamat kantor kementerian ketika Yogyakarta menjadi ibu kota Republik Indonesia.</li>\r\n	<li style=\"text-align: justify;\">Bangku militer akademi, bangku sekolah ini dahulu dipakai oleh para siswa&nbsp;MA (Militer Academie)&nbsp;pada tahun 1945-1950. Gedung sekolah ini sekarang menjadi&nbsp;SMA BOPKRI 1 Yogyakarta.</li>\r\n</ol>\r\n</body>\r\n</html>\r\n', '', 'Fort Vredeburg Museum', '', 'Museum Benteng Vredeburg adalah sebuah museum yang terletak di depan Gedung Agung dan Kraton Kesultanan Yogyakarta. Sekarang, benteng ini menjadi sebuah museum. Di sejumlah bangunan di dalam benteng ini terdapat diorama mengenai sejarah Indonesia.', '', 1, 'location', 'cdn/2023/10/fort-vredeburg-1.jpg', 'Jl. Margo Mulyo No.6, Ngupasan, Gondomanan, Yogyakarta City, Special Region of Yogyakarta 55122, Ind', '-7.800293', '110.3661642', 'Fort Vredeburg Museum', 'Fort Vredeburg Museum', 'Fort Vredeburg Museum', 0, 3000, '02:00:00', 7200, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(7, 'titik-nol-km-yogyakarta-1', 1000, '2023-02-10 22:19:15', '2023-10-09 19:08:31', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Bagi Anda yang belum tahu, kawasan titik nol km Jogja ini sebenarnya menyatu dengan jalan Malioboro. Titik nol km berada di ujung bagian selatan Jalan Malioboro dan sering dijadikan tempat istirahat bagi para pelancong yang sedang menyelusuri kawasan Jalan Malioboro.</p>\r\n\r\n<p>Di sekitar kawasan wisata malam titik Nol km Jogja, terdapat sejumlah tempat wisata lainnya yang tidak kalah menarik untuk dikunjungi. Beberapa diantaranya adalah sebagai berikut.</p>\r\n\r\n<ol>\r\n	<li>Kawasan Keraton Yogyakarta<br />\r\n	Keraton Yogyakarta menjadi pusat budaya yang ada di Jogka. Keraton Yogyakarta menjadi kerajaan sekaligus tempat tinggal keluarga raja Jogja atau yang dikenal dengan sebutan keluarga Sri Sultan. Selain menjadi kediaman kerajaan, Keraton Jogja juga dibuka bagi para wisatawan pada jam-jam tertentu. Keraton Yogyakarta ini letaknya tidak terlalu jauh dari lokasi titik nol km. Secara geografis, kawasan Keraton ini berada di sebelah selatan titik nol km. Anda hanya perlu berjalan sekitar 500 meter ke selatan untuk bisa sampai ke kawasan Keraton Jogjakarta ini. Sebagai salah satu tempat wisata budaya di Jogja, kawasan Keraton Yogyakarta dibuka untuk para wisatawan setiap hari mulai pukul 08.30 &ndash; 12.30 WIB. Khusus untuk hari Jumat dan juga Sabtu, Keraton Jogja tutup lebih awal yakni pada pukul 11.00 WIB.</li>\r\n	<li>Kawasan Benteng Vredeburg<br />\r\n	Selain menikmati kawasan wisata malam titik Nol km, Benteng Vredeburg juga bisa menjadi kawasan wisata yang sangat menarik untuk dikunjungi. Selain bisa dikunjungi pada siang hari, kawasan Benteng Vredeburg ini sendiri juga bisa dijadikan sebagai kawasan wisata menarik di malam hari. Benteng Vredeburg merupakan sebuah museum yang juga sekaligus tempat wisata yang menarik yang berada di sekitar titik nol km. Benteng Vredeburg berada di lokasi yang sangat dekat dengan titik nol km karena kedua tempat wisata ini sebenarnya berhimpit.</li>\r\n	<li>Kawasan Jalan Malioboro<br />\r\n	Tempat wisata menarik lainnya yang berada di seputaran titik nol km adalah Jalan Malioboro. Kawasan wisata ini cukup terkenal diberbagai kalangan para pelancong karena menawarkan panorama yang cukup menawan di malam hari. Kawasan yang menjadi jantung kota Jogja ini menawarkan berbagai pilihan wisata menarik mulai dari belanja, kuliner, pusat oleh-oleh, hingga sajian para seniman jalanan yang siap menghibur perjalanan wisata Anda.</li>\r\n</ol>\r\n\r\n<p>Itulah ulasan mengenai wisata malam titik Nol km Jogja dan beberapa destinasi wisata menarik lainnya di sekitar titik 0 km Jogja. Berbekal dengan ulasan di atas, Anda tidak perlu bingung dan khawatir lagi jika ingin memilih tempat wisata yang menarik selama berada di Jogja.</p>\r\n</body>\r\n</html>\r\n', '', 'Titik Nol Km Yogyakarta', '', 'Selain menikmati nuansa budaya yang masih terasa cukup kenyal, Jogja juga memiliki cukup banyak destinasi wisata yang sangat menarik untuk disambangi. Tentu salah satu yang cukup populer adalah kawasan wisata malam titik Nol km yang berada di jantung kota Jogja.\r\nSesuai dengan namanya, kawasan ini menjadi pusat atau titik 0 nya kota Jogja. Lokasi ini berada di ujung selatan Jalan Malioboro atau tepatnya berada di kawasan simpang empat Kantor Pos Besar Kota Yogyakarta.', '', 1, 'location', 'cdn/2023/10/titik-0.jpg', 'Jl. Pangurakan No.1, Ngupasan, Gondomanan, Yogyakarta City, Special Region of Yogyakarta 55122, Indo', '-7.8013966', '110.3647641', 'Titik Nol Km Yogyakarta', '', 'Titik Nol Km Yogyakarta', 1, 0, '01:00:00', 3600, 4.8, 'D.I. Yogyakarta', 0, 0, 0),
(8, 'museum-sonobudoyo-unit-i-1', 1000, '2023-02-10 22:19:15', '2023-10-08 22:40:26', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Daya Tarik Museum Sonobudoyo Jika Anda tertarik ingin mengetahui tradisi budaya di masa lampau dan manuskrip, Museum Sonobudoyo dapat menjadi agenda kunjung Anda saat berada di Yogyakarta. Museum Sonobudoyo yang merupakan Unit Pelaksana Teknis Daerah, Dinas Kebudayaan Provinsi Daerah Istimewa memiliki sejumlah ruang pamer yang dapat dikunjungi wisatawan. Ruang wayang, menyimpan wayang yang berfungsi untuk menyebarakan agama dan mengajarkan nilai-nilai kehidupan.<br />\r\nRuang senjata menyimpan beragam senjata di masa lalu, seperti tombak, clurit, kapak, keris, dan lainnya. Jika Anda ingin melihat berbagai topeng, Anda dapat mengunjungi ruang topeng untuk melihat topeng yang digunakan dalam upacara atau pertunjukan di masa lalu. Ruang batik memamerkan koleksi batik dan keanekaragaman peralatan yang dipergunakan untuk membatik.</p>\r\n</body>\r\n</html>\r\n', '', 'Museum Sonobudoyo Unit I', '', 'Museum Negeri Sonobudoyo merupakan Unit Pelaksana Teknis Daerah pada Dinas Kebudayaan Provinsi Daerah Istimewa Yogyakarta, mempunyai fungsi pengelolaan benda museum yang memiliki nilai budaya ilmiah, meliputi koleksi pengembangan dan bimbingan edukatif kultural. Sedangkan tugasnya adalah mengumpulkan, merawat, pengawetan, melaksanakan penelitian, pelayanan pustaka, bimbingan edukatif kultural serta penyajian benda koleksi Museum Negeri Sonobudoyo.', '', 1, 'location', 'cdn/2023/10/museum-sonobudoyo-ruang-pameran.JPG', 'Jl. Pangurakan No.6, Ngupasan, Gondomanan, Yogyakarta City, Special Region of Yogyakarta 55122, Indo', '-7.8022995', '110.3643835', 'Museum Sonobudoyo Unit I', '', 'Museum Sonobudoyo Unit I', 0, 3000, '02:00:00', 7200, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(9, 'tarunasura-wijilan-gate-1', 1000, '2023-02-10 22:19:15', '2023-10-09 18:51:26', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Gerbang kraton adalah pintu masuk ke dalam wilayah kraton. Dalam sejarah Kraton Yogyakarta dikenal ada lima buah pintu gerbang dimana bagian atas setiap gerbang berbentuk melengkung sehingga gerbang tersebut juga disebut plengkung.&nbsp; Plengkung Tarunasura, terletak di sebelah timur Alun-alun Utara. Saat ini lebih dikenal sebagai plengkung Wijilan karena letaknya di daerah Wijilan. Disebut Plengkung Tarunosuro karena dulu gerbang ini dijaga oleh para prajurit muda.</p>\r\n</body>\r\n</html>\r\n', '', 'Tarunasura Wijilan Gate', '', 'Gerbang kraton adalah pintu masuk ke dalam wilayah kraton. Dalam sejarah Kraton Yogyakarta dikenal ada lima buah pintu gerbang dimana bagian atas setiap gerbang berbentuk melengkung sehingga gerbang tersebut juga disebut plengkung.  Plengkung Tarunasura, terletak di sebelah timur Alun-alun Utara. Saat ini lebih dikenal sebagai plengkung Wijilan karena letaknya di daerah Wijilan. Disebut Plengkung Tarunosuro karena dulu gerbang ini dijaga oleh para prajurit muda', '', 1, 'location', 'cdn/2023/10/tarunasura-wijilan.jpg', '59W8+FJH, Jl. Wijilan, Panembahan, Kraton, Yogyakarta City, Special Region of Yogyakarta 55131, Indo', '-7.8038148', '110.3666102', 'Tarunasura Wijilan Gate', '', 'Tarunasura Wijilan Gate', 0, 0, '00:30:00', 1800, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(10, 'yogyakarta-northern-square', 1000, '2023-02-10 22:19:15', '2023-10-09 20:16:13', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>Sejarah Alun-Alun Utara</strong><br />\r\nBeberapa sumber menyebutkan bahwa dulu permukaan alun-alun adalah pasir halus yang cocok digunakan untuk tempat latihan para prajurit juga untuk unjuk kehebatan di hadapan Sultan. Sultan dan para pembesar kerajaan duduk di Siti Hinggil, yaitu bagian muka keraton yang memiliki permukaan lebih tinggi untuk melihat atraksi para prajuritnya. Alun-alun Lor juga digunakan untuk &ldquo;Tapa Pepe&rdquo;, yaitu suatu bentuk unjuk diri dari rakyat agar didengar dan mendapat perhatian dari sultan.</p>\r\n\r\n<p>Tapa Pepe dilakukan pada siang hari terik di antara dua Pohon Beringin oleh seseorang yang sedang memohon keadilan langsung kepada Sultan. Pada masa lalu di sisi timur alun-alun terdapat pendopo-pendopo kecil yang disebut perkapalan. Perkapalan digunakan oleh para bupati untuk menginap dan beristirahat ketika menghadap sultan.</p>\r\n\r\n<p>Pada zaman dahulu, Alun-alun Lor adalah wilayah sakral dimana tidak sembarang orang diperkenankan untuk memasukinya. Ada aturan-aturan yang wajib dipatuhi jika ingin memasukinya, misalnya tidak boleh menggunakan kendaraan, sepatu, sandal, bertongkat, dan mengembangkan payung. Hal ini dilakukan sebagai wujud penghormatan kepada Raja Keraton Ngayogyakarta Hadiningrat. Namun kemudian tempat itu menjadi area publik yang bisa digunakan setiap orang. Para pedagang kaki lima bebas berjualan di sana. Berbagai acara digelar di tempat itu mulai dari konser musik, sirkus, sekaten, dan acara-acara lainnya.</p>\r\n\r\n<p><strong>Alun-Alun Lor sebagai Ruang Publik</strong><br />\r\nBerbeda dengan saat ini, Alun-alun Lor menjadi sebuah ruang publik yang bisa dimanfaatkan oleh setiap orang. Di sini dapat dijumpai berbagai macam pedagang kaki lima yang mengelilingi alun-alun dari pagi hingga malam. Pada waktu-waktu tertentu, seperti Pekan Raya Sekaten, Perayaan Grebeg Maulud Nabi, serta upacara keraton lainnya,</p>\r\n\r\n<p>Alun-alun Lor akan menjelma sebagai sebuah tempat yang ramai dan dipadati banyak orang karena acara-acara tersebut selalu digelar di alun-alun ini. Acara lain yang biasa diadakan di sini ini adalah pertunjukan seni budaya, konser musik, pasar malam, sepeda santai, dan aktivitas lainnya.</p>\r\n\r\n<p>Perjalanan ke Alun-alun Lor sangat mudah karena letaknya yang berada di tengah-tengah Kota Yogyakarta dengan kemudahan akses menuju ke sana. Jika Anda dari arah jalan Malioboro, maka lurus saja ke arah selatan melewati perempatan nol kilo meter. Dari perempatan nol kilo meter jarak ke Alun-alun Lor sekitar 100 meter.</p>\r\n\r\n<p>Berkunjung ke Alun-alun Lor, sempatkan juga untuk mengunjungi tempat wisata yang berada di sekitarnya : Keraton Yogyakarta, Masjid Gedhe, sentra Gudeg Wijilan, sentra wisata Malioboro, serta Benteng Vredeburg.</p>\r\n</body>\r\n</html>\r\n', '', 'Yogyakarta Northern Square', '', 'Yogyakarta Northern Square (alun-alun utara Yogyakarta) atau dalam Bahasa Jawa disebut Alun-alun Lor merupakan salah satu land mark Kota Yogyakarta yang berupa sebuah tanah lapang yang berada di depan Keraton Yogyakarta. Disebut Alun-alun Lor karena di Kota Yogyakarta terdapat dua alun-alun yang letaknya di sebelah selatan dan utara dari Keraton Yogyakarta.\r\nAlun-alun Lor berbentuk persegi dengan luas 150 x 150 meter dengan dua pohon beringin besar berpagar yang berada di tengah alun-alun. Dua Pohon Beringin Besar itu masing-masing diberi nama Kyai Dewandaru dan Kyai Wijayandaru. Pada masa lalu di sekeliling Alun-alun Lor ditanam 63 Pohon Beringin yang melambangkan umur Nabi Muhammad SAW.', '', 1, 'location', '', '59W7+CQV, Alun-Alun Utara St, Ngupasan, Gondomanan, Yogyakarta City, Special Region of Yogyakarta 55', '-7.8038975', '110.3644232', 'Yogyakarta Northern Square', '', 'Yogyakarta Northern Square', 0, 0, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(11, 'pasar-ngasem-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:20:55', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Saat pagi hari, Pasar Ngasem menjadi salah satu tempat favorit para pesepeda untuk beristirahat. Biasanya mereka menikmati sarapan di kursi-kursi atau gazebo yang ada di sekitar Pasar Ngasem. Udaranya memang cukup segar disini. Banyak pepohonan rindang yang menaungi.<br />\r\nBeragam menu masakan tradisional Jawa bisa Anda temukan di warung-warung makan ujung timur Pasar Ngasem, seperti sayur brongkos, sayur bobor, sayur daun pepaya. Juga lauk pauk seperti mangut lele, baceman, dan banyak yang lainnya. Selain dapat dinikmati langsung di tempat, Anda pun bisa membelinya untuk lauk di rumah. Dengan harga Rp3.000 Anda sudah bisa mendapatkan satu plastik sayur.<br />\r\nSalah satu kios yang cukup terkenal di Pasar Ngasem adalah kios Apem Beras Bu Wanti. Anda pun bisa mudah menemukannya di bagian timur Pasar Ngasem. Kios apem buka mulai dari jam 05:00 pagi. Satu apem dibanderol dengan harga Rp3.000. Apem terbuat dari tepung beras, air dan gula pasir, kemudian ditambahkan ragi, kelapa dan telur. Rasanya gurih dan manis.<br />\r\nYang menarik dari Pasar Ngasem, terdapat sebuah panggung kesenian di dalamnya yang dinamai Plaza Ngasem. Plaza tersebut kerap digunakan sebagai tempat pertunjukan seni dan budaya di Jogja, salah satunya FKY (Festival Kesenian Yogyakarta). Bahkan sebelum pandemi, setiap malamnya Plaza Ngasem ini dimanfaatkan para musisi untuk menghibur anak-anak muda yang berkunjung. Dari kejauhan pun Anda dapat melihat reruntuhan sisa bangunan situs Pulo Kenanga Tamansari yang menawan melatarbelakangi Plaza Ngasem ini. Menjadikan Plaza Ngasem begitu instagramable.<br />\r\nJika Anda menyusuri area belakang Plaza Ngasem, terdapat rumah kuno milik warga yang menjelma menjadi kafe etnik yang cukup unik. Anda pun juga akan menemukan gang yang merupakan pintu masuk menuju situs Pulo Kenanga. Berjalan lebih jauh lagi bisa membawa Anda menuju Kampung Cyber hingga Istana Air Tamansari.</p>\r\n</body>\r\n</html>\r\n', '', 'Pasar Ngasem', '', 'Pasar Ngasem merupakan salah satu pasar tradisional tua di Yogyakarta, sudah berdiri sejak tahun 1809. Dulunya, Pasar Ngasem begitu identik dengan pasar burung. Begitu masuk ke dalam akan terlihat kandang-kandang burung yang bergantungan di setiap kios.\r\nNamun sejak tahun 2010, pasar burung telah direlokasi ke Pasar Satwa dan Tanaman Hias Yogyakarta (PASTY) di Jalan Bantul. Kini, Pasar Ngasem menjadi pasar tradisional pada umumnya yang menjual aneka jajan pasar serta kebutuhan pokok sehari-hari.\r\nLahan di tengah pasar pun disulap menjadi mini tribun yang sering digunakan untuk acara seni dan budaya. Backgroundnya bangunan kuno Pulo Kenanga Tamansari yang begitu megah.', '', 1, 'location', 'cdn/2023/10/3.jpg', 'Jl. Polowijan No.11, Patehan, Kraton, Yogyakarta City, Special Region of Yogyakarta 55133, Indonesia', '-7.8082845', '110.3602155', 'Pasar Ngasem', '', 'Pasar Ngasem', 0, 0, '00:45:00', 2700, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(12, 'museum-sandi', 1000, '2023-02-10 22:19:15', '2023-10-08 22:38:00', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Setelah Kemerdekaan Indonesia situasi dan kondisi Kota Yogyakarta turut berubah dengan drastis. Banyak bangunan milik orang-orang Belanda yang ditinggalkan dan terbengkalai karena situasi pergantian kekuasaan dan perang. Kemudian disusul dengan berpindahnya Ibukota Republik Indonesia dari Jakarta ke Yogyakarta pada 1946. Pada masa ini dibutuhkan banyak bangunan sebagai kantor kementerian, salah satu bangunan yang mengalami alih fungsi adalah bangunan ini. Pada masa kemerdekaan bangunan ini berfungsi sebagai Kantor Kementerian Luar Negeri RI.</p>\r\n\r\n<p>Setelah situasi keamanan dan ketertiban semakin membaik Ibukota RI kembali ke Jakarta dan bangunan ini masih digunakan sebagai kantor dan dikelola oleh Pemerintah DIY. Beberapa kali berganti fungsi sebagai kantor hingga perpustakaan pada saat ini bangunan ini difungsikan sebagai Museum Sandi. Museum ini diinisiasi bersama antara Kepala Lembaga Sandi Negara RI, pada waktu itu Mayjen TNI Nachrowi Ramli, dengan Gubernur Daerah Istimewa Yogyakarta, Sri Sultan Hamengku Buwono X, pada tahun 2006. &nbsp;Hingga pada 29 Januari 2014 Museum Sandi diresmikan dan memulai kegiatan operasionalnya.</p>\r\n\r\n<p>Museum Sandi berisikan sejarah persandian di dunia secara umum dan Indonesia secara khusus. Salah satu koleksi unggulan yang ada adalah peralatan sandi yang digunakan pada masa Agresi Militer Belanda I dan II. Selain itu museum ini juga memuat sejarah pendirian institusi pengamanan berita rahasia pada awal kemerdekaan Indonesia yang didirikan oleh Bapak Persandian Indonesia &nbsp; dr. Roebiono Kertopati.&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Museum Sandi', '', 'MUSEUM SANDI merupakan bangunan warisan budaya yang terletak di Jalan F.M. Noto No. 21 Kotabaru. Bangunan ini berada di dalam Kawasan Kotabaru yang merupakan kawasan hunian masyarakat Eropa pada masa Kolonial. Kawasan Kotabaru mulai dibangun pada 1920 sebagai hasil perluasan wilayah pemukiman orang Eropa.', '', 1, 'location', 'cdn/2023/10/museum-sandi-2.jpg', 'Jl. Faridan M Noto No.21, Kotabaru, Gondokusuman, Yogyakarta City, Special Region of Yogyakarta 5522', '-7.7845549', '110.3711548', 'Museum Sandi', '', 'Museum Sandi', 0, 3000, '01:30:00', 5400, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(13, 'tugu-1', 1000, '2023-02-10 22:19:15', '2023-10-09 19:28:17', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Monumen ini dibangun oleh Sri Sultan Hamengkubuwono I pada tahun 1755. Dikenal sebagai Tugu Golong-Gilig, dan dibangun dalam semangat persatuan rakyat. Di puncak tugu berbentuk bulat (golong) dan tiangnya berbentuk silindris (gilig), demikianlah namanya. Ketinggian monumen tersebut adalah 25 meter. Dibangun di Garis Imajiner Yogyakarta yang menghubungkan laut selatan, Keraton Ngayogyakarta Hadiningrat, dan Gunung Merapi. Pada saat bertapa, konon Sultan Yogyakarta saat itu menggunakan tugu ini sebagai patokan untuk menghadap ke puncak Gunung Merapi.&nbsp;<br />\r\n<br />\r\nMonumen ini runtuh saat gempa bumi besar yang terjadi pada 10 Juni 1867. Pada tahun 1889, pemerintah kolonial Hindia Belanda merenovasi monumen dengan bentuk persegi. Bagian atas monumen dibangun dengan bentuk kerucut, bukan berbentuk bulat seperti sebelumnya, dengan bola kecil di ujungnya. Ketinggian monumennya juga berkurang dari 25 meter menjadi 15 meter. Sejak itu, monumen ini juga dikenal pada saat itu sebagai De Witte Paal (Monumen Putih).<br />\r\n<br />\r\nDi tahun 2012, renovasi tugu telah selesai dilakukan. Pengecatan sebagian ornamen tugu juga selesai dilakukan dengan warna kuning yang mengandung emas 22 karat. Sebuah taman kecil juga telah dibuat di sekitar tugu.</p>\r\n</body>\r\n</html>\r\n', '', 'Tugu', '', 'Tugu Yogyakarta adalah sebuah tugu atau monumen yang sering dipakai sebagai simbol atau lambang dari Kota Yogyakarta, Daerah Istimewa Yogyakarta. Tugu yang terletak di perempatan Jalan Jenderal Sudirman dan Jalan Margo Utomo ini, mempunyai nilai simbolis yang merupakan garis yang bersifat magis yang menghubungkan Pantai Parangtritis dan Panggung Krapyak di Kabupaten Bantul, Keraton Yogyakarta di Kota Yogyakarta dan Gunung Merapi di Kabupaten Sleman. Tugu ini sekarang merupakan salah satu objek pariwisata Yogyakarta, dan sering dikenal dengan istilah “Tugu Pal Putih” (pal juga berarti tugu), karena warna cat yang digunakan sejak dulu adalah warna putih. Tugu pal ini berbentuk bulat panjang dengan bola kecil dan ujung yang runcing di bagian atasnya. Jika dilihat dari Keraton Yogyakarta ke arah utara, maka akan terlihat bahwa Jalan Malioboro, Jalan Margo Utomo, Tugu Yogyakarta, dan Jalan A.M. Sangadji membentuk garis lurus menuju puncak Gunung Merapi yang dikenal sebagai Garis Imajiner Yogyakarta.', '', 1, 'location', 'cdn/2023/10/tugu-yogyakarta.jpg', 'Jl. Jend. Sudirman, Gowongan, Jetis, Yogyakarta City, Special Region of Yogyakarta 55233, Indonesia', '-7.7829218', '110.3670757', 'Tugu', '', 'Tugu', 0, 0, '01:00:00', 3600, 4.8, 'D.I. Yogyakarta', 0, 0, 0);
