(14, 'desa-wisata-gerabah-kasongan-yogyakarta', 1000, '2023-02-10 22:19:15', '2023-10-12 11:21:21', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\"><strong>Sejarah</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Sejarah desa wisata Kasongan berawal dari kematian seekor kuda milik Reserse Belanda di atas persawahan milik seorang warga di sebuah desa di selatan&nbsp;Kota Yogyakarta. Karena si pemilik tanah takut akan dijatuhi hukuman oleh Belanda yang waktu itu sedang menjajah, maka pemilik tanah tersebut melepaskan hak kepemilikan tanahnya yang diikuti oleh warga lainnya yang juga takut akan dijatuhi hukuman. Sejumlah tanah persawahan itu akhirnya diakui oleh warga desa lain. Penduduk yang tidak memiliki tanah persawahan tadi akhirnya memulai kegiatan baru di sekitar rumahnya, yaitu mengolah tanah liat yang ternyata tidak pecah jika diempal-empalkan untuk perlengkapan dapur dan juga untuk mainan.</p>\r\n\r\n<p style=\"text-align: justify;\">Sejalan dengan perkembangan zaman, maka barang-barang kerajinan dari tanah liat atau lebih dikenal dengan kerajinan gerabah atau tembikar itu dikembangkan menjadi lebih variatif sesuai dengan kebutuhan dan keinginan pasar. Bahkan barang kerajinan di Desa Kasongan bukan hanya barang-barang dari tanah liat/ gerabah, tetapi saat ini warga Kasongan telah memanfaatkan bahan-bahan lainnya yang banyak terdapat di lingkungan sekitar seperti batok kelapa, bambu, rotan, kayu, dan lainnya untuk diolah menjadi barang hiasan yang memiliki&nbsp;nilai lebih tinggi. Keahlian membuat gerabah ini diwariskan turun-temurun hingga menjadikan Desa Kasongan sebagai ikon desa wisata gerabah di Kabupaten Bantul.</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<strong>Desa Wisata Kasongan</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Desa wisata Kasongan merupakan daerah pemukiman para kundi, atau buyung atau gundi, yang artinya orang yang membuat sejenis buyung, gendi, kuali, dan lainnya yang tergolong peralatan dapur, juga barang hiasan yang terbuat dari tembikar atau tanah liat.</p>\r\n\r\n<p style=\"text-align: justify;\">Hingga saat ini Desa Kasongan menjadi salah satu tujuan desa wisata di Yogyakarta yang banyak diminati oleh wisatawan. Deretan show room atau rumah-rumah galeri di desa wisata Kasongan ini menawarkan barang-barang kerajinan dari gerabah serta dari bahan lainnya seperti guci, pot bunga, lampu hias, miniatur alat transportasi (becak, sepeda, &nbsp;mobil), aneka tas, patung, souvenir untuk pengantin, serta hiasan lainnya yang menarik untuk dipajang di rumah.</p>\r\n\r\n<p style=\"text-align: justify;\">Salah satu patung yang legendaris di Desa Kasongan adalah patung Loro Blonyo. Loro Blonyo adalah patung sepasang pengantin yang dipercaya akan memberikan keberuntungan jika ditaruh di dalam rumah. Kita bisa menjumpai patung ini dalam berbagai pose. Patung ini pertama kali dikenalkan oleh Galeri Loro Blonyo yang diadopsi dari patung pengantin milik&nbsp;Kraton Yogyakarta.</p>\r\n\r\n<p style=\"text-align: justify;\">Jika Anda tertarik untuk mengetahui lebih lanjut tentang proses pembuatan kerajinan gerabah tersebut, maka beberapa galeri menawarkan kursus singkat untuk Anda ikuti. Anda juga bisa melihat proses pembuatan gerabah di beberapa rumah produksi.</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<strong>Lokasi</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Desa Wisata Kasongan terletak di pedukuhan Kajen, Desa Bangunjiwo, Kecamatan Kasihan Kabupaten Bantul, Yogyakarta. Jika Anda berangkat dari Kota Yogyakarta, maka pergilah ke arah selatan hingga menemukan perempatan Dongkelan (perempatan Ring Road Selatan - Jalan. Bantul). Pilihlah jalan ke arah selatan melewati Jalan Bantul ini. Perjalanan dari perempatan Dongkelan ini hanya memakan waktu sekitar 10 menit atau 20 menit dari pusat kota. Jika telah sampai di desa wisata Kasongan, Anda akan disambut oleh sebuah gerbang masuk ke desa wisata tersebut.</p>\r\n</body>\r\n</html>\r\n', '', 'Desa Wisata Gerabah Kasongan Yogyakarta', '', 'Desa wisata Kasongan merupakan daerah pemukiman para kundi, atau buyung atau gundi, yang artinya orang yang membuat sejenis buyung, gendi, kuali, dan lainnya yang tergolong peralatan dapur, juga barang hiasan yang terbuat dari tembikar atau tanah liat. Hingga saat ini Desa Kasongan menjadi salah satu tujuan desa wisata di Yogyakarta yang banyak diminati oleh wisatawan. Deretan show room atau rumah-rumah galeri di desa wisata Kasongan ini menawarkan barang-barang kerajinan dari gerabah serta dari bahan lainnya seperti guci, pot bunga, lampu hias, miniatur alat transportasi (becak, sepeda,  mobil), aneka tas, patung, souvenir untuk pengantin, serta hiasan lainnya yang menarik untuk dipajang di rumah.', '', 1, 'location', 'cdn/2023/10/gerabah-kasongan.jpg', 'Jl. Kasongan No.3, Kajen, Bangunjiwo, Kec. Kasihan, Kabupaten Bantul, Daerah Istimewa Yogyakarta 551', '-7.8455358', '110.3379568', 'Desa Wisata Gerabah Kasongan Yogyakarta', 'Desa Wisata Gerabah Kasongan Yogyakarta', 'Desa Wisata Gerabah Kasongan Yogyakarta', 0, 0, '00:30:00', 1800, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(15, 'pojok-benteng-wetan-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:32:07', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Keraton Yogyakarta memiliki sudut-sudut benteng dengan bentuk visual unik. Keunikan ini menjadi ciri khas tersendiri yang tidak dimiliki kota lainnya. Mengutip dari pariwisata.jogjakota.go.id, sudut-sudut benteng tersebut umumnya dijuluki bastion atau pojok beteng. Masyarakat Yogyakarta biasanya menyebutnya dengan cara menyingkat pojong beteng menjadi jokteng. Bangunan kokoh berupa benteng tersebut memang lebih populer disebut beteng karena masyarakat Yogyakarta suka mempersingkat kata. Penyebutan tersebut juga lebih mempermudah pengucapannya.<br />\r\nBeteng dibangun berbentuk empat persegi mengelilingi kompleks Keraton Yogyakarta. Tembok beteng dibangun menjulang tinggi dan tebal. Karena berbentuk persegi, mata seharusnya ada empat sudut yang biasa disebut Jokteng. Tapi ternyata, saat ini hanya tersisa tiga Jokteng saja.<br />\r\nJokteng yang masih ada adalah Jokteng di sebelah barat laut keraton yang kini disebut Jokteng Lor (Utara), lalu Jokteng sebelah tenggara keraton yang kini disebut Jokteng Wetan (Timur), dan Jokteng barat daya keraton yang kini disebut Jokteng Kulon (Barat). Sementara satu pojok benteng yang terletak di sebelah utara-timur keraton sempat hancur akibat serangan pasukan Inggris pada peristiwa Geger Spei (Geger Sepehi atau Geger Sepoy).<br />\r\nPojok beteng wetan yang dalam bahasa Indonesia berarti pojok beteng timur dilengkapi dengan tempat pengintaian. Terdapat tiga tempat pengintaian, sepuluh tempat prajurit, dan satu gudang yang diduga sebagai gudang mesiu.<br />\r\nPojok beteng wetan ini tepatnya berada di sebelah barat perempatan Jalan Brigjend Katamso - Jalan Parangtritis - Jalan May. Jend. Sutoyo - Jalan Kolonel Sugiono.</p>\r\n</body>\r\n</html>\r\n', '', 'Pojok Benteng Wetan', '', 'Pojok Beteng Wetan atau dalam Bahasa Indonesia berarti Pojok Beteng Timur. Pojok Beteng Wetan dilengkapi dengan tempat pengintain yang berjumlah tiga, tempat prajurit berjumlah sepuluh buah, dan sebuah gudang yang diduga sebagai gudang mesiu. Pojok Beteng Wetan ini tepatnya berada di sebelah barat perempatan Jl. Brigjend Katamso - Jl. Parangtritis - Jl. May. Jend. Sutoyo - Jl.Kolonel Sugiono.', '', 1, 'location', 'cdn/2023/10/8.jpg', '59P9+49Q, Jl. Sisingamangaraja, Keparakan, Kec. Mergangsan, Kota Yogyakarta, Daerah Istimewa Yogyaka', '-7.8146508', '110.3684854', 'Pojok Benteng Wetan', '', 'Pojok Benteng Wetan', 0, 0, '00:30:00', 1800, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(16, 'situs-gua-seluman-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:55:37', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Situs Goa Siluman dibangun pada daerah yang menjadi arah aliran serta sumber air sehingga terletak lebih indah dari daerah di sekitarnya/berupa lembah. Situs ini mempunyai dua sumber air utama, yaitu di dalam bilik pesanggrahan dan air yang dialirkan dari luar kompleks pesanggrahan. Aliran air dari luar terlihat dari adanya bekas saluran air yang masih dapat disaksikan hingga saat ini meskipun tidak berfungsi lagi.<br />\r\nPada bagian depan berupa pintu masuk berbentuk paduraksa dan mempunyai hiasan manukberi pada ambang atasnya. Pada bagian belakang berupa bangunan pemandian yang mempunyai sebuah pintu di sisi selatan. Di sisi timur terdapat sebuah kolam pemandian yang dipisahkan dengan pintu dan disekat menggunakan kelir berhias motif bunga dan sulur-suluran.<br />\r\nKolam mini mempunyai sumber mata air sendiri. Pada sisi barat dan timur terdapat bangunan berbentuk lengkung yang berfungsi sebagai pelindung pintu. Pada sudut tenggara terdapat selasar serta sebuah trap tangga. Pada sisi selatan terdapat kolam besar yang saat ini dimanfaatkan untuk kolam ikan oleh penduduk sekitar.<br />\r\nKolam sudut barat daya mempunyai hiasan berupa manukberi yang mencengkeram ular, sedangkan kolam sudut tenggara terdapat hiasan berupa seekor naga. Sisi selatan kolam besar dibatasi dengan pagar keliling, namun saat ini sudah tidak dapat ditemukan lagi bentuk utuhnya dan hanya tinggal sisa-sisanya.</p>\r\n</body>\r\n</html>\r\n', '', 'Situs Gua Seluman', '', 'Pesanggrahan Gua Siluman dibangun oleh Sultan Hamengku Buwono II. Konon, Panembahan Senopati alias Danang Sutowijoyo, pendiri Kerajaan Mataram Islam, mendirikan kerajaannya di kawasan Kota Gede. Lalu raja yang menjabat pada waktu itu mendapat wangsit untuk memindahkan kerajaan dari Kota Gede ke kawasan Wonocatur, Bantul.', '', 1, 'location', 'cdn/2023/10/20.jpg', 'Jl. Wonocatur No.26, Karang Bendo, Banguntapan, Kec. Banguntapan, Kabupaten Bantul, Daerah Istimewa ', '-7.802813', '110.413899', 'Situs Gua Seluman', '', 'Situs Gua Seluman', 0, 0, '01:00:00', 3600, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
(17, 'pojok-benteng-kulon-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:30:04', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Bagi orang yang pernah berkunjung ke Yogyakarta pasti sudah tak asing dengan sebuah bangunan bersejarah Pojok Beteng atau alias Jokteng. Ya, Pojok Beteng merupakan sudut dari beteng yang mengelilingi kawasan Keraton Yogyakarta. Beteng itu didirikan atas prakarsa Sri Sultan Hamengku Buwono II ketika masih menjadi putra mahkota pada 1785-1787 silam. Bangunan ini kemudian diperkuat lagi sekitar 1809 ketika dia telah menjabat sebagai Sultan. Beteng ini dinamai dengan Beteng Baluwerti, yang berarti jatuhnya peluru laksana hujan.<br />\r\nKeraton Yogyakarta memiliki sudut-sudut benteng dengan bentuk visual unik. Keunikan ini menjadi ciri khas tersendiri yang tidak dimiliki kota lainnya. Mengutip dari pariwisata.jogjakota.go.id, sudut-sudut benteng tersebut umumnya dijuluki bastion atau pojok beteng. Masyarakat Yogyakarta biasanya menyebutnya dengan cara menyingkat pojong beteng menjadi jokteng. Bangunan kokoh berupa benteng tersebut memang lebih populer disebut beteng karena masyarakat Yogyakarta suka mempersingkat kata. Penyebutan tersebut juga lebih mempermudah pengucapannya.<br />\r\nBeteng dibangun berbentuk empat persegi mengelilingi kompleks Keraton Yogyakarta. Tembok beteng dibangun menjulang tinggi dan tebal. Karena berbentuk persegi, mata seharusnya ada empat sudut yang biasa disebut Jokteng. Tapi ternyata, saat ini hanya tersisa tiga Jokteng saja.<br />\r\nJokteng yang masih ada adalah Jokteng di sebelah barat laut keraton yang kini disebut Jokteng Lor (Utara), lalu Jokteng sebelah tenggara keraton yang kini disebut Jokteng Wetan (Timur), dan Jokteng barat daya keraton yang kini disebut Jokteng Kulon (Barat). Sementara satu pojok benteng yang terletak di sebelah utara-timur keraton sempat hancur akibat serangan pasukan Inggris pada peristiwa Geger Spei (Geger Sepehi atau Geger Sepoy).</p>\r\n</body>\r\n</html>\r\n', '', 'Pojok Benteng Kulon', '', 'Pojok Beteng Kulon atau dalam Bahasa Indonesia berarti Pojok Beteng Barat. Disebut demikian karena letak Pojok benteng ini berada di sisi paling barat dan paling selatan dari wilayah Kraton Yogyakarta. Pojok Beteng Kulon dilengkapi dengan tempat pengintaian yang jumlahnya ada tiga buah dan tempat prajurit sebanyak sepuluh buah. Tetapi Pojok Beteng Kulon tidak dilengkapi dengan ruangan yang berfungsi sebagai gudang mesiu. Posisi Pojok Beteng Kulon tepatnya berada di sisi timur perempatan Jl. Wachid Hasyim - Jl. Bantul - Jl. Sugeng Jeroni - Jl.Let Jend MT Haryono.', '', 1, 'location', 'cdn/2023/10/7.jpg', '59P4+VC9, Mantrijeron, Jl. Suryowijayan, Patehan, Kecamatan Kraton, Kota Yogyakarta, Daerah Istimewa', '-7.8128408', '110.356113', 'Pojok Benteng Kulon', '', 'Pojok Benteng Kulon', 0, 0, '00:45:00', 2700, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(18, 'pakualaman-palace-1', 1000, '2023-02-10 22:19:15', '2023-10-08 22:52:26', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>&nbsp;Pakualaman berlokasi di Jalan Sultan Agung Yogyakarta. Pura Pakualaman adalah Istana Kadipaten yang didirikan pada awal abad 19 M yang sekarang menjadi tempat tinggal Sri Paduka Paku Alam IX beserta keluarganya. Sri Paduka Paku Alam IX beserta keluarganya.<br />\r\n&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Pakualaman Palace', '', ' Pakualaman berlokasi di Jalan Sultan Agung Yogyakarta. Pura Pakualaman adalah Istana Kadipaten yang didirikan pada awal abad 19 M yang sekarang menjadi tempat tinggal Sri Paduka Paku Alam IX beserta keluarganya. Sri Paduka Paku Alam IX beserta keluarganya.\r\n', '', 1, 'location', 'cdn/2023/10/pakualaman.jpg', '692G+4F4, Purwokinanti, Pakualaman, Kota Yogyakarta, Daerah Istimewa Yogyakarta 55166, Indonesia', '-7.7997354', '110.3762182', 'Pakualaman Palace', '', 'Pakualaman Palace', 0, 0, '01:00:00', 3600, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(19, 'museum-perjuangan', 1000, '2023-02-10 22:19:15', '2023-10-08 22:35:19', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Saat menapaki museum, sejumlah tujuh belas anak tangga, pintu utama dengan delapan daun pintu, dan empat puluh lima buah jendela mengelilingi dindingnya merupakan simbol-simbol yang sejenak menuntun kembali pada saat Proklamasi dikumandangkan.<br />\r\nHarga Tiket Masuk&nbsp;<br />\r\nWisatawan domestik :<br />\r\nDewasa perorangan : Rp. 2000<br />\r\nDewasa rombongan : Rp. 1000<br />\r\nAnak - anak perorangan : Rp. 1000<br />\r\nAnak-anak rombongan : Rp. 500<br />\r\nWisatawan mancanegara :<br />\r\nDewasa dan anak - anak : Rp. 10.000<br />\r\nJam Buka:</p>\r\n\r\n<p>Senin - Kamis : Pukul 08.00 - 16.00 WIB<br />\r\nJumat &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Pukul 08.00 - 16.30 WIB<br />\r\nKoleksi Museum<br />\r\nMeriam V.O.C. yang ditemukan di benteng Vredeburg<br />\r\nMiniatur kapal Armada Laut Belanda<br />\r\nMeja dan kursi tamu kapten Widodo saat di Bantul<br />\r\nRepilka senjata serdadu V.O.C.<br />\r\nBuku ilmu kedokteran dari Stovia<br />\r\nTas kulit milik Drs. Muh. Hatta<br />\r\nDan lain - lain&nbsp;<br />\r\nCara Menuju Lokasi<br />\r\nDari Purawisata, Yogyakarta<br />\r\nJarak tempuh : 2 km<br />\r\nWaktu tempuh : 5 menit<br />\r\nRute :<br />\r\nDari Purawisata menuju ke selatan sampai perempatan jalan Parangtritis lalu belok kiri (ke timur)<br />\r\nKira-kira 200 meter ada halte bus transjogja Sugiono 2 di kanan jalan (selatan) lalu belok kanan<br />\r\nLokasi museum ada di belakang halte tersebut<br />\r\nFasilitas Museum Perjuangan<br />\r\nRuang pameran indoor dan outdoor&nbsp;<br />\r\nTaman bermain<br />\r\nTempat parkir&nbsp;<br />\r\nToilet<br />\r\nHotspot area</p>\r\n</body>\r\n</html>\r\n', '', 'Museum Perjuangan', '', 'Museum Perjuangan adalah sebuah museum di Yogyakarta yang didirikan untuk mengenang sejarah perjuangan Bangsa Indonesia dan mengenang setengah abad masa Kebangkitan Nasional. Arsitektur bangunan ini tampak sebagai bentuk perpaduan antara bangunan Romawi Kuno dan gaya bangunan candi-candi di Indonesia', '', 1, 'location', 'cdn/2023/10/museum-perjuangan.jpg', 'Jl. Kolonel Sugiyono No.24, Brontokusuman, Mergangsan, Yogyakarta City, Special Region of Yogyakarta', '-7.8164905', '110.3718611', 'Museum Perjuangan', '', 'Museum Perjuangan', 0, 10000, '01:30:00', 5400, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(20, 'omah-ugm-kotagede-yogyakarta-1', 1000, '2023-02-10 22:19:15', '2023-10-08 23:01:13', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Omah UGM adalah sebuah rumah adat di Kotagede. Pada tahun 2007, UGM membelinya dari keluarga Parto Darsono. Meski lokasinya di Desa Jagalan, sedang kita tahu selainnya ada Kelurahan Purbayan dan Prenggan, prinsipnya rumah adat ini dapat digunakan oleh siapa saja. Rumah adat Jawa sebenarnya terdiri dari beberapa bangunan, antara lain ndalem, pendapa dan gandok. Pendapa rumah ini sudah lama tidak ada. Untuk itu, dicarilah sebuah pendapa yang kemudian dipasangkan di sebelah selatan bagian ndalem. Pendapa memang selalu berada di depan ndalem.<br />\r\n&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Omah UGM Kotagede Yogyakarta', '', 'Omah UGM adalah sebuah rumah adat di Kotagede. Pada tahun 2007, UGM membelinya dari keluarga Parto Darsono. Meski lokasinya di Desa Jagalan, sedang kita tahu selainnya ada Kelurahan Purbayan dan Prenggan, prinsipnya rumah adat ini dapat digunakan oleh siapa saja.', '', 1, 'location', '', 'Bodon, Jagalan, Kotagede, Yogyakarta City, Special Region of Yogyakarta 55192, Indonesia', '-7.8293112', '110.3956256', 'Omah UGM Kotagede Yogyakarta', '', 'Omah UGM Kotagede Yogyakarta', 0, 10000, '01:30:00', 5400, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(21, 'pasar-kotagede-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:19:05', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Bagi sebagian orang, melakukan suatu hal yang mengingatkan akan kenangan masa kecil adalah hal yang menyenangkan. Salah satunya menikmati kembali jajanan pasar yang menjadi kudapan sewaktu kecil. Sayangnya, seiring berlalunya waktu tak banyak ditemukan orang yang menjual jajanan pasar tradisional ini. Jika Anda rindu dengan jajanan pasar yang sering Anda makan saat kecil dulu, kami akan mengajak Anda berkeliling Pasar Kotagede.<br />\r\nPasar Kotagede atau yang lebih dikenal dengan nama Pasar Legi Kotagede adalah pasar rakyat yang telah berdiri sejak zaman Panembahan Senopati, pada masa kerajaan Mataram Islam. Meski sudah mengalami renovasi, namun bentuk bangunan aslinya tetap dipertahankan. Masih diapit oleh Monumen Jumenengan Sri Sultan Hamengkubuwono IX yang disebut dengan Pacak Suji di sisi timur laut, dan gardu listrik induk tempo dulu yang dikenal dengan sebutan Babon Aniem di sisi barat laut pasar. Pelatarannya rimbun dengan pepohonan yang berjajar rapi, dan tentu saja selalu penuh sesak dengan aktivitas jual beli, khususnya pada hari pasaran Legi (penanggalan Jawa).<br />\r\nPara pedagang tradisional pada pagi hari menjual berbagai macam keperlua rumah tangga seperti :</p>\r\n\r\n<ul>\r\n	<li>Makanan tradisional &nbsp;atau jajan pasar</li>\r\n	<li>Peralatan rumah tangga</li>\r\n	<li>Sayuran</li>\r\n	<li>Buah-buahan</li>\r\n	<li>Makanan snack basah dan kering</li>\r\n	<li>Jamu</li>\r\n	<li>Lauk pauk siap saji</li>\r\n	<li>Daging dan ayam</li>\r\n	<li>Bumbu dapur</li>\r\n	<li>Pakaian</li>\r\n	<li>Rempah-rempah</li>\r\n</ul>\r\n\r\n<p>Sementara yang pedagang pagi mulai mengemasi dagangannya,yang pedagang malam mulai berdatangan, dagangan yang mereka jual antara lain :</p>\r\n\r\n<ul>\r\n	<li>Aneka snack atau jajanan pasar</li>\r\n	<li>Jamu</li>\r\n	<li>Lauk pauk</li>\r\n	<li>Konveksi</li>\r\n	<li>Klithikan</li>\r\n	<li>Segala macam permainan anak</li>\r\n</ul>\r\n</body>\r\n</html>\r\n', '', 'Pasar Kotagede', '', 'Pasar Kotagede, pasar rakyat tertua di Jogja yang menyimpan \'harta karun\' tersembunyi bagi pemburu kuliner langka. Tak sekedar menjelajah rasa, mencicipinya mengingatkan kita pada masa kecil nan ceria.', '', 1, 'location', 'cdn/2023/10/2.jpg', '59CX+MW7, Jl. Mentaok Raya, Purbayan, Kotagede, Yogyakarta City, Special Region of Yogyakarta 55173,', '-7.8283312', '110.3997949', 'Pasar Kotagede', '', 'Pasar Kotagede', 0, 0, '00:15:00', 900, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(22, 'bentara-budaya-yogyakarta-bby-1', 1000, '2023-02-10 22:19:15', '2023-10-12 10:03:31', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Bentara Budaya Yogyakarta&nbsp;adalah&nbsp;lembaga&nbsp;kebudayaan di bawah naungan&nbsp;Kelompok Kompas Gramedia, beralamat di Jalan Suroto 2,&nbsp;Kotabaru,&nbsp;Yogyakarta.&nbsp;Bentara Budaya Yogyakarta didirikan serta didukung dana oleh Kelompok Kompas Gramedia.&nbsp;Bentara Budaya secara reguler mengadakan berbagai macam acara&nbsp;kesenian, seperti&nbsp;pameran&nbsp;dan pagelaran, pemutaran&nbsp;film&nbsp;dan diskusi bulanan. Selain mengangkat budaya Indonesia, Bentara Budaya juga kerap mengadakan kerja sama dengan lembaga seni lainnya dari lintas negara.&nbsp;Lembaga ini dipimpin oleh seorang direktur eksekutif, dan memiliki seorang koordinator pelaksana yang berkedudukan di Jakarta.&nbsp;Untuk menentukan acara-acara yang berlangsung di Bentara Budaya Yogyakarta akan melalui seleksi oleh Dewan Kurator. Semua proposal yang masuk dibahas dalam Rapat Dewan Kurator.</p>\r\n</body>\r\n</html>\r\n', '', 'Bentara Budaya Yogyakarta (BBY)', '', 'Bentara Budaya Yogyakarta adalah lembaga kebudayaan di bawah naungan Kelompok Kompas Gramedia, beralamat di Jalan Suroto 2, Kotabaru, Yogyakarta. Bentara Budaya Yogyakarta didirikan serta didukung dana oleh Kelompok Kompas Gramedia. Bentara Budaya secara reguler mengadakan berbagai macam acara kesenian, seperti pameran dan pagelaran, pemutaran film dan diskusi bulanan.', '', 1, 'location', 'cdn/2023/10/bentara-budaya.jpg', 'Jl. Suroto No.2, Kotabaru, Gondokusuman, Yogyakarta City, Special Region of Yogyakarta 55224, Indone', '-7.7857242', '110.3746954', 'Bentara Budaya Yogyakarta (BBY)', 'Bentara Budaya Yogyakarta (BBY)', 'Bentara Budaya Yogyakarta (BBY)', 0, 0, '01:30:00', 5400, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(23, 'panggung-krapyak-kandang-menjangan-1', 1000, '2023-02-10 22:19:15', '2023-10-08 22:54:05', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Konon Krapyak adalah sebuah hutan yang menjadi habitat banyak satwa salah satunya rusa atau menjangan. Keluarga kerajaan Mataram Islam sangat gemar berburu di tempat ini salah satunya Prabu Hanyokrowati putra Panembahan Senopati. Kegemarannya berburu menyebabkan beliau meninggal di hutan Krapyak pada tahun 1610. Beliau diberi gelar Panembahan Seda Krapyak dan disemayamkan di Kotagede.</p>\r\n\r\n<p>Panggung Krapyak dibangun sekitar tahun 1760 oleh Sri Sultan HB I yang memiliki kegemaran yang sama dengan Prabu Hanyokrowati yaitu berburu. Panggung sebagai pos berburu sekaligus sebagai daerah pertahanan dari binatang buas.Panggung Krapyak yang menyerupai kotak ini memiliki ukuran luas 17,6 m x 15 m dan tinggi 10 m. Dindingnya terbuat dari batu bata merah yang dilapisi semen. Pada setiap sisinya terdapat sebuah pintu dan dua buah jendela yang berada di kanan kirinya. Bangunan ini terdiri dari dua lantai. Lantai bawah terbagi ke dalam empat ruangan yang dihubungkan oleh lorong. Lantai atas atau atapnya adalah sebuah tempat terbuka yang dibatasi oleh pagar di keempat sisinya yang digunakan sebagai tempat berburu binatang. Beberapa orang menduga jika bangunan ini juga digunakan oleh prajurit Mataram sebagai pos pertahanan. Konon dari tempat ini gerakan musuh dari arah selatan bisa dipantau sehingga bisa memberikan peringatan kepada Keraton jika ada bahaya.</p>\r\n</body>\r\n</html>\r\n', '', 'Panggung Krapyak (Kandang Menjangan)', '', 'alah satu bangunan yang masuk dalam garis imajiner kota Yogyakarta, Gunung Merapi, Tugu Jogja, Kraton Yogyakarta, Panggung Krapyak dan Laut Selatan. Terletak di bagian selatan Keraton Yogyakarta, Panggung Krapyak adalah sebuah bangunan bersejarah berbentuk ruangan menyerupai kubus. Bagian dinding kini tampak berwarna hitam, menunjukkan usianya yang hampir menyamai usia Kota Yogyakarta, seperempat milenium. Bangunan tampak masih kokoh, walau beberapa bagian mengalami kerusakan akibat gempa 27 Mei 2006 lalu.', '', 1, 'location', 'cdn/2023/10/panggung-krapyak-jogja-foto-gmap-jasa-service-ac-jogja-sentosa-teknik-1024x660.jpg', '59C6+W6X, Jl. KH. Ali Maksum, Krapyak Kulon, Panggungharjo, Kec. Sewon, Kabupaten Bantul, Daerah Ist', '-7.8276355', '110.3606071', 'Panggung Krapyak (Kandang Menjangan)', '', 'Panggung Krapyak (Kandang Menjangan)', 0, 0, '00:30:00', 1800, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(24, 'pusat-kuliner-belut-godean-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:38:50', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Para penikmat belut tentu pernah mendengar pusat Kuliner Belut Godean yang berlokasi di Jalan Godean km 10, sebelah timur Pasar Godean, Yogyakarta. Awalnya Kuliner Belut Godean berada dalam satu area dengan Pasar Godean, namun karena ramainya pembeli akhirnya dipisah menjadi kawasan sendiri agar lebih nyaman dan tidak menjadi penyebab kemacetan lalu lintas. Pemerintah Kabupaten Sleman memindahkan kuliner belut ini ke area terpusat yang disebut Pusat Kuliner Belut Godean.<br />\r\nDi sentra kuliner olahan belut ini, ada puluhan pedagang jajanan keripik belut yang bisa dimakan sebagai camilan atau oleh-oleh khas Sleman. Masuk lebih dalam ke area ini, Anda bisa mencoba berbagai macam olahan belut basah atau makanan berat dengan berbagai macam menu.<br />\r\nDi &nbsp;lesehan Pendopo milik Mbak Atin tersedia rica-rica belut, gulai belut, belut geprek, bothok belut, aneka sambal belut, belut goreng pedas manis, serta aneka saos belut. Ada juga warung lain yang menawarkan rendang belut, tongseng belut, balado belut, opor belut, serta oseng belut. Di warung Rahmah ada menu belut goreng pandan, sambel belut goreng, wader goreng, sambel wader. Sedangkan warung Yu Sud punya masakan khas mangut belut.<br />\r\nPara pemilik warung di atas memang jagoan mengolah kuliner belut. Mereka adalah para pemenang lomba olahan belut yang diadakan pemerintah daerah. Warung-warung belut ini biasanya ramai ketika akhir pekan dan hari libur. Bahkan ada juga rombongan yang memesan secara khusus masakan belut untuk kemudian dimakan secara beramai-ramai.<br />\r\nPara pedagang umumnya mendapat belut dari peternakan belut di daerah Jawa Timur. Hasil budidaya belut yang ada di daerah Kulon Progo belum mampu memenuhi kebutuhan para pedagang.<br />\r\nHarga belut hidup dijual di kisaran Rp 45.000 - 50.000 tergantung ukuran serta musim. Keripik belut dihargai Rp 90.000-100.000 per kg. Olahan &nbsp;basah disajikan dengan kisaran harga Rp 15.000 - 20.000 per porsi. Dinas Pasar Pemerintah Kabupaten Sleman berharap sentra kuliner belut bisa meningkatkan ekonomi masyarakat sekaligus menjadikan belut sebagai komoditas unggulan khas Sleman yang banyak diminati oleh wisatawan.</p>\r\n</body>\r\n</html>\r\n', '', 'Pusat Kuliner Belut Godean', '', 'Daerah Istimewa Yogyakarta kini punya sentra jajanan berbahan baku belut yang baru di depan Pasar Godean, Kabupaten Sleman. Lokasi yang baru itu berdekatan dengan kantor Kecamatan Godean dan terpisah dari pasar yang sebelumnya ditempati oleh pedagang belut. Lokasi baru itu seluas 1.000 meter persegi dengan akses jalan masuk yang mudah karena berada tepat di tepi jalan. Jarak Godean dengan pusat kota Yogyakarta sekitar 10 kilometer ke arah barat. Selain keripik dan belut goreng, pusat kuliner belut godean juga menyediakan masakan lain yang berbahan belut, seperti mangut belut, sambel belut.', '', 1, 'location', '', 'Pasar Kuliner Belut Godean, Jl. Ngapak - Kentheng No.km.10, Sidoagung, Kec. Godean, Kabupaten Sleman', '-7.7676636', '110.2934028', 'Pusat Kuliner Belut Godean', '', 'Pusat Kuliner Belut Godean', 0, 0, '00:20:00', 1200, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
(25, 'kekayon-museum', 1000, '2023-02-10 22:19:15', '2023-10-09 20:55:14', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Museum Wayang Kekayon&nbsp;adalah sebuah museum wayang yang berada di&nbsp;Kota Yogyakarta, tepatnya di Jl. Jogja-Wonosari Km.7 No.277, kurang lebih 1&nbsp;km dari Jl. Majapahit (Ring Road Timur). Museum yang didirikan pada tahun&nbsp;1990&nbsp;ini memiliki koleksi berbagai&nbsp;wayang&nbsp;dan&nbsp;topeng&nbsp;serta menampilkan sejarah wayang yang diperkenalkan mulai dari abad ke-6 sampai abad ke-20. Wayang-wayang di dalam museum ini terbuat baik dari&nbsp;kulit,&nbsp;kayu,&nbsp;kain, maupun&nbsp;kertas.</p>\r\n\r\n<p>Sama halnya dengan&nbsp;Museum Wayang&nbsp;di&nbsp;Jakarta, museum ini mempunyai beberapa jenis wayang, seperti:&nbsp;Wayang Purwa,&nbsp;Wayang Madya&nbsp;(menceritakan era pasca perang&nbsp;Bharatayuddha),&nbsp;Wayang Thengul,&nbsp;Wayang Klithik&nbsp;(mengisahkan&nbsp;Damar Wulan&nbsp;dan&nbsp;Minakjinggo),&nbsp;Wayang beber,&nbsp;Wayang Gedog&nbsp;(cerita Dewi&nbsp;Candrakirana),&nbsp;Wayang Suluh&nbsp;(mengenai sejarah perjuangan kemerdekaan&nbsp;Indonesia), dan lain lain. Berkaitan dengan wayang Purwa, museum ini memiliki beberapa poster yang menggambarkan strategi perang yang dipakai dalam perang&nbsp;Bharatayuddha&nbsp;antara keluarga&nbsp;Pandawa&nbsp;dan&nbsp;Kurawa, yaitu: strategi&nbsp;Sapit Urang&nbsp;dan strategi Gajah.<br />\r\n<br />\r\n<strong>Koleksi Unggulan Museum Wayang Kekayon</strong></p>\r\n\r\n<p>Pada tahun 2014 Dinas Kebudayaan Daerah Istimewa Yogyakarta menerbitkan buku berisi koleksi unggulan museum di Daerah Istimewa Yogyakarta, di antaranya adalah koleksi unggulan yang dimiliki oleh Museum Wayang Kekayon. Koleksi unggulan Museum Wayang Kekayon adalah sebagai berikut:</p>\r\n\r\n<ol>\r\n	<li>Wayang Purwa Punakawan, Punakawan merupakan empat sekawan, figur penghibur khas Jawa yang terdiri dari Semar, Gareng, Petruk, dan Bagong.</li>\r\n	<li>Wayang Golek Menak Gaya Yogyakarta, wayang golek adalah sejenis boneka yang dimainkan seperti wayang. Wayang ini menceritakan kisah bangsawan dari Arab.</li>\r\n	<li>Wayang Purwa Karna Tandhing, dalam kisah Mahabarata, terdapat kisah peperangan antara dua orang kakak beradik namun berada di kubu yang berlawanan. Tokoh Karna menaiki kereta perang yang dipandu oleh Prabu Salya untuk melawan tokoh Arjuna menaiki kereta perang yag dipandu oleh Prabu Sri Bathara Kresna.</li>\r\n</ol>\r\n</body>\r\n</html>\r\n', '', 'Kekayon Museum', '', 'Museum Wayang Kekayon ini didirikan oleh almarhum Prof. DR. dr. KPH. Soejono Prawirohadikusumo (Guru besar UGM sekaligus dokter ahli saraf jiwa) dan diresmikan oleh KGPAA Paku Alam VIII pada tahun 1991. Museum ini mengoleksi berbagai jenis wayang yang ada di Indonesia.', '', 1, 'location', 'cdn/2023/10/kekayon-museum.jpg', 'Jl. Jogja-Wonosari Km 7 No 277, Kalangan, Baturetno, Banguntapan, Bantul Regency, Special Region of ', '-7.8145939', '110.4130604', 'Kekayon Museum', '', 'Kekayon Museum', 1, 7000, '01:30:00', 5400, 4.2, 'D.I. Yogyakarta', 0, 0, 0),
(26, 'dewi-rawe-1', 1000, '2023-02-10 22:19:15', '2023-10-12 11:32:34', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Rajek Wetan terletak di simpang jejak Kasultanan Ngayogyakarta Hadiningrat, diantara selokan Mataram dan Kali Bedog. Rajek Wetan merupakan salah satu dari 15 dusun di Desa Tirtoadi Kecamatan Mlati. Pada tanggal 3 Mei 2019 untuk pertama kalinya Rajek Wetan dilaunching sebagai Desa Wisata Budaya Rajek Wetan (Dewi Rawe). Sebagai dusun yang memiliki banyak potensi seperti landscape alam, seni &amp; budaya, sejarah, kuliner, flora, fauna, dan kerajinan menjadikan Rajek Wetan memiliki daya tarik dibanding dengan dusun lainnya.</p>\r\n\r\n<p style=\"text-align: justify;\">Ditinjau dari aspek budaya, Dewi Rawe memiliki 4 buah Joglo yang dijadikan sebagai rumah budaya dan 9 limas yang difungsikan sebagai home stay dan galeri seni. Budaya seni seperti kethoprak, jathilan, karawitan, kenduri, sadranan, wiwit dan memetri kali bedog masih dapat dijumpai di Dewi Rawe. Bagi anda yang ingin berwisata budaya dapat menjadikan Dewi Rawe sebagai destinasi wisata anda.</p>\r\n\r\n<p style=\"text-align: justify;\">Suasana pedesaan nan asri dapat anda temui di Wanadesa. Aneka tanaman buah dan pepohonan yang rindang nampak menghiasi Wanadesa di Rajek Wetan. Wisatawan dapat bersantai dipendopo dan kursi-kursi bambu yang ada di Wanadesa.</p>\r\n\r\n<p style=\"text-align: justify;\">Ketika berwisata, kuliner menjadi salah satu pertimbangan untuk penentuan destinasi. Aneka makanan khas Dewi Rawe seperti gudeg rebung, bobor rebung, gulai rebung, bening kelor, resoles rebung, lumpia rebung dengan minuman wedang sere, wedang jahe, gula asem, secang, dan wedang telang siap memanjakan lidah wisatawan yang datang. Menikmati makanan tradisional di tengah suasana desa nan asri pantang dilewatkan saat berkunjung di sini.</p>\r\n</body>\r\n</html>\r\n', '', 'Dewi Rawe', '', 'Rajek Wetan terletak di simpang jejak Kasultanan Ngayogyakarta Hadiningrat, diantara selokan Mataram dan Kali Bedog. Rajek Wetan merupakan salah satu dari 15 dusun di Desa Tirtoadi Kecamatan Mlati. Pada tanggal 3 Mei 2019 untuk pertama kalinya Rajek Wetan dilaunching sebagai Desa Wisata Budaya Rajek Wetan (Dewi Rawe). Sebagai dusun yang memiliki banyak potensi seperti landscape alam, seni & budaya, sejarah, kuliner, flora, fauna, dan kerajinan menjadikan Rajek Wetan memiliki daya tarik dibanding dengan dusun lainnya.', '', 1, 'location', 'cdn/2023/10/dewi-rawe.jpg', '68XP+C42, Jl. Rajek Lor-Rajek Wetan, Rajeg Wetan, Tirtoadi, Kec. Mlati, Kabupaten Sleman, Daerah Ist', '-7.7514803', '110.3352759', 'Dewi Rawe', 'Dewi Rawe', 'Dewi Rawe', 0, 0, '02:00:00', 7200, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(27, 'bukit-panguk-kediwung', 1000, '2023-02-10 22:19:15', '2023-10-12 10:38:51', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">&nbsp; &nbsp; &nbsp; &nbsp; Bukit Panguk Kediwung merupakan tempat wisata terletak di Kediwung, Mangunan, Dlingo, Bantul, Yogyakarta. Obyek wisata ini menawarkan pemandangan alam dari ketinggian. Bukit Panguk Kediwung merupakan salah satu pilihan untuk mengisi liburan di Yogyakarta.&nbsp;Daya Tarik Bukit Panguk Kediwung adalah pemandangan alam yang dilihat dari ketinggian. Pengunjung dapat melihat pemandangan alam dari gardu yang terbuat dari kayu dan bambu yang menjorok ke bibir tebing, dari sini pemandangan di bawah bukit terlihat jelas. Dari gardu ini, pengunjung dapat melihat Sungai Oya yang membelah bukit yang terhampar hijau. Pengelola Bukit Panguk Kediwung menyediakan gardu pandang yang sekaligus sebagai spot foto. Gardu pandang ada yang berbentuk jembatan memanjang, bentuk kereta kuda, bentuk sayap kupu-kupu, dan masih banyak lagi.</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp; &nbsp; &nbsp; &nbsp; Gardu pandang Bukit Panguk Kediwung terbagi dalam dua bagian, timur dan selatan. Gardu pandang di sebelah timur untuk melihat matahari terbit dan gardu pandang di sebelah selatan digunakan untuk melihat pegunungan yang sejajar. Kedua spot menawarkan pemandangan yang luar biasa yang sayang untuk dilewatkan. Jika pengunjung ingin melihat pemandangan gardu di sebelah timur maka pengunjung akan dikenakan tarif senilai Rp 3.000 dalam durasi tiga menit. Sedangkan di gardu selatan, pengunjung tidak dikenakan tarif alias gratis. Pengunjung ingin berburu sunrise dapat datang setelah Subuh atau sekitar pukul 05.00. Matahari akan terbit di antara hamparan kabut pagi dan udara pagi yang segar. Pemandangan ini juga sesuai untuk berburu foto. Pada pagi buta, lokasi wisata sudah buka dan sudah dipenuhi pengunjung yang ingin melihat sunrise. Untuk melihat sunrise, ada baiknya pengunjung memeriksa kondisi cuaca. Jika malam turun hujan maka tidak direkomendasikan untuk berkunjung karena sunrise diperkirakan tidak kelihatan.&nbsp;Waktu terbaik untuk berkunjung adalah musim kemarau. Jika pada pagi hari tidak bisa melihat sunrise, pengunjung dapat melihat sunset pada sore hari. Untuk menikmati keindahan Bukit Panguk Kediwung, pengunjung akan dikenakan tiket masuk senilai Rp 3.000. Sedangkan, biaya parkir kendaraan Rp 2.000.<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; Jarak tempuh Bukit Panguk Kediwung dari Kota Yogyakarta sekitar 20 Km dengan waktu tempuh sekitar satu jam. Rute perjalanan ke&nbsp; arah selatan Kota Yogyakarta atau tepatnya ke Jalan Imogiri Timur. Kemudian, ikuti jalan hingga menemukan Pasar Imogiri lalu belok kiri. Perjalanan dilanjutkan ke arah Dlingo, dari sana ada papan petunjuk menuju Bukit Panguk Kediwung. Akses jalan ke Bukit Panguk Kediwung sudah di aspal namun kontur jalannya naik turun. Disarankan, pengunjung menggunakan kendaraan pribadi karena angkutan umum masih cukup sulit.</p>\r\n</body>\r\n</html>\r\n', '', 'Bukit Panguk Kediwung', '', 'Bukit Panguk Kediwung merupakan tempat wisata terletak di Kediwung, Mangunan, Dlingo, Bantul, Yogyakarta. Obyek wisata ini menawarkan pemandangan alam dari ketinggian. Bukit Panguk Kediwung merupakan salah satu pilihan untuk mengisi liburan di Yogyakarta. Daya Tarik Bukit Panguk Kediwung adalah pemandangan alam yang dilihat dari ketinggian. Pengunjung dapat melihat pemandangan alam dari gardu yang terbuat dari kayu dan bambu yang menjorok ke bibir tebing, dari sini pemandangan di bawah bukit terlihat jelas. Dari gardu ini, pengunjung dapat melihat Sungai Oya yang membelah bukit yang terhampar hijau. Pengelola Bukit Panguk Kediwung menyediakan gardu pandang yang sekaligus sebagai spot foto. Gardu pandang ada yang berbentuk jembatan memanjang, bentuk kereta kuda, bentuk sayap kupu-kupu, dan masih banyak lagi.', '', 1, 'location', 'cdn/2023/10/bukit-panguk-kediwung.jpg', 'Kediwung, Mangunan, Dlingo, Bantul Regency, Special Region of Yogyakarta 55783, Indonesia', '-7.9583695', '110.4407622', 'Bukit Panguk Kediwung', 'Bukit Panguk Kediwung', 'Bukit Panguk Kediwung', 0, 3000, '01:30:00', 5400, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(28, 'kids-fun-1', 1000, '2023-02-10 22:19:15', '2023-10-09 20:59:04', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Kids Fun merupakan wana wisata&nbsp;franchise&nbsp;dari Belanda yang bernama Kids Fun Parcs dan dibangun oleh perwakilannya di Indonesia. Taman bermain anak satu ini sudah dibuka cukup lama yakni mulai tahun 1998 dan menjadi yang terbesar pada masanya.</p>\r\n\r\n<p>Dengan luas sekitar 5 hektar, terdapat lebih dari 25 wahana permainan dan fasilitas yang bisa dimainkan anak-anak hingga orang dewasa. Bahkan saat ini sudah banyak cabang atau kids fun kecil yang bisa Anda temukan di&nbsp;Yogyakarta&nbsp;seperti di pusat perbelanjaan.</p>\r\n\r\n<p>Terdapat tiga atraksi utama yang menjadi unggulan dari tempat wisata ini diantaranya wahana permainan tematik, gokart, dan kolam renang. Semua atraksi tersebut dibuat khusus untuk kenyamanan dan keamanan anak-anak saat bermain dan beberapa tetap bisa digunakan orang dewasa.</p>\r\n\r\n<p>Beberapa permainan bahkan dibuatkan kategori khusus untuk anak usia 2 hingga 13 tahun sehingga mereka tetap bisa seru-seruan dengan aman. Para orang tua juga bisa ikut mendampingi sehingga bisa tercipta banyak keseruan antara orang tua dan anaknya saat bermain.</p>\r\n</body>\r\n</html>\r\n', '', 'Kids Fun', '', 'Kids Fun termasuk salah satu taman rekreasi terkenal yang bisa Anda kunjungi di Jogja bersama keluarga saat liburan. Tempat wisata Jogja ini menawarkan berbagai permainan seru yang bisa dimainkan anak-anak hingga orang dewasa dengan aman. Permainan seperti gokart, wahana tunggang, hingga waterboom menjadi permainan unggulan yang bisa Anda coba disini. Standar yang digunakan pun merupakan standar internasional karena tempat ini merupakan franchise dari Kids Fun Parcs yang ada di Belanda.', '', 1, 'location', 'cdn/2023/10/kids-fun.jpg', 'Galeria Mall, Jl. Jend. Sudirman No.99 - 101, Terban, Gondokusuman, Yogyakarta City, Special Region ', '-7.7823797', '110.3791605', 'Kids Fun', '', 'Kids Fun', 1, 115000, '02:30:00', 9000, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
(29, 'the-lost-world-castle-1', 1000, '2023-02-10 22:19:15', '2023-10-09 18:53:20', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Selain menggunakan &ldquo;gledekan&rdquo; yang sudah disebutkan di atas, ada banyak wahana menarik yang layak dikunjungi, tak terkecuali bebek kayuh dan sampan. Ada juga beberapa spot foto asyik yang bisa dijadikan latar belakang untuk berfoto kamu, seperti gambar sayap yang panjang dan lebar, tangga menuju langit, lukisan 3D dengan permadani terbang, air tejun serta jembatan dan masih banyak lagi yang tak kalah menarik lainnya.</p>\r\n\r\n<p>Kamu juga bisa menyusuri Tembok Besar Cina dengan berjalan kaki atau menggunakan &ldquo;gledekan&rdquo;. Berfoto dengan latar Stonehange, Taman Sakura, Perkampungan Indian dan Rumah Hobbit juga bisa kamu jumpai di sini. Ada juga kapal bajak laut dengan peti harta karun di dalamnya yang tidak boleh kamu lewatkan. Gunung Merapi juga menjadi pemandangan yang asyik untuk dinikmati dari tempat ini.</p>\r\n</body>\r\n</html>\r\n', '', 'The Lost World Castle', '', 'The Lost World Castle artinya dunia yang hilang, maksud dari penamaan tersebut berdasarkan kejadian meletusnya Gunung Merapi pada tahun 2020 lalu.', '', 1, 'location', 'cdn/2023/10/the-lost-world-castle.jpg', 'Jl. Petung Merapi, Petung, Kepuharjo, Cangkringan, Sleman Regency, Special Region of Yogyakarta 5558', '-7.6041648', '110.4510042', 'The Lost World Castle', '', 'The Lost World Castle', 0, 30000, '01:30:00', 5400, 4.3, 'D.I. Yogyakarta', 0, 0, 0),
(30, 'embung-ketingan-1', 1000, '2023-02-10 22:19:15', '2023-10-12 12:01:44', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Embung Ketingan sendiri dibangun sebagai daerah tangkap air sekaligus irigasi bagi warga dengan memanfaatkan air dari Sungai Krawak. Dusun Ketingan sebenarnya telah ditetapkan sebagai desa wisata fauna sejak tahun 2004. Karena ada ribuan burung kuntul atau bangau berkembang biak di dusun ini hingga sekarang.</p>\r\n\r\n<p style=\"text-align: justify;\">Bahkan era 1990an ada intruksi Gubernur DIY, secara khusus terkait larangan berburu di kawasan ini. Kini keberadaan embung Ketingan menjadi pelengkap bagi destinasi desa wisata. Siapa saja yang datang bisa memanfaatkan embung itu untuk memancing dan airnya masih terjaga kejernihannya.</p>\r\n</body>\r\n</html>\r\n', '', 'Embung Ketingan', '', 'Embung Ketingan sendiri dibangun sebagai daerah tangkap air sekaligus irigasi bagi warga dengan memanfaatkan air dari Sungai Krawak. Dusun Ketingan sebenarnya telah ditetapkan sebagai desa wisata fauna sejak tahun 2004. Karena ada ribuan burung kuntul atau bangau berkembang biak di dusun ini hingga sekarang.', '', 1, 'location', 'cdn/2023/10/embung-ketingan.jpg', '784J+7G8, Ketingan, Tirtoadi, Mlati, Sleman Regency, Special Region of Yogyakarta 55287, Indonesia', '-7.7443285', '110.3313177', 'Embung Ketingan', 'Embung Ketingan', 'Embung Ketingan', 0, 20000, '02:00:00', 7200, 3.9, 'D.I. Yogyakarta', 0, 0, 0),
(31, 'merapi-park-yogyakarta', 1000, '2023-02-10 22:19:15', '2023-10-08 22:28:00', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Merapi park memiliki beberapa tenoat pengambilan foto yaitu:</p>\r\n\r\n<p>Brandenburg Gate Berlin.<br />\r\nMenara miring Pisa.<br />\r\nMenara Eiffel.<br />\r\nBig Ben London.<br />\r\nPatung Liberty.<br />\r\nKincir Angin Belanda.<br />\r\nPagoda.<br />\r\nNew York Sculpture.<br />\r\nBurj Al Arab.<br />\r\nIndian Village.</p>\r\n\r\n<p>Fasilitas yang tersedia di Merapi Park antara lain, area parkir yang luas, toilet, musala, restoran, tempat duduk santai dan gazebo.<br />\r\n&nbsp;Adapun fasilitas yang tersedia untuk penyandang difabel yakni kursi roda</p>\r\n</body>\r\n</html>\r\n', '', 'Merapi Park Yogyakarta', '', 'Merapi Park merupakan salah satu tempat wisata di Yogyakarta yang terletak di Jalan Kaliurang km 22, Hargobinangun, Kecamatan Pakem, Kabupaten Sleman. Pengoperasian Merapi Park dimulai sejak tanggal 25 Juni 2017. Fasilitas yang tersedia meliputi tempat pengambilan foto', '', 1, 'location', 'cdn/2023/10/merapi-park1.jpg', 'Jl. Kaliurang No.KM. 22.5, Banteng, Hargobinangun, Pakem, Sleman Regency, Special Region of Yogyakar', '-7.6209046', '110.4216275', 'Merapi Park Yogyakarta', '', 'Merapi Park Yogyakarta', 0, 20000, '02:00:00', 7200, 4.3, 'D.I. Yogyakarta', 0, 0, 0);
