(32, 'pasar-beringharjo', 1000, '2023-02-10 22:19:15', '2023-10-08 21:14:56', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pasar Beringharjo menjadi sebuah bagian dari Malioboro yang sayang untuk dilewatkan. Bagaimana tidak, pasar ini telah menjadi pusat kegiatan ekonomi selama ratusan tahun dan keberadaannya mempunyai makna filosofis. Pasar yang telah berkali-kali dipugar ini melambangkan satu tahapan kehidupan manusia yang masih berkutat dengan pemenuhan kebutuhan ekonominya. Selain itu, Beringharjo juga merupakan salah satu pilar &#39;Catur Tunggal&#39; (terdiri dari Kraton, Alun-Alun Utara, Kraton, dan Pasar Beringharjo) yang melambangkan fungsi ekonomi.<br />\r\nWilayah Pasar Beringharjo mulanya merupakan hutan beringin. Tak lama setelah berdirinya Kraton Ngayogyakarta Hadiningrat, tepatnya tahun 1758, wilayah pasar ini dijadikan tempat transaksi ekonomi oleh warga Yogyakarta dan sekitarnya. Ratusan tahun kemudian, pada tahun 1925, barulah tempat transaksi ekonomi ini memiliki sebuah bangunan permanen. Nama &#39;Beringharjo&#39; sendiri diberikan oleh Hamengku Buwono IX, artinya wilayah yang semula pohon beringin (bering) diharapkan dapat memberikan kesejahteraan (harjo). Kini, para wisatawan memaknai pasar ini sebagai tempat belanja yang menyenangkan.<br />\r\nAda banyak jenis barang yang dapat dibeli di Pasar Beringharjo, mulai dari batik, jajanan pasar, uang kuno, pakaian anak dan dewasa, makanan cepat saji, bahan dasar jamu tradisional, sembako hingga barang antik.<br />\r\nBagian depan dan belakang bangunan pasar sebelah barat merupakan tempat yang tepat untuk memanjakan lidah dengan jajanan pasar. Di sebelah utara bagian depan, dapat dijumpai brem bulat dengan tekstur lebih lembut dari brem Madiun dan krasikan (semacam dodol dari tepung beras, gula jawa, dan hancuran wijen). Di sebelah selatan, dapat ditemui bakpia isi kacang hijau yang biasa dijual masih hangat dan kue basah seperti hung kwe dan nagasari. Sementara bagian belakang umumnya menjual panganan yang tahan lama seperti ting-ting yang terbuat dari karamel yang dicampur kacang.<br />\r\nBila hendak membeli batik, Beringharjo adalah tempat terbaik karena koleksi batiknya lengkap. Mulai batik kain maupun sudah jadi pakaian, bahan katun hingga sutra, dan harga puluhan ribu sampai hampir sejuta tersedia di pasar ini. Koleksi batik kain dijumpai di los pasar bagian barat sebelah utara. Sementara koleksi pakaian batik dijumpai hampir di seluruh pasar bagian barat. Selain pakaian batik, los pasar bagian barat juga menawarkan baju surjan, blangkon, dan sarung tenun maupun batik. Sandal dan tas yang dijual dengan harga miring dapat dijumpai di sekitar eskalator pasar bagian barat.<br />\r\nBerjalan ke lantai dua pasar bagian timur, jangan heran bila mencium aroma jejamuan. Tempat itu merupakan pusat penjualan bahan dasar jamu Jawa dan rempah-rempah. Bahan jamu yang dijual misalnya kunyit yang biasa dipakai untuk membuat kunyit asam dan temulawak yang dipakai untuk membuat jamu terkenal sangat pahit. Rempah-rempah yang ditawarkan adalah jahe (biasa diolah menjadi minuman ronde ataupun hanya dibakar, direbus dan dicampur gula batu) dan kayu (dipakai untuk memperkaya citarasa minuman seperti wedang jahe, kopi, teh dan kadang digunakan sebagai pengganti bubuk coklat pada cappucino).<br />\r\nPasar ini juga tempat yang tepat untuk berburu barang antik. Sentra penjualan barang antik terdapat di lantai 3 pasar bagian timur. Di tempat itu, anda bisa mendapati mesin ketik tua, helm buatan tahun 60-an yang bagian depannya memiliki mika sebatas hidung dan sebagainya. Di lantai itu pula, anda dapat memburu barang bekas berkualitas bila mau. Berbagai macam barang bekas impor seperti sepatu, tas, bahkan pakaian dijual dengan harga yang jauh lebih murah daripada harga aslinya dengan kualitas yang masih baik. Tentu butuh kejelian dalam memilih.<br />\r\nPuas berkeliling di bagian dalam pasar, tiba saatnya untuk menjelajahi daerah sekitar pasar dengan tawarannya yang tak kalah menarik. Kawasan Lor Pasar yang dahulu dikenal dengan Kampung Pecinan adalah wilayah yang paling terkenal. Anda bisa mencari kaset-kaset oldies dari musisi tahun 50-an yang jarang ditemui di tempat lain. Selain itu, terdapat juga kerajinan logam berupa patung Budha dalam berbagai posisi. Bagi pengoleksi uang lama, tempat ini juga menjual uang lama dari berbagai negara, bahkan yang digunakan tahun 30-an.<br />\r\nJika haus, meminum es cendol khas Yogyakarta adalah adalah pilihan jitu. Es cendol Yogyakarta memiliki citarasa yang lebih kaya dari es cendol Banjarnegara dan Bandung. Isinya tidak hanya cendol, tetapi juga cam cau (semacam agar-agar yang terbuat dari daun cam cau) dan cendol putih yang terbuat dari tepung beras. Minuman lain yang tersedia adalah es kelapa muda dengan sirup gula jawa dan jamu seperti kunyit asam dan beras kencur.<br />\r\nMeski pasar resmi tutup pukul 17.00 WIB, tetapi dinamika pedagang tidak berhenti pada jam itu. Bagian depan pasar masih menawarkan berbagai macam panganan khas. Martabak dengan berbagai isinya, terang bulan yang legit bercampur coklat dan kacang, serta klepon isi gula jawa yang lezat bisa dibeli setiap sorenya. Sekitar pukul 18.00 WIB hingga lewat tengah malam, biasanya terdapat penjual gudeg di depan pasar yang juga menawarkan kikil dan varian oseng-oseng. Sambil makan, anda bisa mendengarkan musik tradisional Jawa yang diputar atau bercakap dengan penjual yang biasanya menyapa dengan akrab.</p>\r\n</body>\r\n</html>\r\n', '', 'Pasar Beringharjo', '', 'Pasar Beringharjo telah digunakan sebagai tempat jual beli sejak tahun 1758. Tawarannya kini kian lengkap; mulai dari batik, jajanan pasar, jejamuan, hingga patung Budha seharga ratusan ribu.', '', 1, 'location', 'cdn/2023/10/1.jpg', 'Pasar Beringharjo timur Lt. 3, dekat parkiran, Jl. Margo Mulyo No.16, Ngupasan, Kec. Gondomanan, Kot', '-7.798812', '110.3657371', 'Pasar Beringharjo', '', 'Pasar Beringharjo', 0, 0, '01:30:00', 5400, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(33, 'taman-kehati-1', 1000, '2023-02-10 22:19:15', '2023-10-09 18:46:17', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Taman Kehati Eroniti adalah bentuk kolaborasi pemerintah, kampus, dan dunia usaha untuk menyelamatkan berbagai spesies kawasan yang terancam kelestariannya. Dengan begitu, Eroniti dapat diartikan melihat perjuangan masyarakat desa untuk membangun kawasan wisata, hutan rakyat, serta berbagai goa yang berada di Karangasem.<br />\r\n<br />\r\nBerdasarkan pendataan, Sugeng menjelaskan, di kawasan yang dirintis Instiper Yogyakarta bersama PT Sarihusada Generasi Mahardhika (Danone Indonesia) ini terdapat setidaknya 23 jenis flora. &quot;Spesies yang ada memiliki fase lengkap, mulai dari semai, sapihan, tiang, dan pohon,&quot; kata dia.</p>\r\n\r\n<p>Ada pula dua jenis burung langka, yaitu Walet Linchi dan Cekakak Jawa. Satwa-satwa ini dilindungi oleh Undang-undang Nomor 5 Tahun 1990 tentang Konservasi Sumber Daya Alam Hayati dan Ekosistemnya serta Peraturan Pemerintah Nomor 7 Tahun 1999 tentang Pengawetan Tumbuhan dan Satwa.</p>\r\n</body>\r\n</html>\r\n', '', 'Taman Kehati', '', 'Taman Keanekaragaman Hayati atau Kehati Eroniti hadir di Desa Karangasem, Kecamatan Ponjong, Kabupaten Gunungkidul, Yogyakarta. Taman seluas 10 hektare ini merupakan ekosistem karst yang menjadi tangki penyimpan air tawar, serta berbagai biota gua yang terancam kelestariannya.', '', 1, 'location', 'cdn/2023/10/taman-kehati.jpg', '696P+GW8, Demangan, Kec. Gondokusuman, Kota Yogyakarta, Daerah Istimewa Yogyakarta 55221, Indonesia', '-7.7887054', '110.3873403', 'Taman Kehati', '', 'Taman Kehati', 0, 10000, '01:30:00', 5400, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(34, 'grojogan-watu-purbo-gate', 1000, '2023-02-10 22:19:15', '2023-10-09 01:10:13', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Grojogan Watu Purbo merupakan salah-satu wisata Sleman yang cukup bersejarah, dan populer di kalangan masyarakat sebagai sebuah destinasi wisata alam yang cocok untuk semua usia, dan semua kalangan. Grojogan Watu Purbo bisa menjadi solusi tujuan wisata keluarga di akhir pekan, maupun saat liburan. Meskipun notabene sebagai wisata air terjun, namun sangat mudah diakses meskipun oleh anak-anak.</p>\r\n\r\n<p>Perlu diketahui bahwa wisata di Sleman sangatlah beragam, populer, dan beberapa di antaranya menjadi tujuan wisatan nasional, maupun mancanegara.&nbsp;Buktinya pada tahun 2022 angka kunjungan wisata ke Kabupaten Sleman mencapai 7.136.710. angka tersebut tentu saja sudah termasuk kunjungan ke Grojogan Watu Purbo.</p>\r\n\r\n<p><strong>Sejarah Grojogan Watu Purbo</strong></p>\r\n\r\n<p>Sejarah Grojogan Watu Purbo tidak bisa lepas dengan keberadaan Gunung Merapi dan muntahan lava dan laharnya yang sangat fenomenal. Sejarah Grojogan Watu Purbo Sleman dimulai pada tahun 1975. Pada tahun tersebut adalah tahun pertama pembangunan, penataan, dan penanggulangan aliran lahar Gunung Merapi.&nbsp;Karena perlu diketahui bahwa Grojogan Watu Purbo (sebelum menjadi tempat wisata) pada mulanya ditujukan untuk menahan, dan menanggulangi aliran lahar Merapi supaya tidak membahayakan masyarakat. Aliran lahar tersebut mengalir di sepanjang jalur Sungai Krasak, dan tentu saja Gunung Merapi sebagai hulunya. Kemudian pada tahun 2017 dimulailah penataan Sungai Krasak terutama di titik terasering yang kini dikenal sebagai Grojogan Watu Purbo sebagai sebuah objek wisata.&nbsp; Hasil tidak akan mengkhianati proses, pada akhirnya di tahun 2020 Grojogan Watu Purbo menjadi salah-satu wisata populer di Jogja, dan dikenal sebagai air terjun instagramable. Adapun sejarah nama Grojogan Watu Purbo berarti Air Terjun Batu Tua. Karena grojogan artinya air terjun, sama dengan kata curug, atau coban.</p>\r\n</body>\r\n</html>\r\n', '', 'Grojogan Watu Purbo Gate', '', 'Grojogan merupakan istilah bahasa Jawa berarti air terjun. Kawasan ini merupakan tempat wisata alam dengan air terjun bertingkat yang memesona. Dari tempat ini, Gunung Merapai juga dapat terlihat jelas, terutama jika cuaca sedang cerah. Grojogan Watu Purbo dapat menjadi salah satu agenda wisata Anda selama di Yogakarta. Tempat wisata sempat viral ini cocok untuk Anda yang senang wisata alam dengan pemandangan instagramable.', '', 1, 'location', 'cdn/2023/10/grojogan-watu-purbo-gate.jpg', 'Bangunrejo, RT.02/RW.27, Merdikorejo, Kec. Tempel, Kabupaten Sleman, Daerah Istimewa Yogyakarta 5555', '-7.6309566', '110.3404834', 'Grojogan Watu Purbo Gate', '', 'Grojogan Watu Purbo Gate', 2, 0, '01:30:00', 5400, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(35, 'house-of-chocolate-monggo-gelato-tirtodipuran-1', 1000, '2023-02-10 22:19:15', '2023-10-08 23:41:11', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Monggo House of Chocolate and Gelato terletak di jantung wisata kuliner yang ramai di Jalan Tirtodipuran. Nikmati suasana indoor yang hangat dan menggugah selera sambil menikmati pilihan cokelat batangan yang kaya rasa dan praline yang elegan. Melangkah keluar, kamu akan menemukan outdoor kios kami dan manjakan dirimu dengan sesendok gelato home-made di kursi &quot;transat&quot; yang trendi yang dikelilingi oleh pasir putih seperti di pantai dan patung gelato terbalik.<br />\r\n<br />\r\nNikmati berbagai minuman cokelat yang sesuai dengan level kakao pilihanmu. Kami juga menghadirkan berbagai makanan ringan ala Eropa seperti pancake, aneka kue, dan berbagai makanan penutup. Bawa pulang dan temukan oleh-oleh yang sempurna untuk teman dan keluarga.<br />\r\n<br />\r\nSaat kamu berada di Monggo Gelato, kamu akan sadar terhadap dedikasi kamu dalam membuat gelato yang tidak hanya memiliki rasa yang lezat, tapi juga bermanfaat bagi planet ini. Bahan-bahan kami dipilih dengan hati-hati untuk keaslian alaminya, dengan fokus pada produk musiman dan lokal, seperti bunga telang, kecombrang yang harum, serta daun peppermint segar.</p>\r\n</body>\r\n</html>\r\n', '', 'House of Chocolate Monggo & Gelato Tirtodipuran', '', 'House of Chocolate Monggo & Gelato Tirtodipuran berlokasi di Tirtodipuran St No.10, Mantrijeron, Yogyakarta. Buka dari pukul 09.00-22.00 WIB. Produk cokelat Yogyakarta ini menawarkan banyak jenis cokelat dengan rasa. Ada Dark Chocolate dengan cita rasa Strawberry, Milk Chocolate, Praline, Matcha, hingga Hazenut dengan harga Rp 20.800 per 40 gram.', '', 1, 'location', '', 'Tirtodipuran St No.10, Mantrijeron, Yogyakarta City, Special Region of Yogyakarta 55143, Indonesia', '-7.8184611', '110.3635327', 'House of Chocolate Monggo & Gelato Tirtodipuran', '', 'House of Chocolate Monggo & Gelato Tirtodipuran', 5, 10000, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(36, 'dagadu-alun-alun-utara', 1000, '2023-02-10 22:19:15', '2023-10-12 11:08:08', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Dagadu djokdja merupakan produk kreatif dengan ciri khas baru cendera mata berbentuk desain grafis yang terinspirasi dari semaraknya kota Jogja. Hadir pertama kali pada tahun 1994, nama DAGADU DJOKDJA terinspirasi dari warisan budaya Jawa berupa bahasa Walikan, yang merupakan inovasi bahasa dari aksara Jawa &ldquo;Hancaraka&rdquo;.<br />\r\nDalam bahasa Walikan, DAGADU berarti &ldquo;Matamu&rdquo;, karena Dagadu Djokdja di awal berdirinya dimaksudkan sebagai tanda mata dari Jogja yang menghadirkan Jogja dalam bentuk nostalgi sekaligus &lsquo;nyeni&rsquo;.<br />\r\n<br />\r\n&ldquo;Smart, Smile, Djokdja&rdquo;. Tiga kata itu menjadi slogan yang melekat pada DAGADU DJOKDJA. Rumusan tersebut muncul sebagai penggambaran pola kerja kreatif yang dihayati DAGADU DJOKDJA dan dicoba untuk ditonjolkan kepada pihak luar.<br />\r\n<br />\r\nKini, DAGADU DJOKDJA memiliki 4 sisterbrand, yaitu Bocah yang berorientasi pada remaja hingga anak-anak usia 0-15 tahun dengan desain yang unik dan ceria; Hiruk Pikuk yang mengangkat pendekatan desain tipografi dan dengan harga yang lebih terjangkau; Malioboroman dengan desain ala komik yang menampilkan figur imajinatif jagoan dari Jogja.; serta DGD Indonesia yang terinspirasi dari</p>\r\n</body>\r\n</html>\r\n', '', 'Dagadu Alun-Alun Utara', '', 'Dagadu djokdja merupakan produk kreatif dengan ciri khas baru cendera mata berbentuk desain grafis yang terinspirasi dari semaraknya kota Jogja. Hadir pertama kali pada tahun 1994, nama DAGADU DJOKDJA terinspirasi dari warisan budaya Jawa berupa bahasa Walikan, yang merupakan inovasi bahasa dari aksara Jawa “Hancaraka”.\r\nDalam bahasa Walikan, DAGADU berarti “Matamu”, karena Dagadu Djokdja di awal berdirinya dimaksudkan sebagai tanda mata dari Jogja yang menghadirkan Jogja dalam bentuk nostalgi sekaligus ‘nyeni’.', '', 1, 'location', 'cdn/2023/10/dagadu.jpg', 'Jl. Pekapalan Timur No.7, Prawirodirjan, Gondomanan, Yogyakarta City, Special Region of Yogyakarta 5', '-7.8031874', '110.3657633', 'Dagadu Alun-Alun Utara', 'Dagadu Alun-Alun Utara', 'Dagadu Alun-Alun Utara', 0, 0, '00:25:00', 1500, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(37, 'lava-merapi-and-alien-stone-1', 1000, '2023-02-10 22:19:15', '2023-10-08 22:11:57', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Lava Tour Merapi sendiri merupakan wisata naik jeep berkeliling kawasan Merapi yang terkena dampak erupsi Merapi pada tahun 2010. Tempat wisata ini patut dikunjungi saat wisatawan berkunjung ke Yogyakarta karena lokasinya sangat dekat dari Kota Yogyakarta, yakni hanya 20 menit perjalananObjek wisata ini akan memanjakan wisatawan dengan pesona keindahan landscape Gunung Merapi yang mengesankan. Selain itu, Batu Alien Merapi ini termasuk wisata terjangkau, karena wisatawan tidak perlu merogoh banyak ongkos. Oleh karena itu, destinasi wisata ini cocok untuk pengunjung yang ingin menikmati suasana asri dan berbau alam. Harga masuk tiket wisata Batu Alien Merapi ini hanya Rp 5.000 per orang, sebuah harga yang tidak mahal untuk menikmati keindahan alam Gunung Merapi yang tidak biasa. Sementara itu, untuk biaya parkir kendaraan di wisata ini seebsar Rp 3.000 untuk motor dan Rp 5.000 untuk mobil. Adapun, tempat wisata Batu Alien, Merapi buka dari pukul 06.00- 17.00.<br />\r\n&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Lava Merapi and Alien Stone', '', 'Kawasan wisata Batu Alien Merapi ini terletak di  Kampung Jambu, Kecamatan Cangkringan, Kabupaten Sleman, Yogyakarta. Pengunjung memerlukan waktu satu jam perjalanan atau 28km apabila perjalanan dimulai dari pusat kota. Untuk fasilitas, Batu Alien Merapi menyediakan beragam fasilitas bagi wisatawan, mulai dari warung makan, toilet, spot foto, kendaraan jeep, dan masih banyak lagi.\r\n', '', 1, 'location', 'cdn/2023/10/lava-m.jpg', '9FX4+346, Jambu, Kepuharjo, Cangkringan, Sleman Regency, Special Region of Yogyakarta 55583, Indones', '-7.6023375', '110.4552585', 'Lava Merapi and Alien Stone', '', 'Lava Merapi and Alien Stone', 0, 5000, '00:25:00', 1500, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(38, 'tlogo-muncar-national-garden-1', 1000, '2023-02-10 22:19:15', '2023-10-09 19:13:41', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Air Terjun Tlogo dahulu terkenal dengan kolam mata air Tlogo Putri. Namun, Tlogo Putri sudah tidak beroperasi dikarenakan debit air yang menurun. Bagi masyarakat sekitar, tempat ini memiliki nilai sejarah yang tinggi. Masyarakat percaya bahwa kawasan ini pernah digunakan mandi Putri Dewi Condokirono dari Kerajaan Majapahit. Ada yang meyakini pula jika mandi di tempat ini dapat membuat wajah awet muda.<br />\r\n<br />\r\nSaat memasuki kawasan wisata, pengunjung akan disambut dengan jalan setapak berbatu yang sudah tersusun rapi. Dari gerbang masuk hingga menuju ke air terjun, pengunjung perlu berjalan kaki sejauh 500 meter. Di air terjun, pengunjung dapat bermain air di bawah derasnya air yang mengalir dari ketinggian. Pengunjung akan merasakan sensasi segar dari dinginnya air kaki gunung. Bagi yang kurang puas hanya bermain di air terjun, di tempat ini juga terdapat kolam renang.<br />\r\n<br />\r\nPengunjung yang membawa anak dapat memanjakan sang anak di taman rekreasi anak. Di taman ini ada beragam jenis permainan anak seperti jungkat-jungkit dan ayunan. Selain itu ada juga wahana kereta api mini dan bianglala. Bagi yang menyukai kegiatan ekstrim, pengunjung dapat mencoba wahana flying fox. Wahana ini mengajak pengunjung berseluncur dari ketinggian menyebrangi tebing.</p>\r\n\r\n<ul>\r\n	<li>Hutan Wisata Monyet<br />\r\n	Jika pengunjung terus menyusuri jalan setapak, pengunjung akan menemukan hutan wisata. Di dalam hutan wisata, wisatawan akan disambut oleh segerombolan monyet yang berkeliaran secara liar. Hal tersebut disebabkan karena kawasan ini memang merupakan habitat monyet berekor panjang. Monyet-monyet tersebut tidak akan mengganggu jika tidak diganggu, sehingga tidak perlu khawatir. Pengunjung juga dapat mengabadikan foto bersama monyet-monyet liar ini.</li>\r\n	<li>Berkemah &ndash; Camping<br />\r\n	Bagi yang menyukai kegiatan berkemah, kawasan ini menyediakan lahan yang dapat disewa untuk tempat berkemah. Arena kemah ini kerap digunakan oleh mahasiswa untuk kegiatan malam keakraban. Dengan berkemah di kawasan ini, pengunjung dapat menikmati keasrian alam di malam hari. Terlebih, di malam hari, suhu udara sekitar wilayah ini sangat dingin.</li>\r\n	<li>Bukit Plawangan &amp; Pronojiwo<br />\r\n	Jika sudah puas bermain di Kawasan air terjun Tlogo Muncar, tidak ada salahnya jika pengunjung mencoba mendaki Bukit Plawangan. Bukit ini tidak terlalu tinggi sehingga masih layak dicoba bagi para penikmat pemandangan. Dari atas bukit pengunjung akan disuguhi dengan Menara Pengamatan Elang Jawa dan panorama alam daerah Kaliurang. Di pagi dan sore hari, tempat ini akan diselimuti kabut sehingga pemandangan tertutupi. Meski jalanannya lumayan terjal, Bukit Pronojiwo tidak sulit untuk didaki oleh segala usia. Hal ini karena jalan untuk menuju puncak Bukit Pronojiwo sudah dilengkapi dengan anak tangga. Dari atas bukit ini, pengunjung akan merasakan suasana sejuk disertai kicauan burung yang menggema. Saat hari cerah, pengunjung juga dapat melihat pemandangan Gunung Merapi dari sisi Barat Daya.</li>\r\n	<li>Goa Jepang<br />\r\n	Selain Bukit Plawangan &amp; Pronojiwo, pengunjung juga dapat menjelajah Goa Jepang. Goa Jepang merupakan sisa peninggalan Jepang saat menjajah Indonesia. Goa ini merupakan lorong-lorong panjang yang menjadi markas dan tempat persembunyian. Untuk menjelajah gua ini, pengunjung tentu membutuhkan alat penerangan.</li>\r\n	<li>Pagelaran Seni<br />\r\n	Sejumlah pertunjukan seni juga sering diadakan di tempat ini. Seni yang diperntaskan berbeda setiap harinya. Secara bergantian, kawasan wisata ini yang menampilkan grup-grup kesenian lokal. Beberapa di antaranya seperti jathilan, campur sari, topeng ireng, dangdut, hingga orkes melayu. Pentas seni ini digelar di sebuah panggung hiburan yang berada di Tlogo Muncar. Bagi yang akan menyaksikan pertunjukan ini tidak dipungut biaya alias gratis.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Tlogo Muncar National Garden', '', 'Air Terjun Tlogo Muncar merupakan wisata alam yang berada satu kawasan dengan Taman Nasional Gunung Merapi. Tepatnya di lereng Gunung Merapi, Desa Hargobinangun, Kecamatan Pakem, Kabupaten Sleman, DIY. Daerah ini berada di arah selatan Gunung Merapi pada ketinggian sekitar 900 mdpl. Jaraknya dari pusat Kota Yogykarta kurang lebih 25 km. Dengan ketinggian air terjun ini mencapai 30-45 meter bersumber dari mata air Bukit Plawangan.\r\nWisatawan yang berkunjung ke air terjun Tlogo Muncar akan dikenakan biaya tiket masuk. Harga tiket masuk air terjun Tlogo Muncar terbilang murah. Pengunjung hanya perlu membayar retribusi wisata sebesar Rp8.000. Dengan biaya tersebut, ada banyak pilihan aktivitas yang dapat dilakukan.', '', 1, 'location', '', 'CC5M+8HH, Jl. Tlogo Putri, Area Hutan, Hargobinangun, Pakem, Sleman Regency, Special Region of Yogya', '-7.5916872', '110.4339755', 'Tlogo Muncar National Garden', '', 'Tlogo Muncar National Garden', 0, 8000, '01:30:00', 5400, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
(39, 'sermo-reservoir-dam-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:51:23', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Waduk Sermo terletak di Daerah Istimewa Yogyakarta,tepatnya di Dusun Sermo, Desa Hargowilis, Kecamatan Kokap, Kabupaten Kulon Progo, yang berjarak &plusmn; 35 km dari kota Yogyakarta dan &plusmn; 6 km dari Pusat Wates Kulon Progo.<br />\r\nWaduk Sermo dibangun pada bulan Maret 1994 dengan waktu pelaksanaan 32 bulan. Pengisian pertama dimulai pada akhir bulan Maret 1996. Pelaksana pembangunan waduk ini adalah Hyundai&mdash;Duta Graha J.O dan konsultan pengawas oleh Elc.Electroconsult dari Itali berkerja sama dengan PT. Bina Karya dan PT.Wiratman. Pembangunan konstruksi Bendungan Sermo menelan biaya sebesar Rp 32,4 milyar. Tujuan pembangunan Waduk Sermo adalah untuk meningkatkan penyediaan irigasi, pengendali banjir, usaha perikanan, pariwisata, dan prasarana olah raga air.<br />\r\nLetak Waduk Sermo berada diantara dua bukit dan disekelilingnya masih banyak pepohonan dan adanya cagar alam atau hutan wisata yang membuatnya nampak hijau dan sejuk. Keindahan Waduk Sermo dapat Anda nikmati sepanjang 21 kilometer yang berbentuk lingkaran dan beraspal. Selain itu, Anda juga bisa menikmati keindahan Waduk Sermo Yogyakarta dengan perahu wisata air. Perahu wisata ini akan berkeliling area Waduk Sermo dengan durasi 20 menit. Minimal perahu wisata akan berangkat jika mencapai 5 orang dan maksimal adalah 10 orang. Tak perlu biaya mahal untuk bisa menikmatinya, Anda hanya perlu membayar Rp 6.000 per orang atau bila menginginkan suasana lebih tenang, Anda bisa menyewa perahu secara privat seharga Rp 30.000. Anda tidak perlu khawatir karena biaya tiket masuk sangat terjangkau, dengan rincian: Per orang Rp 2.000, Sepeda Motor Rp 1.000 (diluar biaya tiket per orang), Mobil Rp 3.000 (diluar biaya tiket per orang).</p>\r\n</body>\r\n</html>\r\n', '', 'Sermo Reservoir Dam', '', 'Waduk Sermo (Sermo Reservoir) adalah sebuah waduk yang terletak di Kabupaten Kulonprogo, Daerah Istimewa Yogyakarta, Indonesia. Waduk ini mulai dibangun pada tahun 1994 dan diresmikan oleh Presiden Soeharto pada tanggal 20 November 1996. Waduk ini dibangun untuk menjamin pasokan air ke Daerah Irigasi Kalibawang seluas 7.152 hektar.', '', 1, 'location', 'cdn/2023/10/17.jpg', '54GF+3FC, Jl. Lkr. Sermo, Sremo Lor, Hargowilis, Kokap, Kulon Progo Regency, Special Region of Yogya', '-7.8248171', '110.1236396', 'Sermo Reservoir Dam', '', 'Sermo Reservoir Dam', 0, 6000, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(40, 'jogja-t-shirt-jethe-1', 1000, '2023-02-10 22:19:15', '2023-10-09 20:33:27', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Jogja T-shirt Omah Oblong (JETHE) merupakan perusahaan di Yogyakarta bergerak di bidang industri cinderamata khas Yogyakarta berupa kaos oblong. Jogja T-shirt mengenalkan budaya dan kearifan lokal Yogyakarta melalui kaos oblong bertema budaya dan kearifan lokal Yogyakarta serta ikon Keluarga Bedjokarto. Penelitian ini membahas tentang Strategi Promosi Jogja T-shirt Omah Oblong (JETHE) sebagai media pengenalan budaya dan kearifan lokal Yogyakarta serta ikon Keluarga Bedjokarto tahun 2019-2020.</p>\r\n</body>\r\n</html>\r\n', '', 'Jogja T-Shirt Jethe', '', 'Jogja T-Shirt Jethe merupakan tempat perbelanjaan kaos yang bertemakan Jogja.', '', 1, 'location', 'cdn/2023/10/jogja-t-shirt-jethe.jpg', 'Jl. Jambon, Biru, Trihanggo, Gamping, Sleman Regency, Special Region of Yogyakarta 55291, Indonesia', '-7.7624289', '110.348049', 'Jogja T-Shirt Jethe', '', 'Jogja T-Shirt Jethe', 0, 0, '00:45:00', 2700, 4.3, 'D.I. Yogyakarta', 0, 0, 0),
(41, 'museum-ullen-sentalu-1', 1000, '2023-02-10 22:19:15', '2023-10-08 22:42:35', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Koleksi<br />\r\nAda dua koleksi yang dimiliki oleh Museum Ullen Sentalu. Koleksi tersebut adalah koleksi narasi dan koleksi tetap. Museum ini memiliki koleksi narasi berupa mahakarya lukisan. Koleksi lukisan yang ada di Museum ini dipajang untuk mengapresiasi isi dari lukisan tersebut. Kamu bisa memahami arti dari kumpulan lukisan tersebut dari para pemandu yang menjelaskan tentang makna lukisan tersebut.</p>\r\n\r\n<p>Arsitektur<br />\r\nSelain koleksinya yang memang sangat beragam, gaya arsitektur yang dimiliki oleh Museum Ullen Sentalu juga sangat keren dan menawan. Pasalnya, Museum ini mengadopsi arsitektur bergaya perpaduan Jawa dan gotik Eropa abad pertengahan. Kamu bisa melihat indahnya tempat ini yang dihiasi dengan taman serta pahatan di beragam sisi. Maka dari itu, tempat ini menjadi terlihat sangat damai dan mistis dalam waktu yang sama.</p>\r\n\r\n<p>Tidak hanya itu, suasananya yang dingin karena berada di pegunungan juga sangat pas untuk kamu yang ingin melepas penat dari hiruk pikuk kota. Tempat yang luas ini bisa kamu jelajahi dan nikmati gaya bangunannya yang khas sekali. Ada juga beberapa patung dan kolam di berbagai sudut museum yang membuatnya tampak sangat indah. Bahkan, ada tumbuhan-tumbuhan merambat yang tumbuh menutupi bagian-bagian gedung di museum ini.</p>\r\n\r\n<p>Fasilitas</p>\r\n\r\n<p>Terdapat beberapa fasilitas yang bisa kamu gunakan di museum ini. Diantaranya adalah pemandu wisata, toko oleh-oleh, restoran, dan fasilitas dasar seperti toilet. Pemandu wisata yang ada di sini pun sangat interaktif sehingga kamu bisa mendapatkan segala informasi mengenai sejarah dan budaya Jawa dengan lengkap dari mereka. Kamu juga bisa menanyakan hal-hal yang ingin kamu tahu mengenai budaya Jawa pada mereka. Pemandu wisata yang ada di sini sudah termasuk pada harga tiket masuknya, jadi kamu tidak perlu mengeluarkan uang lagi.</p>\r\n</body>\r\n</html>\r\n', '', 'Museum Ullen Sentalu', '', 'Museum Ullen Sentalu didirikan oleh pemerintah Jogja yang diprakarsai oleh keluarga Haryono dan Yayasan Ulating Blencong. Nama Ullen Sentalu yang disematkan pada museum ini adalah singkatan dari sebuah pepatah Jawa yakni Ulating Blencong Sejatining Tataraning Lumaku.', '', 1, 'location', 'cdn/2023/10/ulen-sentalu.jpg', 'Jl. Boyong No.KM 25, Kaliurang, Hargobinangun, Pakem, Sleman Regency, Special Region of Yogyakarta 5', '-7.5978656', '110.4233959', 'Museum Ullen Sentalu', '', 'Museum Ullen Sentalu', 0, 50000, '02:00:00', 7200, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(42, 'heha-sky-view-1', 1000, '2023-02-10 22:19:15', '2023-10-08 23:29:57', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><meta charset=\"utf-8\" />HeHa Sky View menyediakan restoran berkonsep modern dan food stall. Food stall merupakan area kuliner dengan konsep street food, tepatnya para penjual menjajakan makanan dari kontainer-kontainer. Restoran terdiri dari empat lantai. Lantai bawah merupakan ruang rapat dengan ukuran medium berkapasitas 40 orang. Lantai pertama untuk menu A&#39;la Carte dilengkapi pendingin ruangan. Lantai kedua bagi pengunjung rombongan. Selanjutnya, lantai tiga adalah rooftop semi-outdoor atau setengahnya di luar ruangan. Lantai ini terdapat spot foto ikonik, yaitu Sky Glass. Selain restoran dan food stall, HeHa Sky View juga mempunyai sejumlah fasilitas lainnya seperti taman, spot foto, area bean bag, pertunjukkan musik, HeHa garage, toko suvenir, musala, toilet, area parkir, dan jalur kursi roda.</p>\r\n</body>\r\n</html>\r\n', '', 'HeHa Sky View', '', 'HeHa Sky View sangat populer dan bisa dijangkau dalam 30 menit saja dari Kota Jogja. HeHa Sky View berisi tempat selfie, food stall, dan resto. Tempatnya sangat instagramable, banyak spot foto keren dengan pemandangan langit dan Kota Jogja dari ketinggian.\r\n\r\n', '', 1, 'location', 'cdn/2023/10/heha-sky-view.jpg', 'Jl. Dlingo-Patuk No.2, Patuk, Bukit, Patuk, Gunung Kidul Regency, Special Region of Yogyakarta 55862', '-7.8496144', '110.478324', 'HeHa Sky View', '', 'HeHa Sky View', 2, 20000, '02:00:00', 7200, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
(43, 'pasar-sore-malioboro-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:22:34', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Tak hanya Pasar Beringharjo saja yang dilirik oleh wisatawan untuk memenuhi hasrat belanja, namun Pasar Sore Malioboro pun tidak kalah menarik. Pasar yang berada di selatan Pasar Beringharjo ini buka mulai pukul 17.00 WIB hingga malam hari tersebut merupakan salah satu destinasi wisata belanja oleh-oleh khas Yogyakarta.</p>\r\n\r\n<p><br />\r\nApa saja yang dijual di Pasar Sore Malioboro ?</p>\r\n\r\n<ul>\r\n	<li>Tas</li>\r\n	<li>Sepatu</li>\r\n	<li>Sandal</li>\r\n	<li>Souvenir</li>\r\n	<li>Gantungan Kunci</li>\r\n	<li>Kaos, baju batik, celana batik</li>\r\n	<li>Kuliner, bakpia</li>\r\n</ul>\r\n</body>\r\n</html>\r\n', '', 'Pasar Sore Malioboro', '', 'Pasar Sore Malioboro merupakan pasar yang menjual oleh-oleh khas Jogja. Pasar tersebut menyediakan berbagai kebutuhan wisatawan dengan harga yang murah. Tidak ada bangunan permanen di pasar ini, hanya tenda-tenda kaki lima berjajar rapi, ada juga yang membuka lapak di pinggir jalan. Jika berbelanja di sini jangan lupa menawar agar mendapatkan harga yang lebih murah.', '', 1, 'location', 'cdn/2023/10/4.jpg', '', '-7.94136080262228', '110.4247377097752', 'Pasar Sore Malioboro', '', 'Pasar Sore Malioboro', 0, 0, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(44, 'kotagede-heritage-trail', 1000, '2023-02-10 22:19:15', '2023-10-09 21:07:26', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Jelajah Pusaka Kotagede (Kotagede Heritage Trail) adalah kegiatan wisata minat khusus berupa blusukan di dalam kampung-kampung nan eksotik Kotagede, sebuah bekas Kerajaan Mataram Islam yang tata kota nya masih terlihat merupakan kota lama. Kotagede terletak di Propinsi Daerah Istimewa Yogyakarta, masuk dalam 2 wilayah kabupaten Bantul dan Kota Yogyakarta.</p>\r\n\r\n<p>Dalam kegiatan ini, wisatawan diajak untuk menyusuri lorong-lorong kampung di Kotagede, melihat rumah-rumah tradisional berserta kehidupan sosial budaya yang secara turun temurun masih dilaksanakan oleh warga Kotagede, mencicipi kuliner khas Kotagede, melihat kesenian tradisional setempat yang dapat dinikmati dalam paket-paket wisata yang ditawarkan.</p>\r\n\r\n<p>Kegiatan Jelajah Pusaka Kotagede adalah kegiatan komersial pemberdayaan masyarakat lokal Kotagede yang juga memiliki misi sebagai pembelajaran terhadap pusaka/heritage Kotagede dengan memanfaatkan berbagai potensi pusaka/heritage Kotagede.</p>\r\n</body>\r\n</html>\r\n', '', 'Kotagede Heritage Trail', '', 'Kotagede Heritage Trail (Jelajah Pusaka Kotagede) merupakan jenama yang dibangun untuk membawa kegiatan pelestarian berbasis pariwisata yang diperkenalkan sekitar 2006, tepatnya setelah gempa Jogja.  Banyaknya rumah-rumah tradisional yang rusak parah & Jogja Reconstruction Fund yang merupakan lembaga sosial hadir membantu membangun kembali bangunan cagar budaya dan mendorong masyarakat melanjutkan kegiatan jelajah atau blusukan untuk menggerakkan geliat pelestarian & pariwisata. Sejak itulah Jelajah Pusaka Kotagede menjadi jenama yang ditawarkan untuk mengenal Kotagede tidak hanya situsnya namun juga kearifan lokal yang dirawat masyarakatnya.', '', 1, 'location', 'cdn/2023/10/kotagede-heritage-trail.jpg', 'Kampung Trunojayan KG II/881, Prenggan, Kec. Kotagede, Kota Yogyakarta, Daerah Istimewa Yogyakarta 5', '-7.8263088', '110.398512', 'Kotagede Heritage Trail', '', 'Kotagede Heritage Trail', 0, 0, '01:00:00', 3600, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(45, 'wisata-mangunan-1', 1000, '2023-02-10 22:19:15', '2023-10-09 20:06:32', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Berikut beberapa tempat wisata Mangunan Yogyakarta yang sering dikunjungi sejak pertengahan 2016.</p>\r\n\r\n<ul>\r\n	<li>Kebun Buah Mangunan<br />\r\n	Menikmati pemandangan dengan udara yang sangat sejuk bisa menjadi sarana relaksasi di tengah penatnya suasana kota. Nah, di bantul yogyakarta ada tempat tersembunyi yang sejuk dan indah dipandang mata, julukannya adalah negeri di atas awan yaitu Wisata Kebun Buah Mangunan. Salah satu daya tarik gardu pandang mangunan adalah dari ketinggian 200 m dari permukaan air laut pengunjung dapat menikmati gumpalan awan putih di atas pegunungan sewu. Tempat wisata jogja yang berada di desa mangunan, kecamatan dlingo imogiri tak pernah sepi oleh pengunjung tujuan utamanya adalah melihat terbit dan tenggelamnya matahari. Sambil sejenak melepas penat dan menghirup sejuknya udara di tengah hijaunya kebun buah mangunan.</li>\r\n	<li>Jurang Tembelan Kanigoro<br />\r\n	Jurang Tembelang letaknya tidak jauh dari Kebun Buah Mangunan, bahkan masih satu jalur. Ketika ingin ke kebun buah mangunan banyak yang mampir di tempat wisata baru di mangunan ini. Selain rutenya yang mudah, tempat wisata jurang tembelan menawarkan panorama pemandangan yang tidak kalah dengan kebun buah mangunan. Sama-sama berada diketinggian dengan gardu pandang serasa di atas awan. Ada beberapa spot selfie di jurang tembelan, yang populer adalah spot foto berupa perahu dengan background hamparan pemandangan yang luas nan hijau. Untuk harga masuk jurang tembelan seiklasnya, hanya membayar parkir Rp. 2000 untuk sepeda motor.</li>\r\n	<li>Hutan Pinus Mangunan<br />\r\n	Hutan pinus menjadi salah satu wisata alam yang sejuknya alami, banyak hal dapat dilakukan, sekedar berjalan-jalan di bawah rindangnya pepohonan pohon pinus atau ngobrol santai bersama teman-teman dapat dilakukan di sini. Selain itu bisa camping dengan membayar Rp 30-50 ribu.</li>\r\n	<li>Hutan Pinus Asri<br />\r\n	Berbeda dengan hutan pinus lainnya, Hutan Pinus Asri memiliki gardu pandang yang memukau, terbuat dari papan kayu yang lebar dan terletak di tempat yang mudah dijangkau. Saat berkunjung ke tempat wisata satu ini, spot foto gardu pandang pinus asri tidak pernah sepi, dari sini Anda dapat melihat keindahan alam Dlingo dari ketinggian.</li>\r\n	<li>Wisata Seribu Batu Songgo Langit<br />\r\n	Rumah hobbit dan rumah seribu kayu kini tidak hanya ada di Bandung, di jogja juga ada rumah hobbit yang terletak di tempat wisata seribu batu songgo langit. Terletak di desa Mangunan, Kecamatan Dlingo. Spot foto rumah hobbit dan rumah kurcaci yang dibuat semirip mungkin menjadi daya tarik untuk berfoto. Selain itu juga terdapat flyingfox bagi Anda yang suka dengan permainan uji andrenalin ini, namun dengan biaya Rp 15.000.</li>\r\n	<li>Puncak Panguk Kediwung<br />\r\n	Bukit panguk kediwung dlingo ini masih satu kawasan dengan kebun buah mangunan. Dengan suguhan pemandangan alam khas dlingo yang hijau dengan udara segar pegunungan. Apalagi pengunjung datang di pagi hari buta. Pemandangan alam yang hijau dengan balutan kabut yang memanjakan mata anda. Tempat wisata mangunan ini terkenal dengan spot foto berburu sunrise dengan tema negeri di atas awan dengan pemandangan yang luas.</li>\r\n	<li>Bukit Mojo Gumelem<br />\r\n	Bukit Mojo terletak tak jauh dari Kebun Buah Mangunan. Wisata mangunan denganspot sarang burung ini terletak di jalur menuju Bukit panguk Kediwung. tepatnya di Pedukuhan Kediwung, Mangunan, Dlingo, Bantul. Bukit Mojo sendiri sebenarnya sudah dikembangkan sejak awal tahun 2016, bersamaan dengan populernya Bukit panguk Kediwung. Namun karena belum diolah dengan spot foto yang artistik, jadi kurang menarik. Baru setelah jurang tembelan yang nge-hits dengan spot foto kapal besar dengan gardu pandang yang ciamik, penduduk sekitar menata kembali dan mengembangkan tempat wisata mangunan ini dengan lebih menarik.</li>\r\n</ul>\r\n</body>\r\n</html>\r\n', '', 'Wisata Mangunan', '', 'Secara geografis, dlingo memiliki puncak tinggi yang berada di desa dlingo, dari puncak tersebutlah diberdayakan oleh warga setempat dan dijadikan tempat wisata. Banyak wisata Negeri di Atas Awan di daerah bantul, karena tempat wisata yang ditawarkan kebanyakan menawarkan view / gardu pandang dari atas bukit. Beberapa ada yang memiliki pesona berasa di atas awan (pemandangan berupa awan putih yang menyelimuti hijaunya hutan yang dibawahnya). Ada banyak tempat wisata Mangunan Yogyakarta yang sering dikunjungi.', '', 1, 'location', 'cdn/2023/10/wisata-mangunan.jpg', '3C5F+CQ2, Unnamed Road, Mangunan, Kec. Dlingo, Kabupaten Bantul, Daerah Istimewa Yogyakarta 55783, I', '-7.9414886', '110.4243856', 'Wisata Mangunan', '', 'Wisata Mangunan', 0, 8000, '01:00:00', 3600, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(46, 'alun-alun-kidul-yogyakarta', 1000, '2023-02-10 22:19:15', '2023-10-12 09:58:59', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Salah satu ciri yang juga menjadi identitas bagi pusat-pusat kota lama di Pulau Jawa adalah adanya alun-alun pada pusat kota tersebut. Alun-alun di Pulau Jawa ini berupa sebuah lapangan luas yang dikelilingi oleh pohon beringin di tengahnya. Salah satunya yaitu Alun-alun yang berada di&nbsp;Kota Yogyakarta.</p>\r\n\r\n<p>Di masa kerajaan Mataram, Alun-alun Kidul berfungsi untuk menyiapkan suatu kondisi yang menunjang kelancaran hubungan antara keraton dengan dunia luar. Alun-alun Kidul juga melambangkan kesatuan kekuasaan yang sakral antara raja dan para bangsawan yang tinggal di sekitar alun-alun. Sedangkan Alun-alun Lor berfungsi untuk menyediakan persyaratan bagi berlangsungnya kekuasaan raja.</p>\r\n\r\n<p>Alun-alun Kidul ini merupakan bagian belakang&nbsp;Keraton Yogyakarta. Menurut sejarahnya, alun-alun Kidul dibuat untuk mengubah suasana bagian belakang keraton menjadi seperti bagian depan karena&nbsp;Gunung Merapi, Keraton Yogyakarta, dan laut Selatan Pulau Jawa jika ditarik dalam satu garis imajiner akan membentuk satu garis lurus. Agar posisi Keraton Yogyakarta tidak seperti membelakangi laut Selatan, maka dibangunlah Alun-alun Selatan.</p>\r\n\r\n<p>Masih di dalam kompleks Alun-alun Kidul, terdapat bangunan&nbsp;Sasana Hinggil&nbsp;yang pada zaman dahulu menjadi tempat bagi raja untuk menyaksikan adu manusia dengan harimau yang disebut rampog macan, tetapi saat ini berubah fungsi menjadi tempat pertunjukan seni.</p>\r\n</body>\r\n</html>\r\n', '', 'ALUN ALUN KIDUL YOGYAKARTA', '', 'Alun-alun Kidul yang biasa disingkat Alkid atau dalam Bahasa Indonesia berarti Alun-alun Selatan, merupakan wilayah bagian selatan dari Kraton Yogyakarta. Saat ini Alkid menjadi sebuah ruang publik bagi masyarakat. Berbagai macam kegiatan dapat dijumpai di Alkid. Menjelang sore hingga malam hari, Alkid menjelma sebuah tempat rekreasi rakyat yang tentunya sayang untuk dilewatkan.', '', 1, 'location', '', '6939+QQ9, Suryatmajan, Kec. Danurejan, Kota Yogyakarta, Daerah Istimewa Yogyakarta, Indonesia', '-7.7955798', '110.3694896', 'ALUN ALUN KIDUL YOGYAKARTA', 'ALUN ALUN KIDUL YOGYAKARTA', 'ALUN ALUN KIDUL YOGYAKARTA', 0, 0, '01:30:00', 5400, 5, 'D.I. Yogyakarta', 0, 0, 0),
(47, 'paintball-jupiter-jogja-1', 1000, '2023-02-10 22:19:15', '2023-10-08 22:50:32', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>agar tidak bingung, sebelum berkunjung ke Jupiter Paintball Jogja simak dulu informasi wisatanya berikut ini.</p>\r\n\r\n<p><br />\r\n1. Lokasi, jam buka, dan biaya<br />\r\nInfo Liburan Seru Jupiter Paintball Jogja: Lokasi, Rute, dan TipsnyaJupiter Paintball Jogja (Google Maps/Paintball Jogja)<br />\r\nLokasi: Jogja Adventure Zone (JAZ) Blok O, Aero Wisata Skadik 104, Jl. Maguwo, Karang Jambe, Banguntapan, Kabupaten Bantul, Yogyakarta.</p>\r\n\r\n<p>Jam buka: setiap hari pukul 08.00 17.00.</p>\r\n\r\n<p>Biaya: mulai dari Rp50.000 per orang untuk 1 paket.</p>\r\n\r\n<p>2. Rute menuju Jupiter Paintball Jogja<br />\r\nInfo Liburan Seru Jupiter Paintball Jogja: Lokasi, Rute, dan TipsnyaJupiter Paintball Jogja (Google Maps/Paintball Jogja)<br />\r\nTerletak di sisi timur Kota Yogyakarta, rute menuju Jupiter Paintball dari pusat kota memerlukan waktu sekitar 16 hingga 20 menit. Jarak lokasi dari Kota Yogyakarta kurang lebih sejauh 6,5 km dan bisa ditempuh menggunakan kendaraan pribadi maupun transportasi online.</p>\r\n\r\n<p>Dari Kota Yogyakarta, kamu bisa melaju ke Jalan Kusumanegara ke arah Bantul melewati Jogja Expo Center (JEC).</p>\r\n\r\n<p>Sebagai alternatif, kamu juga bisa melewati Jalan Majapahit atau Jalan Ringroad Timur. Setelah itu lanjutkan perjalanan menuju Jalan Amarta di Banguntapan, kemudian ikuti papan petunjuk arah menuju Jogja Adventure Zone (JAZ).</p>\r\n\r\n<p>3. Aktivitas yang bisa dilakukan di Jupiter Paintball Jogja<br />\r\nInfo Liburan Seru Jupiter Paintball Jogja: Lokasi, Rute, dan TipsnyaJupiter Paintball Jogja (Google Maps/Jupiter Paintball Jogja)</p>\r\n\r\n<p><br />\r\nDengan fasilitas lapangan yang cukup luas, pengunjung bisa melakukan aktivitas luar ruangan seperti paintball, outbound, ataupun sekadar outing.&nbsp;</p>\r\n\r\n<p>Paintball sendiri adalah permainan simulasi perang menggunakan peluru gelatin yang mengandung pewarna.</p>\r\n\r\n<p>Paintball dimainkan oleh 2 kelompok dengan minimal pemain sebanyak 4 orang sehingga salah satu ketentuan pengunjung adalah harus datang bersama rombongan atau tim sejumlah minimal 8 orang.</p>\r\n\r\n<p>Anggota tim yang tidak terkena tembakan dan yang tersisa paling banyak dianggap sebagai pemenang sehingga setiap tim harus menyusun strategi menyerang dan bertahan.Dengan paket mulai dari Rp50.000 per orang, pemain akan memperoleh fasilitas perlengkapan. Fasilitas yang diperoleh yaitu senjata berisi 50 peluru, body protector (pelindung tubuh), pelindung wajah, seragam, air mineral, dokumentasi, dan pendampingan oleh fasilitator berpengalaman. Pemain juga bisa membeli ekstra peluru dan merchandise jika ingin.</p>\r\n\r\n<p>Pemain bisa memilih beberapa skenario permainan seperti Attack &amp; Defend, Capture the Flag, Total Elimination, Shoot the Captain, atau Hostage Rescue.&nbsp;</p>\r\n\r\n<p>Tidak perlu bingung, sebab sebelum bermain pengunjung akan diberikan briefing terkait teknis dan standar keamanan permainan. Setiap permainan juga akan didampingi oleh tim pelatih dari Jupiter Paintball.</p>\r\n\r\n<p>Selain fasilitas permainan, Jupiter Paintball menyediakan fasilitas lainnya seperti toilet, ruang tunggu, musala, dan area parkir yang luas. Tempatnya juga bersih, nyaman, dan sejuk. Dijamin asyik untuk bersenang-senang bersama teman dan keluarga.<br />\r\n&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Paintball Jupiter Jogja', '', 'Pernah mendengar games perang seperti Counter Strike atau Player Unknown s Battleground Mobile (PUBGM)? Jika kamu penyuka permainan simulasi strategi perang dan menyenangi permainan atau olahraga yang memacu adrenalin, Jupiter Paintball Jogja bisa dijadikan destinasi berlibur.', '', 1, 'location', 'cdn/2023/10/painball.jpg', 'Jogja Adventure Zone, Aero Wisata Skadik 104, Jl. Maguwo, Banguntapan, Kec. Banguntapan, Kabupaten B', '-7.798217999999999', '110.4200702', 'Paintball Jupiter Jogja', '', 'Paintball Jupiter Jogja', 0, 100000, '02:00:00', 7200, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(48, 'history-of-java-museum-hojm-1', 1000, '2023-02-10 22:19:15', '2023-10-08 23:33:46', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>History of Java Museum (dalam bahasa Indonesia: Museum Sejarah Jawa) beroperasi pada akhir Desember 2018. History of Java Museum merupakan ikon wisata sejarah dan budaya berlokasi di Jalan Parangtritis KM 5.5, Kecamatan Sewon, Kabupaten Bantul, DIY.<br />\r\n<br />\r\nHistory of Java Museum menceritakan tentang Peradaban Tanah Jawa dan dibangun dengan design gedung yang unik, sangat inspiratif, dan penuh nilai filosofis.Design bangunan History of Java Museum menggambarkan simbol gunungan dalam cerita pewayangan. Serta melambangkan kehidupan manusia (golong gilig), yaitu Manunggaling Jiwa, Rasa, Cipta, Karsa, dan Karya dalam kehidupan kita. Sebuah Miniatur budaya, peradaban, dan sejarah Tanah Jawa.<br />\r\n<br />\r\nKetika berkunjung, setiap pengunjung akan ditemani pemandu (guide museum) untuk bersama-sama mengenal berbagai koleksi bersejarah yang diwariskan sejak era purbakala sampai era kerajaan besar di tanah Jawa. Selain itu, beragam aktivitas wisata History of Java Museum bertumpu pada komponen edukasi serta mengaplikasikan teknologi visual yang menghibur. Oleh karena itu, proses bertukar informasi antara pengunjung dan pemandu museum juga didukung teknologi Augmented Reality (AR). Teknologi AR pada barcode gambar yang ikonik menjadikan obyek foto tersebut seakan nyata saat dipotret bersama pengunjung History of Java Museum.<br />\r\n&nbsp;</p>\r\n\r\n<p><meta charset=\"utf-8\" /></p>\r\n</body>\r\n</html>\r\n', '', 'History Of Java Museum (HOJM)', '', 'Museum History of Java adalah museum sejarah Pulau Jawa yang berlokasi di Yogyakarta. Museum ini beroperasi pada akhir Desember 2018. Koleksi museum ini berupa benda purbakala masa prasejarah sampai kerajaan-kerajaan lama, seperti Tarumanegara, Majapahit, Demak Bintaro, Cirebon, dan Mataram Islam.', '', 1, 'location', 'cdn/2023/10/museum-history-of-java-yogyakarta.jpg', 'Jl. Parangtritis Km 5.5 ( Pyramid Cafe) Tarudan Bangunharjo Sewon Bantul Regency Special Region of Y', '-7.8439029', '110.36226099999999', 'History Of Java Museum (HOJM)', '', 'History Of Java Museum (HOJM)', 3, 30000, '01:00:00', 3600, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(49, 'pokdarwis-jurug-taman-sari', 1000, '2023-02-10 22:19:15', '2023-10-08 21:35:10', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Kedung ini menjadi favorit wisatawan lokal yang datang untuk berenang dan bermain air. Bagi yang tidak bisa berenang, tak perlu gusar, sewa saja ban pelampung yang disediakan pengelola. Bila biasanya mengunjungi air terjun itu lebih baik ketika musim penghujan, lain halnya dengan Jurug Lengkongsari. Waktu terbaik untuk mengunjunginya adalah pada musim kemarau, ketika air kedungnya cukup jernih menghijau. Cara menuju ke sana : dari Kota Joga &ndash; Jl. Wonosari &ndash; Bukit Bintang &ndash; perempatan pos polisi Patuk ambil kanan &ndash; pertigaan pertama ambil jalan lurus &ndash; lalu ikuti petunjuk jalan menuju Air Terjun Jurug Taman Sari.</p>\r\n</body>\r\n</html>\r\n', '', 'Pokdarwis Jurug taman sari', '', 'Air Terjun Jurug Lengkongsari dibuka oleh warga setempat pada 2014 lalu, sehingga masih tergolong baru dan asing di kalangan wisatawan. Air terjun ini terletak di dekat Pos Polisi perempatan Patuk tepatnya di Desa Wisata Jurug Taman Sari, Desa Semoyo, Patuk, Gunungkidul. Istimewanya, air terjun ini merupakan air terjun kembar yang jatuh ke dalam kedung Lengkongsari yang kedalamannya mencapai 7 meter. Kedung ini menjadi favorit wisatawan lokal yang datang untuk berenang dan bermain air. Bagi yang tidak bisa berenang, tak perlu gusar, sewa saja ban pelampung yang disediakan pengelola. Bila biasanya mengunjungi air terjun itu lebih baik ketika musim penghujan, lain halnya dengan Jurug Lengkongsari. Waktu terbaik untuk mengunjunginya adalah pada musim kemarau, ketika air kedungnya cukup jernih menghijau.', '', 1, 'location', 'cdn/2023/10/9.jpg', 'wonosari Rt 02, Semoyo, Patuk, Bantaran Kulon, Srimulyo, Kec. Piyungan, Kabupaten Gunung Kidul, Daer', '-7.8290343', '110.453198', 'Pokdarwis Jurug taman sari', '', 'Pokdarwis Jurug taman sari', 0, 0, '01:00:00', 3600, 4, 'D.I. Yogyakarta', 0, 0, 0);
