(50, 'vihara-buddha-prabha-1', 1000, '2023-02-10 22:19:15', '2023-10-09 19:30:07', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Terletak di jalan Brigjen Katamso, bangunan ini berdiri pada tanggal 15 Agustus 1990. Bangunan ini berdiri di atas tanah hibah dari Kraton Yogyakarta pada masa pemerintahan Sri Sultan Hamengku Buwono VII, di mana telah diserahkan pada sejak tahun 1845 yang memang diperuntukkan bagi warga Cina sebagai tempat pemujaan.</p>\r\n\r\n<p>Pada awalnya, Vihara atau yang lebih dikenal dengan kelenteng ini bernama Hok Tik Bio, yaitu tempat kebaktian bagi Hok Tik Sin yang oleh umat Budha dipercaya sebagai Dewa Bumi. Namun, di Vihara ini juga terdapat altar pemujaan bagi umat Budha dan Konghucu. Pada era orde baru, nama bangunan ini diganti dengan Vihara Buddha Prabha. Karena pada waktu itu hanya terdapat lima agama resmi di Indonesia, makan di Vihara in lebih menonjolkan unsur Budha.</p>\r\n\r\n<p>Vihara yang menghadap ke barat ini berdiri di atas tanah seluas 1150 m2 dengan halaman halaman yang luas mengelilinginya. Denah bangunannya berbentuk persegi panjang, terdiri dari ruang utama di tengah, ruang sisi utara, ruang sisi selatan, dan ruang belakang, sedangkan pada tengah banguna terdapt pelataran terbuka. Ciri utama dari arsitektur kelenteng ini adalah tipe Ngang Shan, dengan bubungan yang kedua ujungnya melengkung ke atas. Atapnya dihiasi patung naga yang saling berhadapan dengan ekor tegak. Pada bagian tengah patung naga terdapat bola api yang merupakan symbol mutiara bulan. Dalam tradisi Cina, naga melambangkan perlindungan dan kekuasaan, sedang mutiara bulan adalah lambing kesucian.</p>\r\n\r\n<p>Pada dinding, tiang dan bagian bangunan lainnya, banyak terdapat gambar atau ukiran bergaya Cina dengan berbagai ragam hias. Pada ruang utama Vihara ini terdapat beberapa altar sembahyang lengkap dengan arcanya. Altar yang berada di tengah ruangan merupakan altar pemujaan bagi Buddha Gautama, Dhyani Bodhisatva Avalokitesvara, Prajnaparamita, dan Maitreya. Selain itu juga terdapat altar untuk memuja Hok Tik Cing Sin, Day Yang Sing Kun, Day Ing Poo Sat, Kong Tik Coen Ong, dan Thiang Sian Sing Bo yang merupakan tokoh dalam Taoisme.</p>\r\n\r\n<p>Pada ruang samping kiri terdapat altar pemujaan bagi Hiang Thiang Siang Tee, sedangkan di ruang samping kanan terdapat altar pemujaan bagi Kwan Tee Koen and Khong Hu Cu. Di rirang belakang terdapt tempat pemujaan tokoh-tokoh Budha yang berisi arca-arca berukuran kecil yang menggambarkan Budha Gautama, Dhyani Buddha Amitabha, Bhaisajyaguru Buddha, Dhyani Bodhisatva Avalokitesvara, dan Maitreya. Di ruang atas yang merupakan ruang tambahan, terdapat altar pemujaan bagi Buddha Gautama, Dhyani Buddha Amitabha, Bhaisajyaguru Buddha, Ananda, dan Sariputra.</p>\r\n</body>\r\n</html>\r\n', '', 'Vihara Buddha Prabha', '', 'Vihara Buddha Prabha atau lebih dikenal sebagai Kelenteng Gondomanan karena memang fungsinya sebagai tempat ibadah 2 agama yang berbeda, yaitu Buddha dan Khong Hu Cu. Bangunan tua ini mempunyai nilai sejarah dan spiritual penting bagi masyarakat Tionghoa di Kota Yogyakarta. Pada awalnya, kelenteng yang berlokasi di Jl. Brigjen Katamso No. 3 Kota Yogyakarta ini bernama Fuk Ling Miau (Hokkien: Hok Tik Bio), yaitu tempat kebaktian bagi Hok Tik Ceng Sin (Dewa Bumi). Namun, pada era Orde Baru, nama bangunan ini diganti dengan Vihara Buddha Prabha karena pada waktu itu hanya terdapat lima agama resmi di Indonesia. Umat Khong Hu Cu dan Toisme didaftarkan sebagai penganut Buddha, dan nama kelenteng diganti dengan nama tempat ibadah Tridharma. Sebab itu, pada masa Orde Baru, kelenteng ini lebih menonjolkan unsur Buddha-nya dan namanya menjadi Vihara Buddha Prabha.', '', 1, 'location', 'cdn/2023/10/vihara-buddha-prabha.png', 'Jl. Brigjen Katamso No.3, Prawirodirjan, Gondomanan, Yogyakarta City, Special Region of Yogyakarta 5', '-7.8018746', '110.3694664', 'Vihara Buddha Prabha', '', 'Vihara Buddha Prabha', 1, 0, '01:00:00', 3600, 4.8, 'D.I. Yogyakarta', 0, 0, 0),
(51, 'desa-wisata-pentingsari-1', 1000, '2023-02-10 22:19:15', '2023-10-12 11:24:31', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Kota Yogyakarta merupakan kota yang memiliki banyak tempat wisata yang sangat indah dan menakjubkan. Destinasi wisatanya mulai dari wisata sejarah, wisata alam, wisata budaya, sampai ke wisata kuliner. Semua wisata tersebut terdapat di kota Yogyakarta. Selain memiliki banyak tempat wisata, di Kota Yogyakarta saat ini sedang mengembangkan Desa wisata. Desa wisata yang akan dibahas kali ini yaitu&nbsp;Desa Wisata Pentingsari&nbsp;yang berada di Kabupaten Sleman.</p>\r\n\r\n<p style=\"text-align: justify;\">Desa Wisata Pentingsari merupakan salah satu desa wisata yang ada di Yogyakarta. Tepatnya berada di bawah kaki gunung Merapi, karena berada di bawah kaki gunung Merapi suasana yang ada di Desa Wisata ini sangatlah sejuk pada siang hari maupun pada sore hari. Pentingsari ini merupakan sebuah dusun yang saat ini sedang dikembangkan desa wisata sejak&nbsp; tahun 2008. Setiap tahun di Desa Wisata Pentingsari banyak dikunjungi para wisatawan baik wisatawan lokal maupun wisatawan mancanegara.</p>\r\n\r\n<p style=\"text-align: justify;\">Desa Wisata Pentingsari ini menawarkan keaslian budaya, alam dan sosial sebagai daya tariknya. Jika anda melihat dari peta bentuk geografi desa wisata Pentingsari ini memiliki bentuk yang unik bentuknya seperti semenanjung, disebelah selatan terdapat lembah ponteng dan Gondoran, di sebelah barat ada lembah yang curam yaitu kali kuning, disebelah timur ada lembah kali pawon dan disebelah utara ada pemukiman warga sekitar dan hamparan luas dari pemandangan gunung Merapi.</p>\r\n\r\n<p style=\"text-align: justify;\">Desa Wisata Pentingsari memiliki pemandangan yang sangat indah dengan background gunung Merapi. Desa Wisata Pentingsari ini memiliki 3 aspek unggulan yang membuat tempat ini banyak diminati banyak orang. Aspek pertama yaitu pemandangan alam dengan sawah luas yang masih asri. Aspek yang kedua yaitu sistem kerja dan pemberdayaan warga sekitar. Dan aspek yang ketiga yaitu budayanya, masyarakat di Dusun Pentingsari ini membangun bentuk rumah khas Joglo, sampai homestay yang dimilikinya banyak yang berbentuk rumah khas Joglo.</p>\r\n</body>\r\n</html>\r\n', '', 'Desa Wisata Pentingsari', '', 'Desa Wisata Pentingsari merupakan salah satu desa wisata yang ada di Yogyakarta. Tepatnya berada di bawah kaki gunung Merapi, karena berada di bawah kaki gunung Merapi suasana yang ada di Desa Wisata ini sangatlah sejuk pada siang hari maupun pada sore hari. Pentingsari ini merupakan sebuah dusun yang saat ini sedang dikembangkan desa wisata sejak  tahun 2008. Setiap tahun di Desa Wisata Pentingsari banyak dikunjungi para wisatawan baik wisatawan lokal maupun wisatawan mancanegara.', '', 1, 'location', 'cdn/2023/10/lokasi-desa-wisata-pentingsari.jpg', 'Pentingsari, Umbulharjo, Cangkringan, Sleman Regency, Special Region of Yogyakarta, Indonesia', '-7.6428597', '110.42957539999999', 'Desa Wisata Pentingsari', 'Desa Wisata Pentingsari', 'Desa Wisata Pentingsari', 0, 7500, '02:00:00', 7200, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(52, 'miniature-baiturrahman-grand-mosque-aceh-yogyakarta', 1000, '2023-02-10 22:19:15', '2023-10-08 22:30:02', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Masjid Raya Baiturrahman Aceh menjadi kebanggaan masyarakat Nanggroe Aceh Darussalam, dimana saat tsunami besar tahun 2006 tetap kokoh berdiri. Di Yogyakarta, ada Miniatur Masjid Raya Baiturrahman Aceh, yang dibangun sebagai balas budi masyarakat Aceh kepada warga Yogyakarta atas bantuan selama gempa tsunami di tahun 2006 silam<br />\r\n&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Miniature Baiturrahman Grand Mosque Aceh Yogyakarta', '', 'Masjid Raya Baiturrahman Aceh menjadi kebanggaan masyarakat Nanggroe Aceh Darussalam, dimana saat tsunami besar tahun 2006 tetap kokoh berdiri. Di Yogyakarta, ada Miniatur Masjid Raya Baiturrahman Aceh, yang dibangun sebagai balas budi masyarakat Aceh kepada warga Yogyakarta atas bantuan selama gempa tsunami di tahun 2006 silam\r\n', '', 1, 'location', 'cdn/2023/10/miniatur-mesjid.jpg', '58FV+GX8, Jl. Ringroad Selatan Jalan Plurugan, Pluragan, Tirtonirmolo, Kasihan, Bantul Regency, Spec', '-7.8262101', '110.3449539', 'Miniature Baiturrahman Grand Mosque Aceh Yogyakarta', '', 'Miniature Baiturrahman Grand Mosque Aceh Yogyakarta', 0, 0, '00:30:00', 1800, 4.8, 'D.I. Yogyakarta', 0, 0, 0),
(53, 'golden-bioskop-virtual-reality-1', 1000, '2023-02-10 22:19:15', '2023-10-09 20:29:47', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Di Golden&nbsp;Bioskop&nbsp;Virtual&nbsp;Reality, pengunjung akan mengenakan alat khusus yang diletakkan di mata bernama metaquest yang didatangkan langsung dari Jerman.</p>\r\n\r\n<p>Dengan bantuan server wifi, komputer dan speaker, nantinya pengunjung bisa merasakan tiga sensasi dunia virtual seperti sedang menaiki rollercoaster, menjelajahi kehidupan dinosaurus, dan merasakan sky diving.</p>\r\n\r\n<p>Hadirnya bioskop tersebut merupkan bentuk gagasan dari Margito (40), selaku pemilik&nbsp;Golden&nbsp;Bioskop&nbsp;Virtual&nbsp;Reality, yang ingin menghadirkan wahana unik dengan bantuan teknologi virtual reality.</p>\r\n</body>\r\n</html>\r\n', '', 'GOLDEN BIOSKOP VIRTUAL REALITY', '', 'Golden Bioskop Virtual Reality merupakan wahana yang menyuguhkan sensasi dunia virtual 360 derajat yang begitu nyata', '', 1, 'location', 'cdn/2023/10/golden-bioskop-virtual-reality.jpg', 'Jl. Malioboro No.25, Sosromenduran, Gedong Tengen, Kota Yogyakarta, Daerah Istimewa Yogyakarta 55271', '-7.7955032', '110.365309', 'GOLDEN BIOSKOP VIRTUAL REALITY', '', 'GOLDEN BIOSKOP VIRTUAL REALITY', 0, 25000, '02:00:00', 7200, 5, 'D.I. Yogyakarta', 0, 0, 0),
(54, 'bukit-pangol-1', 1000, '2023-02-10 22:19:15', '2023-10-12 12:58:35', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Bukit&nbsp;Pangol&nbsp;merupakan&nbsp;bukit&nbsp;yang&nbsp;berada&nbsp;di&nbsp;daerah&nbsp;Srimulyo&nbsp;Piyungan&nbsp;Bantul, Daerah Istimewa Yogyakarta. Bukit ini menawarkan keindahan alam berupa bentang alam yang indah diatas ketinggian &plusmn; 100mdpl. Wisata ini berada di bukit dan bertepat diatas wisata Pasar kebon Empring. Di destinasi ini tersedia banyak spotfoto yang siap menjadi objek selfie yang menjorok kearah view perkotaan kota Yogyakarta. Bukit ini terletak di selatan kota Yogyakarta yang dapat ditempuh dari pusat kota sekitar 40menit.</p>\r\n</body>\r\n</html>\r\n', '', 'Bukit Pangol', '', 'Bukit Pangol merupakan adalah destinasi wisata di daerah Srimulyo. Wisata ini berada di bukit dan bertepat diatas wisata Pasar kebon Empring. Di destinasi ini tersedia banyak spotfoto yang siap menjadi objek selfie yang menjorok kearah view perkotaan kota Yogyakarta.', '', 1, 'location', '', '5F75+VHG, Pangol, Jl. Payak Tengah, Jombor, Srimulyo, Piyungan, Bantul Regency, Special Region of Yo', '-7.8353074', '110.45896599999999', 'Bukit Pangol', 'Bukit Pangol', 'Bukit Pangol', 0, 0, '01:00:00', 3600, 3.7, 'D.I. Yogyakarta', 0, 0, 0),
(55, 'plaosan-temple-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:24:23', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Candi Plaosan terletak di Desa Bugisan, Kecamatan Prambanan, Kabupaten Klaten, kira-kira 1,5 km ke arah timur dari Candi Sewu. Candi ini merupakan sebuah kompleks bangunan kuno yang terbagi menjadi dua, yaitu kompleks Candi Plaosan Lor (lor dalam bahasa Jawa berarti utara) dan kompleks Candi Plaosan Kidul (kidul dalam bahasa Jawa berarti selatan). Pahatan yang terdapat di Candi Plaosan sangat halus dan rinci, mirip dengan yang terdapat di Candi Borobudur, Candi Sewu, dan Candi Sari.<br />\r\nCandi Plaosan yang merupakan candi Buddha ini oleh para ahli diperkirakan dibangun pada masa pemerintahan Rakai Pikatan dari Kerajaan Mataram Hindu, yaitu pada awal abad ke-9 M. Salah satu pakar yang mendukung pendapat itu adalah De Casparis yang berpegang pada isi Prasasti Cri Kahulunan (842 M). Dalam prasasti tersebut dinyatakan bahwa Candi Plaosan Lor dibangun oleh Ratu Sri Kahulunan, dengan dukungan suaminya. Menurut De Casparis, Sri Kahulunan adalah gelar Pramodhawardani, putri Raja Samarattungga dari Wangsa Syailendra. Sang Putri, yang memeluk agama Buddha, menikah dengan Rakai Pikatan dari Wangsa Sanjaya, yang memeluk agama Hindu.<br />\r\nKompleks Candi Plaosan Lor memiliki dua candi utama. Candi yang terletak di sebelah kiri (di sebelah utara) dinamakan Candi Induk Utara dengan relief yang menggambarkan tokoh-tokoh wanita, dan candi yang terletak di sebelah kanan (selatan) dinamakan Candi Induk Selatan dengan relief menggambarkan tokoh-tokoh laki-laki. Di bagian utara kompleks terdapat mandapa terbuka dengan beberapa arca buddhis. Kedua candi induk ini dikelilingi oleh 116 stupa perwara serta 50 buah candi perwara, juga parit buatan.<br />\r\nPada masing-masing candi induk terdapat 6 patung/arca Dhyani Boddhisatwa. Walaupun candi ini adalah candi Buddha, tetapi gaya arsitekturnya merupakan perpaduan antara agama Buddha dan Hindu.</p>\r\n\r\n<p>Candi Induk Selatan Plaosan Lor dipugar pada tahun 1962 oleh Dinas Purbakala. Sementara itu, Candi Induk Selatan dipugar pada tahun 1990-an oleh Suaka Peninggalan Sejarah dan Purbakala Jawa Tengah.</p>\r\n</body>\r\n</html>\r\n', '', 'Plaosan Temple', '', 'Candi Plaosan adalah sebutan untuk kompleks percandian yang terletak di Dukuh Plaosan, Desa Bugisan, Kecamatan Prambanan, Kabupaten Klaten, Provinsi Jawa Tengah, Indonesia. Candi ini terletak kira-kira satu kilometer ke arah timur-laut dari Candi Sewu atau Candi Prambanan. Adanya kemuncak stupa, arca Buddha, serta candi-candi perwara (pendamping/kecil) yang berbentuk stupa menandakan bahwa candi-candi tersebut adalah candi Buddha. Kompleks ini dibangun pada abad ke-9 oleh Raja Rakai Pikatan dan Sri Kahulunan pada zaman Kerajaan Medang, atau juga dikenal dengan nama Kerajaan Mataram Kuno.\r\nKompleks Candi Plaosan terdiri atas Candi Plaosan Lor dan Candi Plaosan Kidul. Pada masa lalu, Kompleks percandian ini dikelilingi oleh parit berbentuk persegi panjang. Sisa struktur tersebut masih bisa dilihat sampai saat ini di bagian timur dan barat candi. Candi Plaosan merupakan salah satu wisata pendidikan dan religi di Jawa Tengah.', '', 1, 'location', 'cdn/2023/10/5.jpg', 'Jl. Candi Plaosan, Plaosan Lor, Bugisan, Prambanan, Klaten Regency, Central Java 57454, Indonesia', '-7.740780699999999', '110.50467719999999', 'Plaosan Temple', '', 'Plaosan Temple', 0, 5000, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(56, 'desa-wisata-brayut-1', 1000, '2023-02-10 22:19:15', '2023-10-12 11:17:08', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Desa wisata Brayut terletak di Pendowoharjo, Sleman,&nbsp;Yogyakarta, Indonesia. Desa wisata ini mengedepankan sisi budaya yang ada pada masyarakatnya yang berbasis pertanian. Desa wisata budaya yang berbasis pertanian ini merupakan tempat yang nyaman untuk rekreasi sekaligus mempelajari kebudayaan masyarakat karena juga didukung dengan suhu udara yang sejuk dengan pemandangan&nbsp;Gunung Merapi&nbsp;yang indah.</p>\r\n\r\n<p>Desa wisata Brayut memiliki berbagai potensi wisata budaya diantaranya adalah kegiatan-kegiatan masyarakat yang mengandung unsure kearifan lokal yang dapat di pelajari oleh wisatawan baik dari dalam negeri maupun mancanegara. Kegiatan budaya yang bisa dilakukan di Desa Wisata Brayut yaitu karawitan, membatik, tari-tarian, wisata kuliner, permainan rakyat, ataupun kegiatan konservasi baik budaya ataupun lingkungan. Selain itu arsitektur rumah penduduk di Desa Wisata Brayut sangat kental dengan budaya Jawa, misalnya bentuk Joglo, bentuk limasan, bentuk sinom, dan bentuk kampung.</p>\r\n\r\n<p>Sebagai desa berbasih pertanian tentu saja terdapat keghiatan-kegiatan pertanian yang bias dipelajari oleh para wisatawan. Kegiatan tersebut antara lain belajar membajak, menanam padi, ndawut (mencabut benih padi), memanen padi (ani-ani), menjemur padi, hingga memetik jeruk di kebun jeruk organik. Hal tersebut sangat bermanfaat untuk wisatawan yang ingin mengetahui lebih dalam mengenai kegiatan pertanian tradisional. Masih terdapat juga kegiatan peternakan masyarakat yang dapat dipelajari yaitu belajar membajak, memandikan sapi, hingga merumput.</p>\r\n\r\n<p>Sebagaimana layaknya desa wisata yang lain, akses menuju Brayut dapat dijangkau dengan mudah menggunakan kendaraan baik roda dua maupun roda empat. Hal tersebut karena kondisi jalan menuju lokasi sudah relative baik karena dikelola oleh masyarakat sekitar Desa Wisata Brayut.</p>\r\n</body>\r\n</html>\r\n', '', 'Desa Wisata Brayut', '', 'Desa wisata Brayut terletak di Pendowoharjo, Sleman, Yogyakarta, Indonesia. Desa wisata ini mengedepankan sisi budaya yang ada pada masyarakatnya yang berbasis pertanian. Desa wisata budaya yang berbasis pertanian ini merupakan tempat yang nyaman untuk rekreasi sekaligus mempelajari kebudayaan masyarakat karena juga didukung dengan suhu udara yang sejuk dengan pemandangan Gunung Merapi yang indah.', '', 1, 'location', 'cdn/2023/10/rute-desa-wisata-brayut.jpg', 'Brayut, Pandowoharjo, Kec. Sleman, Kabupaten Sleman, Daerah Istimewa Yogyakarta 55512, Indonesia', '-7.701492', '110.37390599999999', 'Desa Wisata Brayut', 'Desa Wisata Brayut', 'Desa Wisata Brayut', 0, 0, '01:00:00', 3600, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(57, 'omah-oblong', 1000, '2023-02-10 22:19:15', '2023-10-08 23:00:26', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Salah seorang pemandu, Rahman Surahman, mengatakan, konsep belanja sambil belajar ini dipilih biar wisatawan enggak hanya sekedar belanja saja. Namun juga bisa mendapatkan ilmu, seperti cara memotong kain, menjahit, membuat desain, menyablon, hingga packing.</p>\r\n\r\n<p>&nbsp;Dengan berkunjung ke Omah Oblong Jogja T-shirt, minimal wisatawan bisa dapat ilmu baru. Syukur-syukur kalau mereka juga terinspirasi untuk mengembangkan usaha sejenis di daerah masing-masing, &nbsp;kata Rahman.<br />\r\nBerdiri di atas lahan seluas 1 hektar, Omah Oblong Jogja T-shirt yang lahir pada 17 Agustus 2009, pernah mencetak rekor MURI (Museum Rekor Indonesia) saat membuat kaos oblong terbesar di Indonesia dengan ukuran 36 meter x 44 meter.</p>\r\n</body>\r\n</html>\r\n', '', 'Omah Oblong', '', 'Belanja oleh-oleh sambil belajar berwirausaha, inilah konsep yang coba ditawarkan oleh pabrik kaos Omah Oblong Jogja T-shirt, di Desa Trihanggo, Kabupaten Sleman, Yogyakarta kepada para wisatawan yang berbelanja di tempat tersebut.\r\n\r\nJadi, setiap wisatawan yang akan berbelanja kaos oblong untuk oleh-oleh, terlebih dulu diajak berkeliling area pabrik dengan didampingi seorang guide (pemandu). Salah satu yang dikunjungi adalah ruang produksi, jadi kamu bisa melihat langsung proses produksi kaos oblong di pabrik ini.', '', 1, 'location', 'cdn/2023/10/omah-goblong-2.jpg', '68QX+276, Jl. Jambon, Biru, Trihanggo, Gamping, Sleman Regency, Special Region of Yogyakarta 55291, ', '-7.7624571', '110.3481492', 'Omah Oblong', '', 'Omah Oblong', 0, 0, '01:00:00', 3600, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(58, 'timang-beach-1', 1000, '2023-02-10 22:19:15', '2023-10-09 18:55:40', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Seperti kebanyakan kebanyakan pantai di daerah gunung kidul pada umumnya, pantai Timang terdiri dari hamparan pasir putih dan tumbuhan pandan di sekelilingnya.Pantai ini belum banyak dikembangkan sehingga pemandangan yang terlihat masih terkesan alami. Pantai Timang terdiri dari dua bagian pantai. Bagian pertama disebelah timur merupakan pantai berpasir putih yang sama dengan pantai-pantai kebanyakan. Bagian kedua di sebelah barat berbentuk batu-batuan terjal (bukit) yang langsung berbatasan dengan laut. Pada bagian inilah terdapat pemandangan pulau atau batu besar di seberang pantai.Pulau atau batu besar tersebut oleh masyarakat sekitar disebut sebagai Batu Panjang, Pulau Panjang dan Pulau Timang. Pulau Panjang dikenal sebagai tempat terbaik untuk berburu lobster oleh masyarakat sekitar. Pantai Timang dan pulau Panjang terhubung melalui kereta gantung yang digerakkan pada tali yang menghubungkan antara pantai dengan puncak pulau.Tali yang digunakan berdiameter 4 cm dan mempunyai panjang kurang lebih 200 meter.Masyarakat sekitar biasa menggunakan kereta gantung tersebut untuk pergi memancing ikan dan lobster di pulau Panjang.</p>\r\n</body>\r\n</html>\r\n', '', 'Timang Beach', '', 'Pantai Timang adalah objek wisata berupa pantai yaitu wilayah yang menjadi batas antara lautan dan daratan yang terletak di Kabupaten Gunungkidul, Daerah Istimewa Yogyakarta. Pantai Timang merupakan salah satu pantai di yogyakarta yang pasirnya berwarna putih.', '', 1, 'location', 'cdn/2023/10/timang-beach.jpg', 'Jl. Pantai Sel. Jawa, Pantai, Purwodadi, Tepus, Gunung Kidul Regency, Special Region of Yogyakarta 5', '-8.1759266', '110.66241959999999', 'Timang Beach', '', 'Timang Beach', 0, 10000, '01:00:00', 3600, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(59, 'paradiso-jogja-view-1', 1000, '2023-02-10 22:19:15', '2023-10-08 23:00:01', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Jogja Paradise adalah food court terbesar di Jogja yang mengusung konsep One Stop Food Center dengan perpaduan klasik dan modern. YogYES bisa menemukan Mie Jakarta, Oishii Bento, Food Story, Sop Duren Lodaya dan It&#39;s Coffee mengisi outlet food court di Jogja Paradise. Food court yang satu ini menjadi tempat favorit untuk gathering berbagai komunitas karena fasilitas yang diberikan cukup lengkap seperti tempat makan yang luas dengan taman, meeting room, playground untuk anak-anak, mushola, free Wi-Fi, serta tempat parkir yang luas dan gratis.<br />\r\n&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Paradiso Jogja View', '', 'Jogja Paradise adalah food court terbesar di Jogja yang mengusung konsep One Stop Food Center dengan perpaduan klasik dan modern. YogYES bisa menemukan Mie Jakarta, Oishii Bento, Food Story, Sop Duren Lodaya dan It\'s Coffee mengisi outlet food court di Jogja Paradise. Food court yang satu ini menjadi tempat favorit untuk gathering berbagai komunitas karena fasilitas yang diberikan cukup lengkap seperti tempat makan yang luas dengan taman, meeting room, playground untuk anak-anak, mushola, free Wi-Fi, serta tempat parkir yang luas dan gratis.\r\n', '', 1, 'location', 'cdn/2023/10/paradiso-jogja.jpg', '5F75+PP4, Pangol payak tengah, Jombor, Srimulyo, Kec. Piyungan, Kabupaten Bantul, Daerah Istimewa Yo', '-7.8357465', '110.4593415', 'Paradiso Jogja View', '', 'Paradiso Jogja View', 0, 20000, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(60, 'museum-kereta-karaton-1', 1000, '2023-02-10 22:19:15', '2023-10-08 22:31:53', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Museum Kereta Keraton Yogyakarta terletak di Jl. Rotowijayan Yogyakarta, atau sebelah barat bangunan Keraton Yogyakarta. Museum yang didirikan sejak bertahtanya Sri Sultan Hamengkubuwono VI ini menyimpan beragam koleksi kereta kuda milik Keraton Kasultanan Yogyakarta. Pada jaman dahulu kereta-kereta tersebut dahulu merupakan kendaraan para sultan untuk berbagai keperluan dan acara yang diselenggarakan Keraton Yogyakarta.<br />\r\nMuseum ini memiliki berbagai kereta kuda yang umurnya mencapai ratusan tahun. Adapula kereta Mondro Juwolo, kereta kuda yang pernah dipakai oleh Pangeran Diponegoro. dari 23 koleksi kereta kuda, 18 kereta masih dipergunakan untuk kepentingan upacara-upacara kebesaran kraton, sedangkan 5 kereta lainnya sudah tidak dipergunakan mengingat kondisi dan usia kereta yang sudah tua. Kereta Kanjeng Nyai Jimad adalah kereta yang paling tua dengan angka tahun pembuatan 1750.<br />\r\nJenis Kereta di Museum Kraton Yogyakarta:</p>\r\n\r\n<p>Kereta atap terbuka dan beroda dua<br />\r\nKereta atap terbuka dan beroda empat<br />\r\nKereta atap tertutup beroda empat<br />\r\nJam Buka Museum:</p>\r\n\r\n<p>Museum Kereta Kraton Yogyakarta buka setiap hari, Senin - Minggu pukul 09.00 - 16.00 WIB<br />\r\nHarga Tiket Masuk:</p>\r\n\r\n<p>Individu: Rp 5.000,- untuk menggunakan kamera dikenakan biaya tambahan Rp 1.000,-</p>\r\n</body>\r\n</html>\r\n', '', 'Museum Kereta Karaton', '', 'Museum Kareta Karaton Ngayogyakarta atau Museum Kereta Keraton Yogyakarta adalah sebuah museum khusus yang berisi koleksi kereta kuda milik Keraton Kasultanan Yogyakarta. Museum tersebut terletak di sekitar area Keraton Yogyakarta. Tepatnya berseberangan dengan Bangsal Pagelaran, atau di sisi barat Jalan Rotowijayan.', '', 1, 'location', 'cdn/2023/10/yogyakarta-museum-kereta.jpg', '59V7+R3H, Jalan Rotowijayan, Kadipaten, Kraton, Yogyakarta City, Special Region of Yogyakarta 55132,', '-7.8054476', '110.3627375', 'Museum Kereta Karaton', '', 'Museum Kereta Karaton', 0, 7000, '01:00:00', 3600, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(61, 'klithikan-pakuncen-market', 1000, '2023-02-10 22:19:15', '2023-10-09 21:02:40', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pasar Klithikan Pakuncen Yogyakarta merupakan pasar tradisional yang terletak di Jalan HOS. Cokroaminoto No. 34, Kuncen, Kasihan, Bantul, Daerah Istimewa Yogyakarta, Indonesia. Pasar ini telah direlokasi pada tahun 2007 oleh pemerintah kota Yogyakarta sebagai upaya untuk memberikan tempat yang lebih baik bagi para pedagang Klithikan.</p>\r\n\r\n<p>Sebelum direlokasi, pasar Klithikan awalnya adalah pasar hewan. Namun, karena pertimbangan pertumbuhan perkotaan, pasar hewan dipindahkan ke Ambarketawang Gamping. Pembangunan pasar Klithikan dilakukan untuk merelokasi pedagang Klithikan yang berasal dari jalan Mangkubumi, jalan Asem Gede, dan Alun-alun Kidul.</p>\r\n\r\n<p>Pasar Klithikan Pakuncen diresmikan pada tanggal 11 November 2007 oleh Menteri UKM dan Koperasi, Bapak Surya Dharma Ali. Sejak direlokasi, penampilan pasar Klithikan telah mengalami perubahan yang drastis. Para pedagang kini dapat menempati bangunan pasar yang memadai, dilengkapi dengan fasilitas yang memadai, dan memiliki status hukum yang jelas. Sebelumnya, mereka hanya menggelar dagangan di pinggir jalan tanpa pengaturan yang jelas.</p>\r\n\r\n<p>Pasar Klithikan memiliki luas tanah sebesar 8.000 m2 dengan luas bangunan mencapai 6.382 m2. Terdapat 720 pedagang los dan 21 pedagang kios di pasar ini. Pasar Klithikan buka setiap hari mulai pukul 10.00 hingga 22.00 WIB.</p>\r\n\r\n<p>Pasar ini menyediakan berbagai macam barang, baik baru maupun bekas. Awalnya, pasar Klithikan lebih dikenal sebagai tempat menjual barang-barang bekas dan kuno. Namun, kini pasar ini juga menyediakan barang-barang baru seperti barang Klithikan, onderdil dan sparepart kendaraan, sepatu, konveksi, helm, aneka jenis botol, pusat handphone (konter hp), dan alat-alat hobi.</p>\r\n\r\n<p>Pasar Klithikan Pakuncen juga dilengkapi dengan berbagai fasilitas umum, seperti tempat ibadah, tempat parkir, toilet, kantor pengelola, tempat layanan kesehatan, dan ATM.</p>\r\n\r\n<p>Untuk menuju ke pasar Klithikan Yogyakarta, Anda dapat mengikuti petunjuk berikut. Dari titik Nol Malioboro, arahkan kendaraan ke arah barat dan terus lurus melewati jalan KH. Ahmad Dahlan. Setelah melewati perempatan lampu merah, lanjutkan perjalanan lurus melewati jalan RE Marthadinata hingga mencapai perempatan Wirobrajan. Belok ke utara dan setelah sekitar 700 meter, Anda akan menemukan pasar Klithikan di sebelah kanan jalan.</p>\r\n\r\n<p>Pasar Klithikan Pakuncen Yogyakarta juga memiliki galeri yang menampilkan berbagai foto dan gambar. Namun, gambar-gambar tersebut tidak dapat ditampilkan dalam data yang diberikan.</p>\r\n</body>\r\n</html>\r\n', '', 'Klithikan Pakuncen Market', '', 'Menjadi pasar klithikan terbesar di Yogyakarta, Pasar Pakuncen terletak di Jalan HOS Cokroaminoto Nomor 34 Pakuncen, Wirobrajan, Yogyakarta. Di dalam pasar antik ini terdapat aneka barang bekas maupun antik yang dijual dengan harga terjangkau. Mulai dari barang elektronik, onderdil kendaraan hingga koin dan perangko. Sebelum dijadikan satu di Pasar Pakuncen, para pedagang pasar ini berjualan di beberapa titik di Kota Jogja. Hingga akhirnya pasar ini diresmikan pada tanggal 11 November 2017 dan kini menjadi salah satu destinasi wisata belanja barang bekas maupun antik di Yogyakarta.', '', 1, 'location', '', 'Jl. HOS Cokroaminoto No.34, Pakuncen, Wirobrajan, Yogyakarta City, Special Region of Yogyakarta 5525', '-7.7973552999999995', '110.35349959999999', 'Klithikan Pakuncen Market', '', 'Klithikan Pakuncen Market', 0, 0, '01:00:00', 3600, 4.3, 'D.I. Yogyakarta', 0, 0, 0),
(62, 'borobudur-temple-1', 1000, '2023-02-10 22:19:15', '2023-10-12 10:09:38', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Candi Borobudur&nbsp;adalah sebuah&nbsp;candi&nbsp;Buddha&nbsp;yang terletak di&nbsp;Borobudur,&nbsp;Magelang,&nbsp;Jawa Tengah,&nbsp;Indonesia. Candi ini terletak kurang lebih 100&nbsp;km di sebelah barat daya&nbsp;Semarang, 86&nbsp;km di sebelah barat&nbsp;Surakarta, dan 40&nbsp;km di sebelah barat laut&nbsp;Yogyakarta. Candi dengan banyak&nbsp;stupa&nbsp;ini didirikan oleh para penganut&nbsp;agama&nbsp;Buddha Mahayana&nbsp;sekitar tahun 800-an Masehi pada masa pemerintahan&nbsp;wangsa&nbsp;Syailendra. Borobudur adalah candi atau kuil Buddha terbesar di dunia,&nbsp;sekaligus salah satu monumen Buddha terbesar di dunia.</p>\r\n\r\n<p style=\"text-align: justify;\">Monumen ini terdiri atas enam teras berbentuk bujur sangkar yang di atasnya terdapat tiga pelataran melingkar, pada dindingnya dihiasi dengan 2.672 panel&nbsp;relief&nbsp;dan aslinya terdapat 504&nbsp;arca Buddha.&nbsp;Borobudur memiliki koleksi relief Buddha terlengkap dan terbanyak di dunia.&nbsp;Stupa utama terbesar teletak di tengah sekaligus memahkotai bangunan ini, dikelilingi oleh tiga barisan melingkar 72 stupa berlubang yang di dalamnya terdapat arca Buddha tengah duduk bersila dalam posisi teratai sempurna dengan&nbsp;mudra&nbsp;(sikap tangan)&nbsp;Dharmachakra mudra&nbsp;(memutar roda dharma).</p>\r\n\r\n<p style=\"text-align: justify;\">Monumen ini merupakan model alam semesta dan dibangun sebagai tempat suci untuk memuliakan&nbsp;Buddha&nbsp;sekaligus berfungsi sebagai tempat&nbsp;ziarah&nbsp;untuk menuntun umat manusia beralih dari alam nafsu duniawi menuju pencerahan dan kebijaksanaan sesuai ajaran Buddha.&nbsp;Para peziarah masuk melalui sisi timur dan memulai ritual di dasar candi dengan berjalan melingkari bangunan suci ini searah jarum jam, sambil terus naik ke undakan berikutnya melalui tiga tingkatan ranah dalam kosmologi Buddha. Ketiga tingkatan itu adalah&nbsp;Kamadhatu&nbsp;(ranah hawa nafsu),&nbsp;Rupadhatu&nbsp;(ranah berwujud), dan&nbsp;Arupadhatu&nbsp;(ranah tak berwujud). Dalam perjalanannya para peziarah berjalan melalui serangkaian lorong dan tangga dengan menyaksikan tak kurang dari 1.460 panel relief indah yang terukir pada dinding dan pagar langkan.</p>\r\n\r\n<p style=\"text-align: justify;\">Menurut bukti-bukti sejarah, Borobudur ditinggalkan pada abad ke-10 seiring dipindahnya pusat Kerajaan Mataram Kuno ke Jawa Timur oleh Pu Sindok.&nbsp;Dunia mulai menyadari keberadaan bangunan ini sejak ditemukan 1814 oleh&nbsp;Sir Thomas Stamford Raffles, yang saat itu menjabat sebagai Gubernur Jenderal Inggris atas Jawa. Sejak saat itu Borobudur telah mengalami serangkaian upaya penyelamatan dan pemugaran (perbaikan kembali). Proyek pemugaran terbesar digelar pada kurun waktu 1975 hingga 1982 atas upaya&nbsp;Pemerintah Republik Indonesia&nbsp;dan&nbsp;UNESCO, kemudian situs bersejarah ini masuk dalam daftar&nbsp;Situs Warisan Dunia.</p>\r\n\r\n<p style=\"text-align: justify;\">Borobudur kini masih digunakan sebagai tempat ziarah&nbsp;keagamaan; tiap tahun&nbsp;umat Buddha&nbsp;yang datang dari seluruh Indonesia dan mancanegara berkumpul di Borobudur untuk memperingati Trisuci&nbsp;Waisak. Terkait kepariwisataan, Borobudur adalah objek wisata tunggal di Indonesia yang paling banyak dikunjungi wisatawan.</p>\r\n\r\n<p style=\"text-align: justify;\">Pada 11 Februari 2022, pemerintah meresmikan status Candi Borobudur kembali sebagai tempat peribadatan umat Buddhis di Indonesia dan dunia.</p>\r\n</body>\r\n</html>\r\n', '', 'Borobudur Temple', '', 'Candi Borobudur adalah sebuah candi Buddha yang terletak di Borobudur, Magelang, Jawa Tengah, Indonesia. Candi ini terletak kurang lebih 100 km di sebelah barat daya Semarang, 86 km di sebelah barat Surakarta, dan 40 km di sebelah barat laut Yogyakarta. Candi dengan banyak stupa ini didirikan oleh para penganut agama Buddha Mahayana sekitar tahun 800-an Masehi pada masa pemerintahan wangsa Syailendra. Borobudur adalah candi atau kuil Buddha terbesar di dunia, sekaligus salah satu monumen Buddha terbesar di dunia.', '', 1, 'location', 'cdn/2023/10/candi-borobudur.jpg', 'Jl. Badrawati, Kw. Candi Borobudur, Borobudur, Magelang Regency, Central Java, Indonesia', '-7.607873799999999', '110.2037513', 'Borobudur Temple', 'Borobudur Temple', 'Borobudur Temple', 1, 50000, '01:00:00', 3600, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(63, 'taman-budaya-yogyakarta-1', 1000, '2023-02-10 22:19:15', '2023-10-09 18:40:34', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pusat kebudayaan merupakan representasi keberadaan seniman di suatu kota. Di Yogyakarta, terdapat pusat kebudayaan yang bernama Taman Budaya Yogyakarta. Berlokasi tidak jauh dari Pasar Beringharjo, tepatnya di Jalan Sriwedani, Taman Budaya Yogyakarta selalu diramaikan oleh berbagai kegiatan para seniman Yogyakarta. Berdasarkan sejarahnya, Taman Budaya Yogyakarta pertama kali dibangun di sekitar Kawasan Universitas Gadja Mada, Bulaksumur pada 11 Maret 1977. Kemudian diresmikan oleh Sri Sultan Hamengkubuwono IX yang saat itu menjabat sebagai Wakil Presiden Republik Indonesia. Saat itu, Taman Budaya Yogyakarta masih menggunakan nama Purna Budaya. Dahulu tempat ini didedikasikan untuk membina, memelihara, dan mengembangkan kebudayaan, serta sebagai pusat kesenian masarakat Yogyakarta.</p>\r\n\r\n<p>Pada tahun 2002 Taman Budaya Yogyakarta memasuki babak baru. Berdasarkan kesepakatan beberapa pihak terkait, akhirnya Taman Budaya Yogyakarta dibangun lagi di sekitar kawasan Benteng Vredeburg. Saat itulah Taman Budaya Yogyakarta memperkaya visi dan misinya sebagai kantung kebudayaan dan menjadi salah satu laboratorium seni di Indonesia.</p>\r\n\r\n<p>TBY memiliki dua bangunan utama yaitu Concert Hall Taman Budaya dan Societet Militair. Gedung Concert Hall berfungsi sebagai tempat diskusi sastra, penyelenggaraan pameran, dan pelatihan. Gedung Societet Militair berfungsi sebagai pentas teater, tari, musik, dan berbagai pertunjukan seni lainnya. Gedung Societet Militair memiliki ruang pertunjukan dengan kapasitas 500 penonton, panggung pertunjukan, peralatan tata cahaya, dan sarana publikasi untuk luar ruang.Terdapat pula fasilitas pelengkap lain seperti perpustakaan, mushola, toilet, kafe, dan tempat parkir. Kegiatan yang ada di TBY banyak berkaitan dengan aktivitas seni, seperti pameran seni rupa, pementasan teater, diskusi sastra, pembacaan puisi, dan festival kesenian.Kegiatan yang secara rutin diadakan seperti Festival Kesenian Yogyakarta (FKY) yang diadakan antara bulan Juli &ndash; Agustus, yang berisi acara seni pertunjukan, seni rupa, dan workshop seni.Selain itu juga ada Biennale Jogja tiap dua tahun sekali, dan Festival Gamelan Internasional.</p>\r\n</body>\r\n</html>\r\n', '', 'Taman Budaya Yogyakarta', '', 'Taman Budaya Yogyakarta adalah sarana wisata yang terletak di Jalan Sriwedani no. 1, Kelurahan Ngupasan, Kemantrén Gondonaman, Kota Yogyakarta. TBY memiliki kompleks gedung yang berfungsi sebagai tempat pameran, pertunjukan, dan berbagai kegiatan seni lainnya.', '', 1, 'location', 'cdn/2023/10/taman-budaya-yogyakarta.jpg', 'Jl. Sriwedani No.1, Ngupasan, Kec. Gondomanan, Kota Yogyakarta, Daerah Istimewa Yogyakarta 55122, In', '-7.8001040999999995', '110.3676579', 'Taman Budaya Yogyakarta', '', 'Taman Budaya Yogyakarta', 1, 0, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(64, 'bukit-rhema-gereja-ayam-1', 1000, '2023-02-10 22:19:15', '2023-10-12 10:48:37', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Bukit Rhema atau yang dikenal dengan nama Gereja Ayam Magelang dibangun pada tahun 1992 oleh&nbsp;Daniel Alamsjah.&nbsp;Daniel Alamsjah&nbsp;menerima visi pada tahun 1988 untuk membangun Rumah Doa bagi Segala Bangsa setelah doa semalam di tempat di mana Bukit Rhema dibangun. Daniel muda pada awalnya tidak tahu bahwa tempat ini ada di Desa Gombong Kembanglimus, Magelang, Jawa Tengah. Terletak di sudut kota Borobudur. Meskipun tempat ini jauh dari tempat di mana daniel hidup pada waktu itu yaitu Jakarta, imannya memimpin Daniel muda tiba di tempat ini dan kemudian Daniel Alamsjah menerima visi tersebut.</p>\r\n\r\n<p>Bukit Rhema terus berkembang menjadi wisata religi, wisata edukasi dan wisata alam di Magelang.</p>\r\n\r\n<ul>\r\n	<li><strong>Wisata Religi</strong><br />\r\n	Bukit Rhema sebagai Rumah Doa Segala Bangsa memiliki fungsi sebagai tempat bagi umat yang ingin berdoa secara khusus dengan fasilitas ruang-ruang doa pribadi.</li>\r\n	<li><strong>Wisata Edukasi</strong><br />\r\n	Bukit Rhema memiliki fungsi edukasi. Edukasi tentang bahaya narkoba, bahaya merokok dan edukasi tentang Nasionalisme yang dituangkan melalui lukisan dinding yang menarik.</li>\r\n	<li><strong>Wisata Alam</strong><br />\r\n	Bukit Rhema yang dikenal dengan Gereja Ayam berdiri di atas perbukitan dan dikelilingi dengan pegunungan sehingga memiliki pemandangan yang indah. Tak Heran Bukit Rhema menjadi salah satu spot melihat sunrise terindah di Magelang.</li>\r\n</ul>\r\n\r\n<p>Selain itu Bukit Rhema (Gereja Ayam) juga menjadi salah satu penggerak desa wisata Borobudur dan ekonomi kerakyatan melalui bundling tiket masuk Bukit Rhema dengan Singkong Desa (Latela Gombong Cassava). Latela Gombong Cassava merupakan singkong yang dihasilkan dan diproses warga sekitar Bukit Rhema (Gereja Ayam).</p>\r\n</body>\r\n</html>\r\n', '', 'Bukit Rhema Gereja Ayam', '', 'Bukit Rhema atau yang dikenal Gereja Ayam merupakan tempat wisata religi di Magelang yang bangunannya belum rampung dikerjakan, melainkan baru mencapai 70% pengerjaan. Meski belum rampung pembangunannya, Bukit Rhema sudah ramai dikunjungi wisatawan dalam negeri maupun manca negara. Bukit Rhema dikenal juga sebagai spot terbaik untuk melihat matahari terbit atau sunrise. Bukit Rhema berdiri di atas perbukitan Menoreh, Bukit Rhema dikeliling oleh beberapa gunung, di antaranya adalah Gunung Sumbing, Merbabu, Suroloyo, Merapi, serta Sumbing.', '', 1, 'location', 'cdn/2023/10/malaikat-bukit-rhema.jpg', 'Karangrejo Gombong, Kurahan, Kembanglimus, Kec. Borobudur, Kabupaten Magelang, Jawa Tengah 56553, In', '-7.6057093', '110.18048399999999', 'Bukit Rhema Gereja Ayam', 'Bukit Rhema Gereja Ayam', 'Bukit Rhema Gereja Ayam', 1, 25000, '01:00:00', 3600, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(65, 'pantai-krakal-1', 1000, '2023-02-10 22:19:15', '2023-10-08 22:58:25', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Apabila anda beruntung ketika berkunjung ke wisata pantai Krakal, maka anda akan disuguhkan dengan berbagai atraksi hiburan yang biasanya digelar di panggung terbuka.</p>\r\n\r\n<p>Pantai Krakal &nbsp;memiliki dua batu hitam yang menjulang tinggi keatas sebagai pembatas dengan pantai lain. Pada kedua batu tersebut memiliki permukaan sangat subur maka tidak heran apabila pada permukaan dua batu ditumbuhi oleh bermacam tumbuhan laut. Diantara kedua karang besar tersebut wisatawan dapat menikmati panorama alam pantai dengan mengunjungi gazebo yang telah disediakan oleh pengelolah wisata.<br />\r\nMenikmati salah satu tempat wisata Gunung Kidul krakal beach tidak akan lengkap apabila anda tidak bermalam di lokasi wisata. Apabila anda ingin bermalam di objek wisata Krakal, telah disediakan fasilitas umum hotel melati dengan harga terjangkau. Wisatawan pun mudah untuk mendapatkan makan seafood, disana terdapat rumah makan yang khusus menjual menu masakan laut.</p>\r\n\r\n<p>Seperti halnya wisata pantai lain, pantai Krakal Gunung Kidul memberikan berbagai panorama alam yang dapat mendamaikan hati dan pikiran. Ketika perjalanan menuju objek wisata, para wisatawan akan disugguhkan berbagai pemandangan bukit kapur serta bongkahan batu karang menjadi pemandangan nan indah. Bebatuan di sepanjang perjalanan kiri dan kanan jalan menuju objek wisata ini lah disebut dengan daerah Karst.</p>\r\n</body>\r\n</html>\r\n', '', 'Pantai Krakal', '', 'Lokasinya sekitar 37 kilometer arah selatan kota Wonosari. Pantai Krakal merupakan objek wisata pantai yang memiliki luas serta paling panjang bila dibandingkan dengan pantai Gunung Kidul lainnya. Tidak jauh dari pantai Krakal Yogyakarta terdapat destinasi wisata pantai Drini, berjarak 2 kilometer disebelah timur. Salah satu tempat wisata Gunung Kidul ini masih satu jalur dengan wisata pantai Baron Jogja dan pantai Kukup.', '', 1, 'location', 'cdn/2023/10/pantai-krakal4-768x576.jpg', 'VH3X+XG3, Rejosari, Kemadang, Kec. Tanjungsari, Kabupaten Gunung Kidul, Daerah Istimewa Yogyakarta 5', '-8.145102399999999', '110.59880059999999', 'Pantai Krakal', '', 'Pantai Krakal', 0, 10000, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(66, 'jogja-city-mall', 1000, '2023-02-10 22:19:15', '2023-10-09 01:20:04', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>&nbsp;</p>\r\n\r\n<p><meta charset=\"utf-8\" /></p>\r\n\r\n<p dir=\"ltr\">Jogja City Mall atau JCM berdiri sejak 2014 dan terdiri dari 7 lantai. Pemilik dari JCM adalah Darwin Pratama. Mall ini dirancang dengan arsitektur tampak luar seperti bangunan Romawi. Sementara itu bagian dalamnya didesain khas budaya Jawa. Yang paling mencerminkan desain budaya Jawa adalah railing-railingnya yang khas Keraton Yogyakarta.<br />\r\n<br />\r\nSudah dua kali JCM bangkit dari keterpurukan karena mengalami musibah kebakaran. Musibah pertama dialami pada 30 Oktober 2014 dan kebakaran yang kedua terjadi pada 27 September 2017. Kedua musibah itu tidak menyurutkan semangat pengelola mall untuk terus berbenah meningkatkan keamanan dan kenyamanan bagi pengunjung. Sehingga bisa populer seperti tempat wisata Jogja yang murah lainnya.<br />\r\n<br />\r\n<strong>Rute Menuju Lokasi Jogja City Mall</strong><br />\r\nAlamat lengkap Jogja City Mall adalah Jalan Magelang Kilometer 6, Nomor 18, Sinduadi, Kabupaten Sleman, Provinsi Daerah Istimewa Yogyakarta. Banyak rute &nbsp;yang bisa ditempuh untuk mencapai lokasi yang strategis ini.<br />\r\nDi sepanjang Jalan Magelang ada banyak hotel bintang tiga dan tempat hiburan yang saling berjejeran. Jadi tak ada salahnya untuk menyewa kamar di hotel yang ada di sana.<br />\r\nBila beramai-ramai, Anda pun bisa menggunakan kendaraan roda empat baik milik pribadi maupun milik rental mobil.<br />\r\n<br />\r\n<strong>Belanja Aneka Brand Fashion Ternama</strong><br />\r\nSeperti mall pada umumnya, Jogja City Mall pun kebanjiran tenant fashion di gedungnya. Bermacam-macam merek fashion terkenal hadir di pusat perbelanjaan ini.<br />\r\n<br />\r\nBeberapa merek besar di antaranya adalah 3 Second, Wrangler, Le Coq Sportif, Erigo, The Executive, Nobby dan masih banyak yang lainnya. Semua outlet fashion tersebar di hampir seluruh lantai JCM.<br />\r\n<br />\r\nJangan bandingkan kehangatan suasana belanja di pasar tradisional Jogja dengan belanja fashion di JCM. Kedua hal tersebut tentu memiliki keunikan masing-masing.<br />\r\n<br />\r\nTapi tetap ada hal yang mengaitkan JCM dengan budaya Jogja. Salah satunya tentu saja hadirnya salah satu outlet batik di mall ini. Bahkan baru-baru ini JCM mengadakan event fashion batik yang meriah.<br />\r\n<br />\r\n<strong>Fasilitas di Jogja City Mall</strong><br />\r\nJogja City Mall dengan ketujuh lantainya tentu menyediakan berbagai macam fasilitas pendukung. Berikut ini beberapa fasilitas yang ada di dalam:</p>\r\n\r\n<ul dir=\"ltr\">\r\n	<li>Tempat parkir</li>\r\n	<li>Mushola</li>\r\n	<li>Gereja</li>\r\n	<li>Ballroom</li>\r\n	<li>Toilet</li>\r\n	<li>Toilet disabilitas</li>\r\n	<li>ATM center</li>\r\n	<li>Restoran</li>\r\n	<li>Bioskop</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\">JCM telah hadir 8 tahun untuk menemani warga Sleman khususnya dan seluruh Jogja. JCM memberikan alternatif makan dan belanja yang cepat serta rekreasi yang singkat di tengah jadwal kota yang padat.</p>\r\n</body>\r\n</html>\r\n', '', 'Jogja City Mall', '', 'Jogja City Mall atau biasa disingkat JCM merupakan sebuah pusat perbelanjaan yang berada dalam satu kawasan dengan The Rich Hotel Yogyakarta. Pusat perbelanjaan ini berlokasi di Jalan Magelang Km. 6 No.18, Sinduadi, Kabupaten Sleman, Daerah Istimewa Yogyakarta. JCM memiliki keunikan dibandingkan dengan mal yang lain. JCM dirancang dengan arsitektur Romawi dengan bangunan fasade dengan pilar-pilar tinggi khas arsitektur Romawi. Lalu ciri khas lainnya dengan interior budaya Jawa yakni tegel-tegel kunci dan railing khas Keraton Yogyakarta.', '', 1, 'location', '', 'Magelang St 18 No.6, Kutu Patran, Sinduadi, Mlati, Sleman Regency, Special Region of Yogyakarta 5528', '-7.7532423999999995', '110.3609091', 'Jogja City Mall', '', 'Jogja City Mall', 1, 0, '01:00:00', 3600, 4.5, 'D.I. Yogyakarta', 0, 0, 0);
