(67, 'de-mata-trick-eye-museum-1', 1000, '2023-02-10 22:19:15', '2023-10-12 11:13:18', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pengunjung dapat merasakan sensasi tiga dimensi dengan berbagai pose dan latar belakang yang mengagumkan karena seperti nyata di De Mata Trick Eye Museum, . Disebut terbesar di dunia karena di XT Square Yogyakarta terdapat 120 gambar tiga dimensi, sedangkan di luar negeri paling banyak hanya 70 gambar.</p>\r\n\r\n<p>Kehadiran De Mata Trick Eye Museum di XT Square, merupakan sesuatu yang baru, unik dan spektakuler, karena wahana wisata museum ini merupakan satu-satunya yang pertama di Yogyakarta bahkan di Jawa Tengah. Unik karena menghadirkan beraneka gambar mulai dari tema alam, olahraga, tokoh, binatang, super hero, roman, sirkus, ornamen, termasuk obyek wisata Tamansari dan Pagelaran Kraton Yogyakarta.</p>\r\n\r\n<p>Menempati areal basement Jogja XT Square, penempatan gambar-gambar tiga dimensi ini pun dikonsep menggunakan model labirin sehingga tidak membuat jenuh para pengunjung museum ini. Sebagian besar karya merupakan kreasi Petrus Kusuma sendiri dan sebagian lain karya mahasiswa seni rupa ISI Yogyakarta.</p>\r\n\r\n<p>Menjelang Libur Idul Fitri 2017, Museum De MATA De ARCA membuka satu wahana baru bertajuk DWalik. Pengelola DWalik menyiapkan hampir 30 wahana di dalamnya. Tetap mengusung konsep&nbsp;<em>Illusions Room</em>. Sebagai Museum rumah terbalik terbesar dengan koleksi terbanyak di Indonesia, DWalik siap memberikan warna yang berbeda.</p>\r\n\r\n<p>Salah satu wahana yang ada di DWalik,<em>&nbsp;Horror Room</em>, dengan mengusung tema ruangan mengerikan dan penuh darah, sensasi berfoto di&nbsp;<em>Horror Room</em>&nbsp;pasti tidak akan bisa dilupakan. Lengkap dengan properti tengkorak berdarah dan penuh dengan rayap, memberikan kesan yang sangat mengerikan.</p>\r\n\r\n<p>Tidak hanya&nbsp;<em>Horror Room</em>, ada juga ruangan&nbsp;<em>Anti-Gravity</em>, Ruangan Disko diatur sedemikian rupa sehingga memberikan kesan berbeda bagi para pengunjung yang berfoto. Berbeda pula ruangan Barber, mengusung tema ruangan 90, ruangan ini siap memberikan sensasi yang berbeda bagi para pengunjung. Ruang angkringan, lengkap dengan gerobak dan bungkusan nasi kucing dan anglo layak dicoba. Pengunjung bisa berinteraksi dengan property yang ada di setiap ruangan, bergaya suka-suka dan berekspresi.</p>\r\n\r\n<p>DWalik juga dilengkapi dengan fasilitas De MATA Studio dengan teknologi&nbsp;<em>greenscreen.&nbsp;</em>Berbeda dengan&nbsp;<em>greenscreen&nbsp;</em>yang ada di Wahana De MATA 2, De MATA Studio kali ini mengangkat tema yang cukup&nbsp;<em>anti-mainstream</em>&nbsp;dengan menawarkan&nbsp;<em>editing&nbsp;</em>yang lebih menarik. Ada juga paket foto bagi pengunjung yang menginginkan berfoto dengan photographer professional.</p>\r\n\r\n<p>Tidak hanya Pembukaan wahana baru, di wahana De ARCA, ada penambahan delapan patung baru. Avatar Jack &amp; Neytiri, dengan tinggi hampir 3 meter siap berfoto dengan pengunjung. Didukung dengan 3D Artworks&nbsp;<em>khas&nbsp;</em>De MATA tentunya semakin mendukung latar berfoto. Tokoh Star Wars, Darth Varder juga kini siap diajak berselfie bersama. Tidak mau ketinggalan, Wolverine dengan tangan pisaunya juga ada di De ARCA Museum.</p>\r\n\r\n<p>Ada juga yang baru di De ARCA, Aplikasi AR De ARCA turut diluncurkan. AR De ARCA memberikan informasi kepada pengunjung mengenai patung-patung yang ada di De ARCA. Aplikasi AR dapat diunduh secara gratis di Play Store.</p>\r\n\r\n<p>Untuk harga tiket, pengunjung cukup merogoh kocek Rp. 120.000,- pada Senin-Jumat dan Rp. 140.000,- pada Sabtu, Minggu, Hari Libur. Tenang saja, pada Senin-Jumat, sebelum jam 3 sore, pengunjung bisa menikmati promo&nbsp;<em>happy hour&nbsp;</em>dengan harga Rp. 100.000,-. Pengunjung sudah bisa menikmati keempat wahana yang ada.</p>\r\n</body>\r\n</html>\r\n', '', 'De Mata Trick Eye Museum', '', 'De Mata Trick Eye Museum menyajikan pengalaman bagi pengunjung untuk merasakan sensasi tiga dimensi dengan berbagai pose dan latar belakang yang mengagumkan karena seperti nyata. Kehadiran De Mata Trick Eye Museum di XT Square, merupakan sesuatu yang baru, unik dan spektakuler, karena wahana wisata museum ini merupakan satu-satunya yang pertama di Yogyakarta bahkan di Jawa Tengah. Unik karena menghadirkan beraneka gambar mulai dari tema alam, olahraga, tokoh, binatang, super hero, roman, sirkus, ornamen, termasuk obyek wisata Tamansari dan Pagelaran Kraton Yogyakarta.', '', 1, 'location', 'cdn/2023/10/de-mata.jpg', 'XT Square, Jl. Veteran No.150-151, Pandeyan, Kec. Umbulharjo, Kota Yogyakarta, Daerah Istimewa Yogya', '-7.816315599999999', '110.3871442', 'De Mata Trick Eye Museum', 'De Mata Trick Eye Museum', 'De Mata Trick Eye Museum', 0, 30000, '01:00:00', 3600, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
(68, 'taman-sari-1', 1000, '2023-02-10 22:19:15', '2023-10-09 18:50:19', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Masa setelah Perjanjian Giyanti, Pangeran Mangkubumi membangun keraton sebagai pusat pemerintahan Kasultanan Ngayogyakarta Hadiningrat. Pangeran Mangkubumi yang kemudian bergelar Sultan Hamengku Buwono I membangun keraton di tengah sumbu imajiner yang membentang di antara Gunung Merapi dan Pantai Parangtritis. Titik yang menjadi acuan pembangunan keraton adalah sebuah umbul (mata air). Untuk menghormati jasa istri-istri Sultan karena telah membantu selama masa peperangan, beliau memerintahkan Demak Tegis seorang arsitek berkebangsaan Portugis dan Bupati Madiun sebagai mandor untuk membangun sebuah istana di umbul yang terletak 500 meter selatan keraton. Istana yang dikelilingi segaran (danau buatan) dengan wewangian dari bunga-bunga yang sengaja ditanam di pulau buatan di sekitarnya itu sekarang dikenal dengan nama Taman Sari. Dari atas Gapura Panggung ini Sultan biasa menyaksikan tari-tarian di bawah sana. Bangunan-bangunan di sampingnya merupakan tempat para penabuh dan di tengah-tengah biasa didirikan panggung tempat para penari menunjukkan kepiawaian dan keluwesan mereka,&quot; terang seorang pemandu ketika memasuki Taman Sari. Dari Gapura Panggung, pemandu membawa masuk ke area yang dulunya hanya diperbolehkan untuk Sultan dan keluarganya, kolam pemandian Taman Sari. Gemericik air langsung menyapa. Airnya yang jernih berpadu apik dengan tembok-tembok krem gagah yang mengitarinya. Kolam pemandian di area ini dibagi menjadi tiga yaitu Umbul Kawitan (kolam untuk putra-putri Raja), Umbul Pamuncar (kolam untuk para selir), dan Umbul Panguras (kolam untuk Raja).</p>\r\n\r\n<p>Sebuah periuk tempat istri-istri Sultan bercermin masih utuh berdiri ketika memasuki menara tempat pribadi Sultan. Ornamen yang menghiasi periuk memberi kesan glamor terhadap benda yang terletak di samping lemari pakaian Sultan tersebut. Bisa dibayangkan, 200 tahun lalu seorang wanita cantik menunggu air di periuk ini hingga tenang lalu dia menundukkan kepalanya, memperbaiki riasan dan sanggulnya, memperindah raganya sembari bercermin. Selain periuk dan kamar pribadi Sultan, di menara yang terdiri dari tiga tingkat ini ada tangga dari kayu jati yang masih utuh terawat sehingga memberi kesan antik bagi siapa pun yang melihatnya. Naik ke tingkat paling atas, pantulan mentari dari kolam di bawahnya dan seluruh area Taman Sari terlihat dengan jelas. Mungkin dahulu Sultan juga menikmati pemandangan dari atas sini, pemandangan Taman Sari yang masih lengkap dengan danau buatannya dan bunga-bunga yang semerbak mewangi.</p>\r\n</body>\r\n</html>\r\n', '', 'Taman Sari', '', 'Gemercik air, keindahan arsitekturnya yang kuno, dan pemandangan yang menakjubkan membuat Taman Sari sangat mempesona. Lorong-lorong dan bangunannya menjadikan Taman Sari penuh rahasia yang akan terus dikuak.Taman Sari Yogyakarta atau Taman Sari Keraton Yogyakarta adalah situs bekas taman atau kebun istana Keraton Ngayogyakarta Hadiningrat, yang dapat dibandingkan dengan Taman Sari Surakarta dan Kebun Raya Bogor sebagai kebun Istana Bogor. Kebun ini dibangun pada zaman Sultan Hamengku Buwono I pada tahun 1758-1765/9.', '', 1, 'location', 'cdn/2023/10/taman-sari.jpg', 'Patehan, Kraton, Yogyakarta City, Special Region of Yogyakarta 55133, Indonesia', '-7.8100673', '110.3594581', 'Taman Sari', '', 'Taman Sari', 0, 5000, '01:30:00', 5400, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(69, 'the-palace-of-yogyakarta-1', 1000, '2023-02-10 22:19:15', '2023-10-09 18:54:27', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Selain kawasan ndalem kraton, kawasan kraton juga memiliki pontensi situs, bangunan dan tempat bersejarah yang memeliki keunikan pada setiap bangunanya. Beberapa diantaranya adalah Tamansari, dan Museum Sonobudoyo, benteng dan kelengkapannya.</p>\r\n</body>\r\n</html>\r\n', '', 'The Palace of Yogyakarta', '', 'Selain kawasan ndalem kraton, kawasan kraton juga memiliki pontensi situs, bangunan dan tempat bersejarah yang memeliki keunikan pada setiap bangunanya. Beberapa diantaranya adalah Tamansari, dan Museum Sonobudoyo, benteng dan kelengkapannya.', '', 1, 'location', 'cdn/2023/10/the-palace-of-yogyakarta.jpg', 'Jl. Rotowijayan Blok No. 1, Panembahan, Kraton, Yogyakarta City, Special Region of Yogyakarta, Indon', '-7.8052845', '110.3642031', 'The Palace of Yogyakarta', '', 'The Palace of Yogyakarta', 0, 8000, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(70, 'taman-pintar-yogyakarta-1', 1000, '2023-02-10 22:19:15', '2023-10-09 18:49:04', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>egitu memasuki pintu gerbang, kita langsung disambut oleh area yang disebut sebagai Playground Arena. Jalan masuk dari pintu gerbang terpecah menjadi 2 oleh sebuah koridor yang terdiri atas 3 tiang berbentuk segitiga di masing-masing sisinya. Air akan menyembur dari masing-masing tiang tersebut hingga membentuk sebuah koridor air. Namun sayang, koridor ini hanya dioperasikan pada saat-saat tertentu saja. Di ujung koridor ada sebuah gong bertuliskan &quot;Gong perdamaian Nusantara (sarana persaudaraan dan pemersatu bangsa)&quot;. Di sekeliling gong tersebut nampak logo dari semua propinsi dan kabupaten yang ada di Negara Kesatuan Republik Indonesia.</p>\r\n\r\n<p>Berbagai permainan menarik dan mendidik dengan nama menggelitik terdapat di Playground Arena ini. Selain Koridor Air, ada Parabola Berbisik, Dinding Berdendang, Pipa Bercerita, Cakram Spektrum Warna, Air Menari, Forum batu, Tapak pintar, Desaku Permai, Sistem Katrol, Rumah pohon, Jembatan Goyang, Jungkat-jungkit, dan Istana Pasir.</p>\r\n</body>\r\n</html>\r\n', '', 'Taman Pintar Yogyakarta', '', 'Taman Pintar adalah tempat rekreasi edukasi yang keren dan seru di Jogja. Harga tiket masuknya terjangkau. Wahananya ada planetarium, wahana bahari, zona pengolahan sampah, science theater, playground, perpustakaan, kampung kerajinan, gedung oval, dll.', '', 1, 'location', 'cdn/2023/10/taman-pintar.jpg', 'Jl. Panembahan Senopati No.1-3, Ngupasan, Gondomanan, Yogyakarta City, Special Region of Yogyakarta ', '-7.8006715', '110.3676551', 'Taman Pintar Yogyakarta', '', 'Taman Pintar Yogyakarta', 0, 20000, '02:30:00', 9000, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(71, 'hutan-pinus-pengger', 1000, '2023-02-10 22:19:15', '2023-10-09 01:15:23', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hutan Pinus Pengger merupakan salah satu objek wisata andalan Kabupaten Bantul. Hutan Pinus ini sangat digemari oleh para pencipta objek wisata, karena objek wisata ini menyuguhkan pemandangan alam yang sangat indah. Hutan Pinus Pengger merupakan efek positif atas keberhasilan pendahulunya yaitu Hutan Pinus Asri yang juga berada dalam satu kawasan di daerah Dlingo, Bantul, Yogyakarta. Kreativitas masyarakat sekitar mengembangkan Hutan Pinus Pengger menjadi destinasi wisata pun berbuah manis, pengelola menyadari harus terdapat pembeda antara hutan pinus satu dengan lainnya agar menjadi daya tarik tersendiri bagi wisatawan. Pembeda tersebut adalah dipasangnya berbagai instalasi seni beragam bentuk yang dibuat menggunakan ranting pohon yang sudah kering.<br />\r\n<br />\r\nSelain itu, yang paling ikonik adalah instalasi seni berupa tangan raksasa berlatarkan pemandangan indah panorama Kota Yogyakarta yang sekaligus menjadi spot untuk berfoto bagi wisatawan yang berkunjung di Hutan Pinus Pengger. Tidak hanya instalasi seni berupa tangan raksasa saja yang menghiasi Hutan Pinus Pengger melainkan terdapat beberapa instalasi seni serupa namun dengan bentuk yang berbeda seperti sapu raksasa, sangkar burung, dan ada yang berbentuk setengah lingkaran menyerupai gapura. Dalam setiap instalasi seni tersebut memiliki makna yang berbeda-beda sesuai dengan bentuk masing-masing yang diberikan oleh sang seniman yang menjadi daya tarik tersendiri bagi wisatawan di Hutan Pinus Pengger.<br />\r\n<br />\r\n<strong>Tiket Masuk Hutan Pinus Pengger</strong><br />\r\nTiket masuk Hutan Pinus Pengger sangat murah, kamu hanya perlu membayar sebesar Rp. 3.000,- saja per orangnya. Terdapat biaya tambahan ketika berada di sini, diantaranya:</p>\r\n\r\n<ul>\r\n	<li>Berfoto di spot foto yang ada membayar sebesar Rp. 2.000,-</li>\r\n	<li>Menggunakan jasa tukang foto dengan membayar Rp. 4.000,-</li>\r\n</ul>\r\n\r\n<p>Untuk beberapa kegiatan tambahan di Hutan Pinus Pengger ini ditentukan dengan biaya sebagai berikut:</p>\r\n\r\n<ul>\r\n	<li>Jelajah Alam : Rp. 10.000/orang</li>\r\n	<li>Sepeda Hutan : Rp. 10.000/orang</li>\r\n	<li>Panjat Tebing : Rp. 15.000/orang</li>\r\n	<li>Sewa Panggung Sekolah Hutan Komersial : Rp. 3.000.000/kegiatan</li>\r\n	<li>Sewa Panggung Sekolah Hutan &nbsp;Non Komersial : Rp. 1.000.000/kegiatan</li>\r\n	<li>Tempat kegiatan non-panggung : Rp. 200.000/kegiatan</li>\r\n	<li>Hammock : Rp. 10.000/orang</li>\r\n	<li>Flying Fox : Rp. 15.000/orang</li>\r\n	<li>Aula : Rp. 250.000/4jam</li>\r\n	<li>Camping Ground : Rp. 15.000/orang/hari</li>\r\n	<li>Warung : Rp. 100.000/bulan</li>\r\n	<li>Foto Session dan Prewedding : Rp. 200.000/kegiatan</li>\r\n	<li>Video Clip : Rp. 250.000/kegiatan</li>\r\n	<li>Film Komersial : Rp. 1.000.000/hari</li>\r\n</ul>\r\n</body>\r\n</html>\r\n', '', 'Hutan Pinus Pengger', '', 'Hutan Pinus Pengger terletak di Desa Terong, Kecamatan Dlingo, Kabupaten Bantul, Yogyakarta. Hutan Pinus Pengger tidak hanya memiliki pemandangan alam yang indah melainkan juga berbagai spot foto yang instagramable. Kawasan wisata ini dapat menjadi tempat bersantai untuk menghabiskan liburan bersama keluarga maupun teman.', '', 1, 'location', 'cdn/2023/10/hutan-pinus-pengger.jpg', 'Jl. Dlingo-Patuk, Sendangsari, Terong, Dlingo, Bantul Regency, Special Region of Yogyakarta 55783, I', '-7.8712041', '110.45951439999999', 'Hutan Pinus Pengger', '', 'Hutan Pinus Pengger', 1, 5000, '02:00:00', 7200, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(72, 'gembira-loka-zoo', 1000, '2023-02-10 22:19:15', '2023-10-09 01:02:41', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>Mengenal Binatang Lebih Dekat</strong></p>\r\n\r\n<p>Gembira Loka Zoo memiliki beberapa zona satwa yang bisa dikunjungi, antara lain:</p>\r\n\r\n<p><strong>Zona Petting Zoo</strong></p>\r\n\r\n<p>berisi satwa jinak seperti kuda poni, keledai, rusa, kambing ceko, domba batur, hamster, dll. Anda juga bisa berinteraksi dan memberi pakan secara langsung pada satwa tersebut.</p>\r\n\r\n<p><strong>Zona Reptil &amp; Amphibi</strong></p>\r\n\r\n<p>dihuni oleh satwa seperti buaya, ular, biawak, axolotl, chameleon, kura-kura yang salah satunya terbesar berusia lebih dari 100 tahun. terdapat juga interaksi satwa dan spot foto menarik, dll.</p>\r\n\r\n<p><strong>Zona Bird Park</strong></p>\r\n\r\n<p>berbagai jenis burung menghuni di zona ini, elang jawa sebagai ikon Indonesia, burung merak, burung kicau, burung paruh bengkok, dan burung langka seperti cendrawasih, serta satwa favorit pengunjung yaitu penguin.</p>\r\n\r\n<p><strong>Zona Cakar</strong></p>\r\n\r\n<p>zona baru berpenghuni satwa karnivora atau pemakan daging, seperti harimau sumatera, macan dahan Kalimantan, beruang madu, serval cat, caracal cat, fishing cat, dan raja hutan singa afrika.</p>\r\n\r\n<p><strong>Zona Mamalia</strong></p>\r\n\r\n<p>kelas satwa paling banyak yang ada disini meliputi, gajah sumatera, unta, kudanil, watusi, binturong, kancil, dan masih banyak lagi.</p>\r\n\r\n<p><strong>Zona Primata</strong></p>\r\n\r\n<p>terdiri dari satwa seperti orang-utan Kalimantan, lutung jawa, siamang, simpanse, bekantan, monyet, dll.</p>\r\n\r\n<p><strong>Zona Pisces/ Ikan</strong></p>\r\n\r\n<p>ada bermacam-macam jenis ikan air tawar &amp; air laut dalam ruangan akuarium maupun kolam besar. Ada juga jenis ikan karnivora seperti arapaima, alligator, dll.</p>\r\n\r\n<p><strong>Wahana Darat &amp; Air</strong></p>\r\n\r\n<p>Wahana darat meliputi taring (kereta keliling), ATV, sewa sepeda. Sedangkan wahana air meliputi speedboat, kapal besar katamaran, perahu bebek kayuh, kolam tangkap, kolam sentuh, dan kolam terapikan</p>\r\n\r\n<p><strong>Interaksi Satwa dan Spot Foto Menarik</strong></p>\r\n\r\n<p>Anda bisa berfoto bersama satwa di berbagai zona satwa dan terdapat spot foto menarik yang instagramable didalamnya, bahkan jika anda beruntung akan dapat menemukan beberapa spot foto yang jarang diketahui oleh pengunjung</p>\r\n</body>\r\n</html>\r\n', '', 'Gembira Loka Zoo', '', 'Gembira Loka Zoo merupakan Kebun Raya dan Kebun Binatang yang berada di Kota Yogyakarta. Memiliki berbagai wahana rekreasi seperti interaksi satwa, kolam sentuh, kolam tangkap, terapi ikan, perahu kayuh, skuter air, atv, bumper boat, speed boat, perahu katamaran, dan lain lain.', '', 1, 'location', '', 'Jl. Kebun Raya No.2, Rejowinangun, Kec. Kotagede, Kota Yogyakarta, Daerah Istimewa Yogyakarta 55171,', '-7.8040164999999995', '110.397994', 'Gembira Loka Zoo', '', 'Gembira Loka Zoo', 10, 75000, '01:30:00', 5400, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(73, 'makam-panembahan-senopati', 1000, '2023-02-10 22:19:15', '2023-10-08 22:16:50', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Lokasinya ada di Kotagede yang merupakan ibukota pertama kerajaan Mataram. Kira-kira 100 meter dari pasar, Kita menuju Masjid Gedhe Mataram. Nah, Di samping masjid tersebut terdapat pintu gerbang menuju makam Panembahan Senopati. Nama asli Panembahan Senopati adalah Danang Sutawijaya, yang hidup dari tahun 1573-1601 Masehi.&nbsp;</p>\r\n\r\n<p>Pada mulanya makam ini adalah kompleks keraton. Karena itu, dilengkapi dengan pemandian putra dan putri. &nbsp;Setelah ibukota kerajaan Mataram dipindahkan dari Kotagede, tempat ini dijadikan pemakaman raja-raja Mataram. Di sini ada makam ayah dari Panembahan Senopati yaitu Ki Ageng Pamanahan, &nbsp;makam raja kedua, Mas Jolang, Dan keluarga lainnya.&nbsp;</p>\r\n\r\n<p>Waktu seakan berhenti di sini. Mungkin karena dinding-dinding bata kuno Yang membuat kita terlempar ke masa lalu, atau karena suasana yang melangutkan jiwa. Saya merasa khusyu dan khidmat menyelami kisah perjuangan Panembahan Senopati.</p>\r\n</body>\r\n</html>\r\n', '', 'Makam Panembahan Senopati', '', 'Bulan suci Ramadan, banyak orang melakukan wisata religi. Nah saya mau merekomondasikan tempat wisata religi yang juga sangat bersejarah, yaitu cikal bakal kerajaan Mataram Islam Yang didirikan oleh Panembahan Senopati. \r\n', '', 1, 'location', 'cdn/2023/10/makam-senopati.png', '59CX+562, Sayangan, Jagalan, Kec. Kotagede, Bantul Regency, Special Region of Yogyakarta 55192, Indo', '-7.8296224', '110.3980162', 'Makam Panembahan Senopati', '', 'Makam Panembahan Senopati', 0, 0, '00:45:00', 2700, 4.8, 'D.I. Yogyakarta', 0, 0, 0),
(74, 'tourism-village-mlangi-1', 1000, '2023-02-10 22:19:15', '2023-10-09 19:17:08', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Identitas keislaman penduduk&nbsp; bukan sesuatu yang dibuat-&shy;buat. Buktinya dapat dilihat dari cara berpakaian penduduk. Di Mlangi, para lelaki biasa memakai sarung, baju Muslim, dan peci meski tidak hendak pergi ke masjid. Sementara hampir semua perempuan di dusun ini mengenakan jilbab di dalam maupun di luar rumah. Pengamalan ajaran Islam seolah menjadi prioritas bagi warga Mlangi. Konon, warga rela menjual harta bendanya agar bisa naik haji.&nbsp;<br />\r\n<br />\r\nSetiap Ramadhan, dusun ini selalu ramai dengan ritual ibadah yang dijalankan warganya. Mulai&nbsp; tadarus, pengajian anak-&shy;anak, dan sebagainya. Tak sedikit masyarakat dari luar Mlangi yang datang untuk &#39;wisata&#39; agama, semacam pesantren kilat. Nah, bila ingin berkunjung ke Mlangi, inilah saat yang tepat. Sepanjang siang selama bulan Ramadhan, anda juga akan melihat betapa akrab anak-&shy;anak bermain petasan.&nbsp;&nbsp;<br />\r\n<br />\r\nMlangi saat ini telah ditetapkan sebagai salah satu desa wisata religi oleh Pemerintah Kabupaten Sleman. Sebagai gambaran sosio&shy;kultural, Desa Wisata Religi Mlangi didukung oleh keberadaan lima modal sosial dan budaya yang dimiliki masyarakat setempat. Pertama, Masjid Pathok Negoro Mlangi merupakan salah satu masjid di Yogyakarta yang disebut&shy;-sebut sebagai pathok negoro bersama-&shy;sama empat masjid yang lainnya. Berturut-&shy;turut kelima masjid Pathok Negoro di Yogyakarta adalah Masjid Jami di Mlangi, Masjid Sultoni di Ploso Kuning, Masjid Ad&shy;darojah di Babadan Baru, Masjid Nurul Huda di Dongkelan dan Masjid Taqwa di Wonokromo Bantul.&nbsp;<br />\r\n<br />\r\nKeberadaan masjid pathok negoro di Mlangi menjadi ikon utama desa wisata religi Mlangi. Arsitektur masjid Jami Mlangi pada awalnya sama dengan masjid keraton lainnya. Masjid ini mengikuti gaya arsitektur Jawa dengan banyak penyangga kayu. Dahulu, soko guru masjid ini berjumlah 16 buah termasuk soko utama di ruang utama masjid. Pawestri menjadi tempat khusus sholat untuk kaum putri. Sementara, bagian sisi depan, kanan dan kiri masjid terdapat blumbang (sejenis kolam kecil) yang berfungsi sebagai tempat membersihkan kaki jamaah sebelum memasuki masjid.&nbsp;<br />\r\n<br />\r\nSeiring dengan perkembangan zaman, Masjid Jami Mlangi pun mengalami banyak perubahan. Setelah mendapatkan izin dari Keraton, masjid mengalami beberapa proses renovasi tanpa menghilangkan keaslian bentuk bangunan dari Masjid Jami sebelumnya yakni dengan menjadikannya gedung bertingkat. Konstruksi bangunannya pun diganti dengan pilar&shy;-pilar beton. Sekalipun demikian, mimbar yang ada di masjid ini juga termasuk yang masih asli. Beduk-nya juga menyerupai replika aslinya. Hingga saat ini, masjid jami mempunyai pesona tersendiri yang dapat memikat banyak orang untuk datang baik yang bertujuan shalat maupun berziarah.&nbsp;<br />\r\n<br />\r\nKedua, Ekonomi Kreatif. Di desa Wisata Mlangi, masyarakat secara dinamis dan turun temurun mengembangkan ekonomi mereka berbasis industri rumah tangga. Hampir 90 persen penduduk Desa Mlangi adalah wiraswasta. Mereka berusaha mulai dari usaha konveksi, kerajinan, kuliner, jamu-jamuan, maupun bidang-&shy;bidang yang lain. Banyak produk tercipta dari rumah-&shy;rumah produksi di Mlangi, di antaranya konveksi.&nbsp;<br />\r\n<br />\r\nBeberapa usaha konveksi bisa disebutkan seperti celana londo, baju&ndash;celana endul, jumput Mlangi, kaos oblong, celana turis, rukuh, mukena, kerudung lukis, hingga kerajinan. Beberapa hasil kerajinan rakyat yang pernah dihasilkan di Mlangi meliputi net voli, net bulu tangkis, jaring gawang, tas raket, bola voli plastik.&nbsp;<br />\r\n<br />\r\nBerikutnya, Tradisi Budaya. Dari daftar inventaris tradisi dan budaya masyarakat Mlangi hingga sekarang, Mlangi memiliki berbagai ragam upacara tradisi. Tradisi dan budaya itu telah dijiwai semangat keislaman. Tradisi itu mewarnai masyarakat Mlangi sejak ada dalam janin hingga di wafat. Warga umumnya akan melakukan semacam upacara saat istri&shy;-istri mereka hamil, melahirkan, hingga adanya anggota masyarakat yang meninggal dunia.&nbsp;<br />\r\n<br />\r\nTradisi slametan atau syukuran pun terjadi saat pernikahan, dolanan anak hingga tradisi sunatan dan perkawinan. Adat kebiasaan yang mereka jalankan merupakan kolaborasi tentang keislaman dengan tradisi jawa yang memang sudah dari nenek moyang. Tradisi itu kemudian ditafsirkan dari perspektif islam sebagai upaya untuk menjawab kekinian.&nbsp;&nbsp;<br />\r\n<br />\r\nKeempat, Kesenian. Ketua tim pengembangan Desa Wisata Mlangi, Ihsan, menyebutkan bahwa di desa wisata Mlangi ini terdapat berbagai macam&nbsp; kesenian rakyat. Hingga sekarang, kesenian ini masih dibudayakan oleh masyarakat setempat. Ragam jenis kesenian tersebut yakni slawatan jowo, kojan, seni rodad, rengeng&shy;rengeng, Berjanjen, hadrah&ndash;Ngarak, Simthud Duror dan sebagainya.&nbsp;<br />\r\n<br />\r\nPada saat pengkaji datang, bertepatan dengan malam Jumat, Peneliti mendapati beberapa grup santri di masing-&shy;masing pesantren melakukan pembacaan Barzanji dengan diiringi musik rebana. Suara bersahut-&shy;sahutan antara kelompok satu dengan yang lainnya. Hentakan musik pukul itu terdengar ingar bingar karena datang dari berbagai arah.&nbsp;&nbsp;<br />\r\n<br />\r\nKelima, Kuliner Khas. Tidak lengkap kiranya di dalam wisata tidak ada kuliner. Di sini bisa ditemukan beraneka macam lauk pauk yang bisa menjamu para wisatawan ketika lapar. Jika&nbsp; ingin mencicipi makanan yang khas, banyak panganan tradisional diproduksi dari olahan tangan santri maupun masyarakat Mlangi. Salah satu kuliner paling khas adalah opor bebek. Opor bebek khas Mlangi ini konon menjadi makanan kegemaran Sultan Hamengkubuwono IX kalau berkunjung ke tempat itu.&nbsp;<br />\r\n<br />\r\nSelain opor bebek, ada beberapa menu santapan yang bisa didapat di desa ini.&nbsp; Hidangan berbentuk lauk pauk seperti jangan bobor, sego tumpeng sambel pitu, jangan kelontoko, jangan urip&shy;urip, jangan kothok, jangan besengek, uyah salam, brambang salam. Selain itu, tersedia makanan ringan, yakni janagel, trasikan, legondo, lemper, mendut, jadah, wajik, jenang Mlangi, rambak, tetel gedang, carang gesing, krekes, klepon-puthu.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Tourism Village Mlangi', '', 'Desa Wisata Mlangi yang terletak di Kalurahan Nogotirto Kapanewon Gamping merupakan sebuah desa wisata yang tersohor dengan potensi wisata religi Masjid Pathok Negoro serta memiliki cukup banyak pondok pesantren.\r\nTak heran jika kemudian wilayah ini disebut sebagai “kampung santri”. Berbagai potensi ekonomi kreatif pun banyak dihasilkan dari desa wisata ini yang kemudian dijual diberbagai lokasi wisata lain, bahkan termasuk juga sebagai penyetor berbagai komoditas atau produk umkm yang dijual di kawasan Malioboro.\r\nDikawasan desa wisata Mlangi pun yang tepatnya disisi barat berbatasan dengan sungai Bedog saat sebelum pandemi Covid-19 terdapat sebuah destinasi bernama West Lagoon yang pernah viral dimasa lalu. Namun akibat pandemi Covid-19 destinasi inipun mengalami surut sebagaimana destinasi-destinasi yang lain di berbagai wilayah.', '', 1, 'location', 'cdn/2023/10/tourism-village-mlangi.jpg', 'Jl. Masjid Patok Negoro Mlangi, Mlangi, Nogotirto, Kec. Gamping, Kabupaten Sleman, Daerah Istimewa Y', '-7.761608', '110.3308855', 'Tourism Village Mlangi', '', 'Tourism Village Mlangi', 1, 0, '01:30:00', 5400, 4.8, 'D.I. Yogyakarta', 0, 0, 0),
(75, 'prambanan-temple-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:37:05', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Candi Prambanan adalah bangunan candi bercorak agama Hindu terbesar di Indonesia yang dibangun pada abad ke-9 Masehi. Candi yang juga disebut sebagai Rara Jonggrang ini dipersembahkan untuk Trimurti, tiga dewa utama Hindu yaitu dewa Brahma sebagai dewa pencipta, dewa Wisnu sebagai dewa pemelihara, dan dewa Siwa sebagai dewa pemusnah. Berdasarkan prasasti Siwagrha nama asli kompleks candi ini adalah Siwagrha (bahasa Sanskerta yang bermakna &#39;Rumah Siwa&#39;), dan memang di garbagriha (ruang utama) candi ini bersemayam arca Siwa Mahadewa setinggi tiga meter, dikarenakan aliran Syaiwa yang mengutamakan pemujaan dewa Siwa di candi ini.<br />\r\nKompleks percandian Prambanan secara keseluruhan terletak di Daerah Istimewa Yogyakarta, tetapi pintu administrasinya terletak di Jawa Tengah. Hal ini yang membuat Candi Prambanan terletak di 2 tempat yakni di Desa Bokoharjo, Prambanan, Kabupaten Sleman, Daerah Istimewa Yogyakarta, dan di Tlogo, Prambanan, Kabupaten Klaten, Jawa Tengah, atau kurang lebih 17 kilometer timur laut dari Kota Jogja, 50 kilometer barat daya dari Kota Surakarta dan 120 kilometer selatan dari Kota Semarang, persis di perbatasan antara Daerah Istimewa Yogyakarta dan Jawa Tengah.<br />\r\nCandi ini adalah termasuk Situs Warisan Dunia UNESCO, candi Hindu terbesar di Indonesia, sekaligus salah satu candi terindah di Asia Tenggara. Arsitektur bangunan ini berbentuk tinggi dan ramping sesuai dengan arsitektur Hindu pada umumnya dengan candi Siwa sebagai candi utama memiliki ketinggian mencapai 47 meter menjulang di tengah kompleks gugusan candi-candi yang lebih kecil. Sebagai salah satu candi termegah di Asia Tenggara, candi Prambanan menjadi daya tarik kunjungan wisatawan dari seluruh dunia. Menurut prasasti Siwagrha, candi ini mulai dibangun pada sekitar tahun 850 masehi oleh Rakai Pikatan, dan terus dikembangkan dan diperluas oleh Balitung Maha Sambu, pada masa Kerajaan Medang Mataram.</p>\r\n</body>\r\n</html>\r\n', '', 'Prambanan Temple', '', 'Candi Prambanan dibangun pada abad ke-9. Menjulang setinggi 47 meter dengan ornamen yang mengagumkan, kecantikan candi Hindu ini tak tertandingi. Candi Prambanan terletak 17 km ke arah timur dari pusat Kota Jogja dan bisa dijangkau dengan bus Trans Jogja. Loket tiket reguler buka setiap hari pk 08:00 sampai pk 17:15, tetapi kita bisa masuk lebih awal dengan mengambil paket Pruputan (pk 06.30 - 08.00). Waktu terbaik untuk mengunjungi Candi Prambanan adalah pagi-pagi sekali, saat udara masih segar. Harga tiket masuk Candi Prambanan adalah Rp50.000 untuk dewasa, dan Rp25.000 untuk anak 3-10 tahun. Ada diskon 50% untuk rombongan pelajar/mahasiswa, minimal 20 orang.', '', 1, 'location', 'cdn/2023/10/10.jpg', 'Jl. Raya Solo - Yogyakarta No.16, Kranggan, Bokoharjo, Prambanan, Sleman Regency, Special Region of ', '-7.7520206', '110.49146739999999', 'Prambanan Temple', '', 'Prambanan Temple', 0, 50000, '02:00:00', 7200, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(76, 'klenteng-poncowinatan', 1000, '2023-02-10 22:19:15', '2023-10-09 21:00:54', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Kelenteng Kwan Tee Kiong didirikan pada tahun 1879. Kelenteng yang dikenal dengan nama Kelenteng Poncowinatan ini didirikan di atas tanah hibah dari Sultan Hamengku Buwono VII yang diberikan kepada masyarakat Tionghoa. Untuk menghormati Keraton Yogyakarta, maka kelenteng ini dibangun menghadap ke selatan.</p>\r\n\r\n<p>Kelenteng berdenah persegi panjang. Dindingnya terbuat dari bata. Tiangnya dari kayu jati. Plafon dari papan kayu jati dan penutup atapnya genteng. Pada setiap sudut atap melengkung ke atas terdapat hiasan patung naga.</p>\r\n\r\n<p>Bagian dalam kelenteng terbagi menjadi beberapa ruangan. Antara lain ruangan suci utama sebagai pusatnya, yang dikelilingi ruang-ruang pemujaan dewa. Kemudian gudang dan ruang kamar penjaga kelenteng.</p>\r\n\r\n<p>Pada ruang suci utama terdapat patung&nbsp;Kwan Tie Koen&nbsp;(Dewa Keadilan), bedug, lonceng, dan alat perlengkapan ibadah lainnya.Di sebelah timur ruang suci utama ada ruang pemujaan yang berisi patung Fuk Ten Cen Sen (penunggu rumah). Di sebelah utara ruang suci utama (belakang) terdapat ruang pemujaan yang berisi patung&nbsp;Dewi Kwan Im&nbsp;(tengah), ruang pemujaan&nbsp;Sidharta Buddha Gautama&nbsp;(di kanan) dan ruang pemujaan&nbsp;Manjusri Bodhisatwa&nbsp;(di kiri) (Hariana, 1999).</p>\r\n\r\n<p>Kelenteng Poncowinatan dilengkapi fasilitas pendidikan. Di lingkungan kelenteng didirikan Sekolah Dasar Tionghoa modern bernama Sekolah Tiong Hoa Hak Tong pada 1907 oleh Perserikatan Orang Tionghoa yaitu Tiong Hoa Hwee Koan (THHK). Sekolah tersebut berada di sebelah barat kelenteng, sekarang digunakan untuk Sekolah Budya Wacana.</p>\r\n\r\n<p>Selain dilengkapi bangunan untuk kegiatan pembelajaran, di sekitar kelenteng juga terdapat lapangan terbuka untuk berlatih fisik, kungfu dan lain-lain. Fungsi tersebut merupakan manifestasi dari arti kata &rdquo;kelenteng&rdquo; itu sendiri. Istilah &rdquo;kelenteng&rdquo; berasal dari gabungan tiga kata yaitu &rdquo;Kauw&rdquo; (pendidikan/belajar), &rdquo;Lang&rdquo; (orang/manusia), dan &rdquo;Teng&rdquo; (tempat/bangunan). Jadi, &rdquo;Kauw Lang Teng&rdquo; bermakna tempat orang belajar.</p>\r\n\r\n<p>Kelenteng Poncowinatan digunakan sebagai tempat pemujaan Tri Dharma yaitu Buddha, Konghucu, dan Taoisme. Upacara keagaman di kelenteng ini biasanya dilaksanakan pada hari ulang tahun kelenteng pada tanggal 24 bulan ke-6 dan tahun baru imlek.</p>\r\n\r\n<p>Kelenteng Poncowinatan ditetapkan sebagai Cagar Budaya melalui Permenbudpar RI No. PM.07/PW.007/MKP/2010. Kelenteng ini beralamat di Jalan Poncowinatan No. 11 Yogyakarta.</p>\r\n</body>\r\n</html>\r\n', '', 'Klenteng Poncowinatan', '', 'Kelenteng Tjen Ling Kiong atau Zhen Ling Gong, disebut pula dengan nama Kelenteng Poncowinatan, adalah tempat ibadah agama Khonghucu yang berlokasi di Kota Yogyakarta. kelenteng ini terletak di wilayah Poncowinatan yang terkenal sebagai daerah Pecinan dan merupakan kelenteng tertua yang berada di Yogyakarta. Kongco yang dipuja di Kelenteng ini adalah Kwan Tie Koen.', '', 1, 'location', 'cdn/2023/10/klenteng-poncowinatan.jpg', 'Jl. Poncowinatan No.12-18, Gowongan, Kec. Jetis, Kota Yogyakarta, Daerah Istimewa Yogyakarta 55233, ', '-7.781956399999999', '110.3656838', 'Klenteng Poncowinatan', '', 'Klenteng Poncowinatan', 0, 0, '00:45:00', 2700, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(77, 'gedung-agung-yogyakarta-1', 1000, '2023-02-10 22:19:15', '2023-10-12 12:35:28', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Istana Yogyakarta&nbsp;yang dikenal dengan nama&nbsp;Gedung Agung&nbsp;terletak di pusat keramaian kota, tepatnya di ujung selatan Jalan Ahmad Yani dahulu dikenal dengan Jalan Margomulyo. Kawasan istana terletak di&nbsp;Kelurahan Ngupasan,&nbsp;Kemantr&egrave;n Gondomanan,&nbsp;Kota Yogyakarta, dan berada pada ketinggian 120&nbsp;m&nbsp;dari permukaan laut. Kompleks istana ini menempati lahan seluas 43.585&nbsp;m&sup2;.</p>\r\n\r\n<p>Istana Yogyakarta atau Gedung Agung, sama halnya dengan istana Kepresidenan lainnya yaitu sebagai kantor dan kediaman resmi Presiden Republik Indonesia. Selain itu juga sebagai tempat menerima atau menginap tamu-tamu negara. Sejak&nbsp;17 Agustus&nbsp;1991, istana ini digunakan sebagai tempat memperingati Detik-detik Proklamasi Kemerdekaan untuk Daerah Istimewa Yogyakarta dan penyelenggaraan Parade Senja setiap tanggal 17 yang dimulai&nbsp;17 April&nbsp;1988.</p>\r\n\r\n<p>Istana Yogyakarta terdiri atas enam bangunan utama yaitu&nbsp;Gedung Agung&nbsp;(gedung utama),&nbsp;Wisma Negara,&nbsp;Wisma Indraphrasta,&nbsp;Wisma Sawojajar,&nbsp;Wisma Bumiretawu&nbsp;dan&nbsp;Wisma Saptapratala. Gedung utama yang selesai dibangun pada&nbsp;1869&nbsp;sampai sekarang bentuknya tidak mengalami perubahan. Ruangan utama yang disebut dengan Ruang Garuda berfungsi sebagai ruangan resmi untuk menyambut tamu negara atau tamu agung yang lain. Selain wisma-wisma tersebut sejak&nbsp;20 September&nbsp;1995&nbsp;komplek&nbsp;Seni Sono&nbsp;seluas 5.600&nbsp;m2&nbsp;yang terletak di sebelah selatan, yang semula milik Departemen Penerangan, menjadi bagian Istana Kepresidenan ini.</p>\r\n\r\n<p>Di depan gedung utama, di halaman istana, ada sebuah monumen batu andesit setinggi 3,5 meter yang disebut&nbsp;Dagoba, yang berasal dari&nbsp;Desa Cupuwatu, di dekat&nbsp;Candi Prambanan.</p>\r\n</body>\r\n</html>\r\n', '', 'Gedung Agung Yogyakarta', '', 'Istana Yogyakarta yang dikenal dengan nama Gedung Agung terletak di pusat keramaian kota. Istana Yogyakarta atau Gedung Agung, sama halnya dengan istana Kepresidenan lainnya yaitu sebagai kantor dan kediaman resmi Presiden Republik Indonesia. Selain itu juga sebagai tempat menerima atau menginap tamu-tamu negara.', '', 1, 'location', '', '59X7+WHC, Jalan Ahmad Yani, Ngupasan, Kec. Gondomanan, Kota Yogyakarta, Daerah Istimewa Yogyakarta 5', '-7.8001885', '110.36387699999999', 'Gedung Agung Yogyakarta', 'Gedung Agung Yogyakarta', 'Gedung Agung Yogyakarta', 0, 0, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(78, 'affandi-museum', 1000, '2023-02-10 22:19:15', '2023-10-12 09:52:16', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Museum Affandi&nbsp;merupakan salah satu&nbsp;museum seni&nbsp;di&nbsp;Daerah Istimewa Yogyakarta,&nbsp;Indonesia. Museum yang berada di tepi&nbsp;Sungai Gajah Wong&nbsp;ini menyimpan berbagai macam lukisan karya&nbsp;Affandi. Selain itu, museum ini juga menyimpan banyak benda peninggalan Affandi lainnya seperti mobil, sepeda&nbsp;onthel&nbsp;dan masih banyak lagi.</p>\r\n\r\n<p style=\"text-align: justify;\">Museum Affandi terletak di Jalan Laksda Adisucipto nomor 167 dan menempati lahan seluas 3.500 m2&nbsp;yang terdiri atas bangunan museum yang terdiri dari empat galeri beserta bangunan pelengkap seperti tempat pembelian tiket, dua studio, dan bangunan rumah tempat tinggal pelukis Affandi dan keluarganya. Rumah Affandi ini mempunyai atap berbentuk pelepah pisang, dan terdiri dari dua lantai dengan lantai bawah untuk&nbsp;ruang tamu&nbsp;dan garasi sedangkan lantai atas yang sebagai kamar pribadi Affandi.&nbsp;Sekarang rumah ini berfungsi menjadi Kafe Loteng yang dapat dikunjungi pengunjung.&nbsp;Pembangunannya dilakukan secara bertahap serta dirancang sendiri oleh Affandi.</p>\r\n\r\n<p>Selain 300 karya&nbsp;lukisan&nbsp;Affandi sendiri, dalam museum ini juga tersimpan lukisan dari para&nbsp;pelukis Indonesia&nbsp;lainnya, antara lain:&nbsp;Basuki Abdullah,&nbsp;Popo Iskandar,&nbsp;Sudjojono,&nbsp;Hendra Gunawan,&nbsp;Barli Sasmitawinata, dan&nbsp;Mochtar Apin.&nbsp;Selain itu terdapat&nbsp;patung&nbsp;karya Amrus Natalsya, dan&nbsp;cukil kayu&nbsp;poles karya keluarga Tjokot.</p>\r\n</body>\r\n</html>\r\n', '', 'Affandi Museum', '', 'Museum Affandi merupakan salah satu museum seni di Daerah Istimewa Yogyakarta, Indonesia. Museum yang berada di tepi Sungai Gajah Wong ini menyimpan berbagai macam lukisan karya Affandi. Selain itu, museum ini juga menyimpan banyak benda peninggalan Affandi lainnya seperti mobil, sepeda onthel dan masih banyak lagi. Selain 300 karya lukisan Affandi sendiri, dalam museum ini juga tersimpan lukisan dari para pelukis Indonesia lainnya, antara lain: Basuki Abdullah, Popo Iskandar, Sudjojono, Hendra Gunawan, Barli Sasmitawinata, dan Mochtar Apin. Selain itu terdapat patung karya Amrus Natalsya, dan cukil kayu poles karya keluarga Tjokot.', '', 1, 'location', 'cdn/2023/10/museum-affandi-jogja-sumber-ig-rinhastuti.jpg', 'Jl. Laksda Adisucipto No.167, Papringan, Caturtunggal, Kec. Depok, Kabupaten Sleman, Daerah Istimewa', '-7.782712999999999', '110.396397', 'Affandi Museum', 'Affandi Museum', 'Affandi Museum', 0, 25000, '02:00:00', 7200, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(79, 'hutan-pinus-mangunan-dlingo-1', 1000, '2023-02-10 22:19:15', '2023-10-09 01:13:28', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hutan Pinus Mangunan memang tempat paling pas untuk bersantai dan menenangkan diri dari penatnya rutinitas. Tempat wisata ini berlokasi di Desa Mangunan, Dlingo, Bantul, Yogyakarta. Akses menuju lokasi sudah sangat mudah karena jalanan sudah beraspal dan penerangan sudah cukup baik. Sebelum jadi destinasi wisata yang populer seperti sekarang, awalnya Hutan Pinus Mangunan adalah tanah yang tandus dan kering. Hingga lahan 500 Ha tersebut ditanamai aneka pepophonan seperti mahoni, akasia, merkusi, kayu putih, dan pinus. Pohon-pohon tersebut tumbuh subur dan dikembangkan jadi tempat wisata.<br />\r\n<br />\r\nKamu bisa kesini kapanpun karena memang tempat wisata ini dibuka setiap hari dan setiap waktu. Kamu bisa datang ketika pagi menyingsing menyambut udara pagi yang dingin dan segar, lengkap dengan embun yang bening. Atau bisa juga kamu datang ke sini ketika sore hari, menikmati suasana hutan yang syahdu dengan angin sepoi yang semilir membelai rambut. Dijamin kamu akan lupa dengan deadline tugas yang menumpuk atau tumpukan pekerjaan yang seakan tak ada jeda.<br />\r\n<br />\r\nDi Hutan Pinus Mangunan tersedia dua gardu pandang. Gardu pandang pertama tidak terlalu tinggi, kamu bisa melihat kawasan Hutan Pinus Mangunan dari atas. Sedangkan gardu pandang kedua, lokasinya lebih tinggi dan terdiri dari dua lantai. Dari gardu kedua ini kamu bisa melihat sensasi melihat pemandangan alam hutan pinus dan kawasan sekitarnya yang hijau dan indah. Di atas angin begitu kencang membuatmu semakin rileks.<br />\r\n<br />\r\n<strong>Tiket Masuk</strong><br />\r\nPemandangan indah di Hutan Pinus Mangunan bisa kamu nikmati cukup dengan membayar tiket parkir sebesar Rp 3000,- untuk motor dan Rp 10.000, &ndash; untuk mobil. Tempat wisata ini sudah memiliki fasilitas yang lengkap, area parkir yang luas, toilet, mushola, dan warung makanan. Lokasi ini juga sangat cocok untuk dijadikan area outbond dan kegiatan outing lainnya.<br />\r\n<br />\r\n<strong>Spot Foto Terbaik</strong><br />\r\nBuat kamu pecinta fotografi dijamin tempat wisata ini akan sangat memanjakan kamu. Hampir setiap sudut hutan pinus ini bisa dijadikan spot foto yang instagenic. Baik foto selfie ataupun foto berkonsep seperti pre wedding dan foto angkatan. Spot foto yang terkenal di sini antara lain panggung dan kursi kayu, spot segitiga akar, sarang burung, rumah pohon, spot tangan dewa, dan masih banyak lagi. Setelah lelah berkeliling dan hunting foto kamu bisa beristirahat di bangku-bangku kayu lucu yang disediakan.<br />\r\n&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', 'Hutan Pinus Mangunan Dlingo', '', 'Hutan Pinus Mangunan Dlingo jadi salah satu lokasi yang sedang hits di Yogyakarta belakangan ini. Ini adalah hutan lindung yang dijadikan sebagai lokasi wisata bertemakan alam. Cocok sekali dikunjungi untuk menghilangkan penat. Di dalam hutan ini berisi jejeran pohon pinus yang menjulang tinggi. Pohon pinus ini yang menarik wisatawan untuk mengunjungi dan berfoto.', '', 1, 'location', 'cdn/2023/10/hutan-pinus-mangunan-dlingo.jpg', 'Sukorame, Mangunan, Kec. Dlingo, Kabupaten Bantul, Daerah Istimewa Yogyakarta 66783, Indonesia', '-7.9267837', '110.4319967', 'Hutan Pinus Mangunan Dlingo', '', 'Hutan Pinus Mangunan Dlingo', 0, 3000, '02:00:00', 7200, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(80, 'sindu-kusuma-edupark-ske-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:54:12', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Sindu Kusuma Edupark (SKE) merupakan sebuah destinasi rekreasi yang terletak di Jogjakarta. Di tujuh hektar kawasan taman yang selesai dibangun tahun 2014 ini, terdapat bermacam-macam wahana, baik wahana bermain maupun wahana belajar yang bisa dinikmati oleh semua anggota keluarga.<br />\r\nWahana yang paling terkenal dari SKE adalah bianglalanya, yang merupakan sebuah wahana bermain sekaligus ikon SKE sendiri. Bila Singapore memiliki Flyer setinggi 165 meter, sementara Malaysia punya Eye setinggi 88 meter, dan di Thailand ada Asiatique setinggi 60 meter, Indonesia memiliki Cakra Manggilingan dengan tinggi 48 meter. Di tingkat Asia Tenggara, bianglala ini memang mesti berpuas diri duduk di peringkat keenam sebagai bianglala tertinggi, tetapi di tingkat nasional, ia duduk di peringkat pertama.<br />\r\nBerada di jantung Sindu Kusuma Edupark (SKE), Cakra yang terdiri dari 28 buah kapsul yang masing-masing dapat memuat empat orang termasuk ke dalam aspek bermain taman yang mengusung tagline &quot;The City of Fantasy, Wahana Wisata Keluarga&quot; itu. Daya tarik utama Cakra adalah persembahan bird eye view 360 derajat ketika kapsul yang kita tumpangi sudah berada di titik puncak.<br />\r\nDari atas, kita tidak hanya menyaksikan pemandangan seantero SKE, atau wilayah sekitar yang rimbun hijau, atau Kota Jogja dan gedung-gedungnya, tetapi juga bukit-bukit di kejauhan dan Gunung Merapi. Dan bila senja-lalu kemudian malam-tiba, pemandangan semakin elok saja. Tidak heran bila wahana yang sekali berotasi memakan waktu enam menit ini menjadi ikon SKE. Cakra Manggilingan patut dicoba bila kita sedang berkunjung ke SKE.<br />\r\nNamun, SKE tidak terbatas pada Cakra. Saat kami berkunjung, ada setidaknya 18 wahana bermain yang sedang beroperasi, baik yang sudah lama ada maupun yang baru ditambahkan, beberapa diantaranya House of Terror (Rumah Hantu), Area Ketangkasan, Bioskop 8D, Bioskop 4D, Montor Tumbur (Bumper Car), Sepeda Mabur (Flying Bicycle), Cangkir Mabur (Spinning Cup), Kursi Mabur (Flying Chair), Taman Lampu, dan Waterpark. Dan semua wahana di SKE ini sebetulnya patut dicoba, walaupun hanya sekali. Panggon Lunjak, misalnya. Di trampoline yang dilengkapi dengan mesin untuk membantu melontarkan pengunjung lebih tinggi ini, kita bisa melompat sesuka hati-bahkan sampai salto-salto-tanpa takut terpental keluar area. Wahana ini cukup menyenangkan, meskipun untuk alasan keselamatan, hanya mereka yang berberat badan maksimal 70 kg dapat mencobanya.<br />\r\nLalu, bioskop 4D dan 8D dengan pilihan-pilihan film yang cukup seru, mulai dari film kartun sampai film horror, juga siap menghibur kita. Yang pertama dinamai 4D Ride sebab selain gambar yang ditampilkan terlihat bervolume, juga karena kursi yang kita duduki bergerak mengikuti adegan di dalam layar dan ada efek hembusan angin, sehingga sensasi menonton terasa semakin nyata.<br />\r\nDi samping wahana bermain, SKE juga menawarkan wahana edukasi. Begitu memasuki gerbang sebenarnya kita sudah merasakan sisi edukasi taman yang satu pengembang dengan Kusuma Agrowisata di Batu ini. Di koridor yang menuntun masuk diletakkan panel-panel informatif mengenai fakta-fakta yang mungkin kita belum ketahui sebelumnya. Misalnya, dijelaskan mengenai tinggi bianglala terbesar yang ada di dunia dibandingkan dengan kebanggan SKE sendiri.<br />\r\nNamun wahana edukasi SKE yang sebenarnya ada di dalam taman dan formatnya serupa museum. Yang pertama ada Omah Batik yang menyambut kita pertama kali begitu keluar dari koridor masuk. Di dalam museum batik ini, kita bisa mempelajari berbagai macam motif batik sekaligus mempelajari cerita perjalanan batik dari dulu sampai booming seperti sekarang.</p>\r\n</body>\r\n</html>\r\n', '', 'Sindu Kusuma Edupark (SKE)', '', 'Sindu Kusuma Edupark (SKE) selaku Perusahaan yang bergerak di bidang Wisata Themepark dan Edukasi di Yogyakarta, yaitu tempat wahana rekreasi keluarga berbasis Budaya & Edukasi. Dengan mengandalkan konsep Edukasi dan mengusung nilai-nilai Adiluhung Budaya Jawa, SKE akan tampil sebagai wahana wisata keluarga yang mampu memberikan pengalaman dan kesan tersendiri bagi setiap pengunjungnya. Keistimewaan SKE terletak pada lokasinya yang berada di Kabupaten Sleman, berbatasan langsung dengan Kota Yogyakarta, tepatnya di Jalan Jambon, Sinduadi, Mlati, Sleman, D.I. Yogyakarta.', '', 1, 'location', 'cdn/2023/10/19.jpg', 'Jl. Jambon, Kragilan, Sinduadi, Mlati, Sleman Regency, Special Region of Yogyakarta 55284, Indonesia', '-7.7672973', '110.35424859999999', 'Sindu Kusuma Edupark (SKE)', '', 'Sindu Kusuma Edupark (SKE)', 0, 25000, '02:00:00', 7200, 4.2, 'D.I. Yogyakarta', 0, 0, 0);
