(81, '1-march-1949-general-offensive-monument-1', 1000, '2023-02-10 22:19:15', '2023-10-12 09:44:04', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Monumen Serangan Umum 1 Maret 1949 merupakan monumen&nbsp;untuk memperingati perjuangan Tentara Nasional Indonesia (TNI) bersama rakyat pada tanggal bersejarah tersebut. Seperti dikutip dari Laman Museum Benteng Vredeburg, serangan umum 1 Maret 1949 merupakan sebuah respons atas Agresi Militer Belanda ke-II yang menjadikan Yogyakarta sebagai sasaran utamanya. Saat itu, Yogyakarta menjadi ibu kota Indonesia karena situasi di Jakarta tidak aman setelah proklamasi kemerdekaan Indonesia. Situasi Yogyakarta sebagai ibu kota negara saat itu sangat tidak kondusif. Keadaan tersebut diperparah propaganda Belanda di dunia luar bahwa tentara Indonesia sudah tidak ada. Sri Sultan Hamengku Buwono IX sebagai Raja Keraton Ngayogyakarta Hadiningrat mengirimkan surat kepada Letnan Jenderal Soedirman untuk meminta izin diadakannya serangan. Jenderal Sudirman menyetujuinya dan meminta Sri Sultan HB IX untuk berkoordinasi dengan Letkol Soeharto yang saat itu menjabat sebagai Komandan Brigade 10/Wehrkreise III.<br />\r\n<br />\r\nSetelah perencanaan yang matang, tanggal 1 Maret 1949, pagi hari, serangan secara besar-besaran yang serentak dilakukan di seluruh wilayah Yogyakarta dan sekitarnya dimulai, dengan fokus serangan adalah Ibukota Republik, Yogyakarta. Pagi hari sekitar pukul 06.00 WIB, sewaktu sirene dibunyikan serangan segera dilancarkan ke segala penjuru kota. Dalam penyerangan ini Letkol Soeharto langsung memimpin pasukan dari sektor barat sampai ke batas Malioboro. Sektor Timur dipimpin Ventje Sumual, sektor selatan dan timur dipimpim Mayor Sardjono, sektor utara oleh Mayor Kusno. Untuk sektor kota sendiri ditunjuk Letnan Amir Murtono dan Letnan Masduki sebagai pimpinan. TNI berhasil menduduki kota Yogyakarta selama 6 jam. Tepat pukul 12.00 siang, sebagaimana yang telah ditentukan semula, seluruh pasukkan TNI mundur.<br />\r\n<br />\r\nBerhasilnya Serangan Umum 1 Maret ini meskipun hanya mampu menguasai Yogyakarta selama enam jam telah membuktikan bahwa eksistensi tentara Indonesia masih ada. Situasi ini membawa dampak yang sangat besar bagi pihak Indonesia yang sedang bersidang di Dewan Keamanan Perserikatan Bangsa-Bangsa (PBB). Serangan ini sekaligus memperkuat posisi tawar Indonesia dalam perundingan di Dewan Keamanan PBB. Saat ini Monumen Serangan Umum 1 Maret ini merupakan salah satu landmark dan cagar budaya Kota Yogyakarta sebagai bangunan yang mengingatkan tentang sejarah perjuangan bangsa Indonesia melawan penjajah pada masa lalu. Meskipun peristiwa Serangan Umum 1 Maret telah lama berlalu, sejarah tetap mencatatnya sebagai peristiwa bersejarah bangsa Indonesia.</p>\r\n</body>\r\n</html>\r\n', '', '1 March 1949 General Offensive Monument', '', 'Monumen Serangan Umum 1 Maret 1949 merupakan monumen untuk memperingati perjuangan Tentara Nasional Indonesia (TNI) bersama rakyat pada tanggal bersejarah tersebut. Seperti dikutip dari Laman Museum Benteng Vredeburg, serangan umum 1 Maret 1949 merupakan sebuah respons atas Agresi Militer Belanda ke-II yang menjadikan Yogyakarta sebagai sasaran utamanya. Saat ini Monumen Serangan Umum 1 Maret ini merupakan salah satu landmark dan cagar budaya Kota Yogyakarta sebagai bangunan yang mengingatkan tentang sejarah perjuangan bangsa Indonesia melawan penjajah pada masa lalu. Meskipun peristiwa Serangan Umum 1 Maret telah lama berlalu, sejarah tetap mencatatnya sebagai peristiwa bersejarah bangsa Indonesia. ', '', 1, 'location', 'cdn/2023/10/monumen-satu-maret-2.jpg', 'Jl. Margo Mulyo No.6, Ngupasan, Gondomanan, Yogyakarta City, Special Region of Yogyakarta 55122, Ind', '-7.801012399999999', '110.36533759999999', '1 March 1949 General Offensive Monument', '1 March 1949 General Offensive Monument', '1 March 1949 General Offensive Monument', 1, 0, '00:45:00', 2700, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(82, 'museum-of-dewantara-kirti-griya', 1000, '2023-02-10 22:19:15', '2023-10-08 22:33:40', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Berikut beberapa koleksi yang disimpan di Museum Dirgantara: Pesawat Ki-43 buatan Jepang Pesawat PBY-5A (Catalina). Replika pesawat WEL-I RI-X (pesawat pertama hasil produksi Indonesia) Pesawat A6M5 Zero Sen buatan Jepang. Pesawat pembom B-25 Mitchell, B-26 Invader, TU-16 Badger. Helikopter Hillier 360 buatan AS. Pesawat P-51 Mustang buatan AS. Pesawat KY51 Cureng buatan Jepang. Replika pesawat Glider Kampret buatan Indonesia. Pesawat TS-8 Dies buatan AS. Pesawat Lavochkin La-11, Mig-15, MiG-17 dan MiG-21 buatan Russia. Rudal SA-75. Tiket Masuk dan Jam Buka Harga tiket masuk Museum Dirgantara dibanderol sebesar Rp 6.000, dan dapat dikunjungi setiap hari. Jam buka Museum Dirgantara yaitu pukul 08.00 sampai dengan 16.00 WIB, setiap hari Senin-Minggu. Ada beberapa syarat berkunjung ke Museum Dirgantara, antara lain: Anak-anak harus didampingi orang tua Wajib memindai Aplikasi PeduliLindungi Wajib menggunakan masker Wajib menggunakan sarung tangan saat melintasi pos jaga Mematuhi protokol kesehatan</p>\r\n</body>\r\n</html>\r\n', '', 'Museum of Dewantara Kirti Griya', '', 'Koleksi di Museum Dirgantara berisi benda-benda bersejarah yang berkaitan dengan Angkatan Udara Indonesia. Selain itu, museum ini juga menyimpan sejumlah foto tokoh-tokoh sejarah Angkatan Udara Indonesia, serta diorama peristiwa penting di masa lalu. Sejumlah pesawat tempur dan replika yang ada di museum ini kebanyakan berasal dari masa Perang Dunia II dan Revolusi Kemerdekaan Indonesia.', '', 1, 'location', 'cdn/2023/10/museum-ki-hajar-dewantara-yogyakarta.jpg', 'Jl. Taman Siswa No.31, Wirogunan, Mergangsan, Yogyakarta City, Special Region of Yogyakarta 55151, I', '-7.8054438', '110.3784719', 'Museum of Dewantara Kirti Griya', '', 'Museum of Dewantara Kirti Griya', 0, 5000, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(83, 'taman-pelangi-jogja-1', 1000, '2023-02-10 22:19:15', '2023-10-09 18:47:58', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Taman Pelangi, begitulah nama untuk taman yang ada di pelataran Monumen Jogja Kembali ini. Didesain mengelilingi taman, bermacam bentuk dan warna lampion menghiasi pelataran. Ada dua sisi pintu masuk, barat dan timur. disarankan masuklah melalui pintu timur karena dari situ kita akan langsung disambut lampion besar berbentuk pelangi yang sekaligus menjadi pintu gerbang menuju negeri lampion. Memasuki taman, kita akan melewati sebuah rute yang dipenuhi lampion aneka bentuk dan warna mulai dari flora, fauna, tokoh-tokoh kartun Jepang dan Disney, bahkan wajah-wajah para pemimpin republik ini, yang juga terbuat dari lampion. Penataannya pun bervariasi, ada yang seperti ditanam di dalam tanah, menempel di dinding, bergantungan, atau berbaris seperti prajurit berjajar rapi. Sambil menikmati malam yang penuh warna, kita juga bisa mencoba bemacam wahana mulai dari trampolin, becak mini, perahu dayung, bola air, speed boat, bom bom car, dan lain sebagainya. Dilihat dari atas, komplek Monumen Jogja Kembali ini tampak seperti mandala dengan 4 bagian kolam yang mengelilinginya. Nah, di kolam-kolam inilah kita bisa menikmati wahana air yang tersedia. Ingin yang lebih menegangkan? Masuk saja ke Puri Hantu. Entah apa di dalamnya karena kami tak cukup nyali untuk memasukinya. Bila malas berkeliling jalan kaki, tersedia juga kereta safari yang akan mengantar kita menjelajah seluruh rute hingga akhir.</p>\r\n\r\n<p>Taman Pelangi Monjali boleh dibilang tempat rekreasi yang cukup lengkap. Selain menawarkan romantisme malam bertabur lampion warna-warni dan bermacam wahana permainan, di sini juga ada food court yang bisa menjadi tempat melepas lelah sambil mengisi perut.</p>\r\n</body>\r\n</html>\r\n', '', 'Taman Pelangi Jogja', '', 'Kata orang kita harus menunggu hujan untuk bisa melihat pelangi, dan itu pun hanya di siang hari. Tapi di taman ini kita tak perlu menunggu hujan apalagi matahari, karena pelangi di sini akan terus ada setiap hari bahkan setelah mentari terbenam. Ya, pelangi ini memang bukan pelangi biasa karena diwujudkan dalam bentuk lampion.', '', 1, 'location', 'cdn/2023/10/taman-pelangi.jpg', 'Jl. Ring Road Utara, Jongkang, Sariharjo, Ngaglik, Sleman Regency, Special Region of Yogyakarta 5528', '-7.7503027', '110.36949879999999', 'Taman Pelangi Jogja', '', 'Taman Pelangi Jogja', 0, 20000, '01:00:00', 3600, 4.3, 'D.I. Yogyakarta', 0, 0, 0),
(84, 'sewu-temple-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:52:49', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Candi Sewu terletak di Kompleks Candi Prambanan, tepatnya di Jalan Raya Solo KM. 16 Klurakbaru, Tlogo, Kalasan, Sleman, Daerah Istimewa Yogyakarta. Candi Sewu berada 800 meter di utara Candi Prambanan. Tidak ada salahnya jika berkunjung ke Candi Prambanan, juga melihat keelokkan Candi Sewu.<br />\r\nCandi ini dikenal dengan nama Candi Sewu. Kata &lsquo;sewu&rsquo; artinya seribu dalam bahasa Jawa. Penamaan candi ini berkaitan erat dengan legenda Roro Jonggrang dan Bandung Bondowoso. Dimana untuk meminang Roro Jonggrang, Bandung Bondowoso harus membuat 1000 candi dalam semalam. Namun berdasarkan prasasti yang ditemukan, nama asli candi ini adalah Prasada Vajrasana Manjusrigrha.<br />\r\nCandi Sewu didirikan pada abad ke-8, pada masa dinasti Syailendra. Pembangunan Candi Sewu dimulai oleh Rakai Panangkaran dari kerajaan Mataram Kuno, yang kemudian dilanjutkan oleh Rakai Pikatan dari dinasti Sanjaya. Di mana Rakai Pikatan ini menikah dengan salah satu puteri dari Dinasti Syailendra. Candi Sewu kemudian diselesaikan pada masa dinasti Sanjaya.<br />\r\nCandi Sewu memiliki corak Buddha. Oleh sebab itu, pada masa Dinasti Syailendra, Candi Sewu menjadi pusat ibadah umat Buddha. Berbeda dengan Candi Prambanan yang memilliki corak Hindhu. Walau begitu, kedua candi yang bersandingan ini menunjukkan bahwa pada zaman dahulu, keharmonisan tercipta antar kedua penganut agama tersebut.<br />\r\nKompleks Candi Sewu memiliki panjang 185 meter dari sisi utara ke sisi selatan dan lebar 165 meter dari sisi timur ke sisi barat. Candi Sewu memiliki pintu masuk pada masing-masing penjuru mata angin, yaitu utara, selatan, barat dan timur. Namun, tampaknya pintu utama berada di sisi timur. Pada tiap pintu masuk, dijaga oleh arca raksasa yang bernama Drawapala. Arca ini berdiri kokoh dengan tinggi mencapai 2 meter dan saling berhadapan. Bangunan Candi Sewu seluruhnya terbuat dari batu andesit.<br />\r\nWalaupun bernama Candi Sewu, aslinya hanya ada 249 candi di sini. Candi Sewu memiliki candi utama yang dikelilingi candi-candi kecil. Candi utama ini memiliki diameter 29 meter dan tinggi 30 meter yang terletak di tengah-tengah. Sedangkan candi-candi kecil yang mengelilingi candi utama, dinamakan Candi Perwara dan Candi Penjuru. Kedua jenis candi ini berada di pelataran luar Candi Utama. Namun sayangnya, baik Candi Perwara maupun Candi Penjuru, banyak yang tidak utuh atau berupa bongkahan.<br />\r\nBanyak aktivitas yang bisa dilakukan di Candi Sewu. Pengunjung bisa berkeliling sambil melihat-lihat dan memotret candi di Candi Sewu. Atau pengunjung bisa menyewa sepeda dan berkeliling di kawasan Candi Sewu hingga kawasan Candi Prambanan. Adapula Museum Candi Sewu sebagai wisata edukasi. Di museum ini, pengunjung akan mendapatkan pengetahuan lebih tentang Candi Sewu, pemugaran candi-candi tersebut, hingga pemutaran film sejarah.<br />\r\nUntuk tiket masuk Candi Sewu dijadikan satu dengan kawasan Candi Prambanan. Satu tiket dewasa dibanderol Rp40.000 dan satu tiket anak-anak dibanderol Rp20.000. Jam buka Candi Sewu mengikuti jam buka kawasan Candi Prambanan, yaitu pukul 08.00 hingga 17.00. Saat akhir pekan, kawasan candi bisa jadi sangat ramai oleh wisatawan. Lebih baik datang saat hari biasa atau datang lebih awal ya! Siapkan pula topi atau payung, karena kawasan candi ini cukup panas di siang hari.</p>\r\n</body>\r\n</html>\r\n', '', 'Sewu Temple', '', 'Candi Sewu adalah candi Buddha yang dibangun pada abad ke-8 Masehi yang berjarak sekitar delapan ratus meter di sebelah utara Candi Prambanan. Candi Sewu merupakan kompleks candi Buddha terbesar kedua setelah Candi Borobudur di Jawa Tengah. Dikenal dengan nama asli Manjusri grha (Rumah Manjusri), Candi Sewu berusia lebih tua daripada Candi Borobudur dan Prambanan. Meskipun aslinya memiliki 249 candi, oleh masyarakat setempat candi ini dinamakan \"Sewu\" yang berarti seribu dalam bahasa Jawa. Penamaan ini berdasarkan kisah legenda Loro Jonggrang. Secara administratif, kompleks Candi Sewu terletak di Dukuh Bener, Desa Bugisan, Kecamatan Prambanan, Kabupaten Klaten, Provinsi Jawa Tengah.', '', 1, 'location', 'cdn/2023/10/18.jpg', 'Jl. Raya Solo - Yogyakarta No.KM.16, Bugisan, Prambanan, Sleman Regency, Special Region of Yogyakart', '-7.7439217', '110.4929095', 'Sewu Temple', '', 'Sewu Temple', 0, 20000, '01:30:00', 5400, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(85, 'xt-square-1', 1000, '2023-02-10 22:19:15', '2023-10-09 20:12:15', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>XT Square (XT berasal dari kata Eks Terminal) merupakan direktori Pasar Seni dan Kerajinan Yogyakarta (PSKY) yang berada di kawasan Umbulharjo Yogyakarta. Mantan Wali Kota Yogyakarta, Herry Zudianto, kala itu mengungkapkan bahwa Pemkot telah membangun pusat perbelanjaan yang dikelola profesional serta modern namun terjangkau untuk UKM dan UMKM.</p>\r\n\r\n<p>XT Square terdiri atas 3 zona utama, yaitu zona kerajinan (1 &amp; 2), zona nusantara dan zona kuliner.</p>\r\n\r\n<ol>\r\n	<li>Zona Kerajinan<br />\r\n	Wahana representasi seni kerajinan dari Kota Yogyakarta dan wilayah sekitarnya. Zona Kerajinan meliputi 264 kios terwadahi dalam bangunan yang dirancang secara unik sebagai wajah kawasan XT-Square. Bangunan terdiri atas dua unit yaitu unit Kerajinan - 1 yang mewadahi 200 kios , dan unit Kerajinan -2 yang mewadahi 64 kios.</li>\r\n	<li>Zona Nusantara<br />\r\n	Merupakan wahana representasi dari seni kerajinan dari seluruh nusantara. Zona ini terdiri dari 20 buah kios toko dengan fasilitas premium. Produk kerajinan ini berasal dari binaan pemerintah daerah yang berkualitas unggul, sehingga memiliki daya tarik dan keunikan tersendiri. Pada zona ini dilengkapi dengan area atrium dengan luas 16 x 25 m yang selain sebagai ruang pameran/expo, juga sebagai tempat demo pembuatan kerajinan. Pengunjung XT Square berasal dari semua kalangan, diharapkan dapat mendapatkan hasil seni kerajinan nusantara dengan nyaman dan buka hingga malam hari.</li>\r\n	<li>Zona Kuliner<br />\r\n	Tempat ini merupakan daya tarik dikawasan XT-Square. Zona ini meliputi 13 food stall yang berukuran standar maupun besar, dining area mampu menampung hingga 350 orang. Terdapat panggung pertunjukan untuk memberikan wahana ekspresi seni bagi seniman Yogyakarta maupun nasional. Bangunan zona kuliner dirancang untuk menjadi ikon kawasan.</li>\r\n</ol>\r\n</body>\r\n</html>\r\n', '', 'XT Square', '', 'Kawasan wisata ini memiliki keunikan tersendiri yaitu menyatukan tiga kebutuhan wisata masyarakat dalam satu tempat.Terdapat tiga zona wisata di XT Square: zona kerajinan, zona kuliner dan zona nusantara. Di zona kuliner Anda bisa menemukan berbagai kios yang menjual kerajinan khas Jogja. Zona kuliner merupakan wilayah favorit para pengunjung. Terdapat berbagai kios yang menjual makanan khas Jogja. Menikmati kuliner yang tentunya menggugah selera dengan harga yang pastinya murah meriah.', '', 1, 'location', 'cdn/2023/10/xt-square.jpg', 'Jl. Veteran No.150-151, Pandeyan, Umbulharjo, Yogyakarta City, Special Region of Yogyakarta 55161, I', '-7.816705499999999', '110.3862889', 'XT Square', '', 'XT Square', 0, 15000, '01:00:00', 3600, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
(86, 'mandira-baruga', 1000, '2023-02-10 22:19:15', '2023-10-08 22:22:08', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pertunjukan Ramayana Ballet Purawisata telah ditampilkan full story sejak tahun 1976. Kamu akan menyaksikan Ramayana Ballet yang dipentaskan di dalam amphitheater dengan kapasitas 600 kursi. Konsep semi terbuka dari amphitheater ini memberikan kenyamanan bagi kamu yang akan menyaksikan pertunjukan Ramayana Ballet. Selain menyaksikan Ramayana Ballet, pengelola juga menawarkan paket makan malam istimewa di restoran yang menggabungkan suasana taman indah dengan arsitektur Jawa yang megah.</p>\r\n</body>\r\n</html>\r\n', '', 'Mandira Baruga', '', 'Mandira Baruga Yogyakarta atau dahulu dikenal sebagai Purawisata merupakan Jogja Integrated Destination yang dapat ditemukan di tengah Kota Yogyakarta dengan area seluas 3,5 hektar. Daya tarik dari kawasan wisata ini adalah pertunjukan Ramayana Ballet Purawisata. Pertunjukan yang mengisahkan tentang cinta sejati Rama dan Shinta tersebut merupakan kombinasi menakjubkan dari penari yang telah berdedikasi selama puluhan tahun, kostum yang indah serta alunan musik gamelan yang mengiringi menjadi satu dalam panggung.', '', 1, 'location', 'cdn/2023/10/mandira.jpg', 'Jl. Brigjen Katamso Jl. Ireda, Keparakan, Mergangsan, Yogyakarta City, Special Region of Yogyakarta ', '-7.808978799999999', '110.3707148', 'Mandira Baruga', '', 'Mandira Baruga', 0, 0, '01:00:00', 3600, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
(87, 'sasana-wiratama-monument-museum-of-prince-diponegoro-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:43:10', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Terletak sekitar 4 kilometer dari pusat kota Jogja, tanah seluas 2,5 hektar yang awalnya dikelola oleh Dinas Pariwisata dan Kebudayaan, diserahkan oleh ahli waris Pangeran Diponegoro, Raden Ayu Kanjangteng Diponegoro, untuk dijadikan Monumen setelah menandatangani surat penyerahan bersama Nyi Hadjar Dewantara dan Kanjeng Raden Tumenggung Purejodiningrat. Di atas tanah yang kini menjadi milik Kraton Yogyakarta itu mulai pertengahan tahun 1968 hingga 19 agustus 1969 dibangun sebuah monumen pada bangunan pringgitan yang menyatu dengan pendopo tepat di tengah komplek yang diprakarsai oleh Mayjen Surono yang saat itu menjabat Panglima Kodam (PANGDAM) serta diresmikan oleh Presiden Suharto. Tempat ini kemudian dinamakan Sasana Wiratama yang artinya tempat prajurit.<br />\r\nDi depan bangunan yang terletak di jalan H.O.S Cokroaminoto di Desa Tegalrejo, terdapat patung Letjen Urip Soemohardjo yang bertuliskan &quot;Orde. Contre-Ordre. Desordre!&quot; pada sisi timur serta Panglima Besar Jenderal Sudirman bertuliskan &quot;Jangan Lengah&quot; di sisi barat. Patung ini hanya perlambang sebagai suatu tempat untuk mengenang perjuangan Bangsa Indonesia mencapai kemerdekaan. Setelah melewati gerbang terdapat sebuah dinding setinggi dua setengah meter lebih berbentuk seperti kubah mesjid di bagian atas bergambar sesosok raksasa melawan seekor naga. &quot;Gambar tersebut bermakna Butho Mekso Basuki ning Bawono yang merupakan Suryo Sengkolo Memet, sengkalan yang memakai gambar&quot; tutur Pak Budiman pada YogYES. Setiap Sengkalan yang telah diketahui artinya dibaca secara terbalik. Sengkalan yang berarti 5281 ini mempunyai makna 1825 sebagai tanda pecahnya perang Pangeran Diponegoro.<br />\r\nKoleksi Museum Diponegoro berjumlah 100 buah, yang terdiri dari berbagai senjata asli laskar Diponegoro mulai dari senjata perang, koin, batu akik hingga alat rumah tangga. Berbagai senjata seperti tombak, keris, pedang, panah, &quot;bandil&quot; (semacam martil yang terbuat dari besi), &quot;patrem&quot; (senjata prajurit perempuan), hingga &quot;candrasa&quot; (senjata tajam yang bentuknya mirip tusuk konde) yang biasa digunakan &quot;telik sandi&quot; (mata-mata) perempuan. Sedangkan sejumlah alat rumah tangga buatan tahun 1700-an yang terbuat dari kuningan terdiri dari tempat sirih dan &quot;kecohan&quot;-nya (tempat mebuang ludah), tempat &quot;canting&quot; (alat untuk membatik), teko &quot;bingsing&quot;, bokor hingga berbagai bentuk &quot;kacip&quot; (alat membelah pinang untuk makan sirih).<br />\r\nDi museum ini juga tersimpan dua senjata keramat, yaitu sebuah keris dengan lekukan 21 bernama Kyai Omyang, buatan seornag empu yang hidup pada masa Kerajaan Majapahit dan pedang yang berasal dari Kerajaan Demak. Kedua senjata tersebut dipercaya dapat menolak bala.</p>\r\n\r\n<p>Selain itu juga terdapat sebuah patung Ganesha berukuran kecil, tali Kuda untuk menarik kereta kuda pemberian HB VIII, sepasang patung Loro Blonyo serta sepasang lampu hias. Di dalam pendopo bisa dilihat seperangkat alat gamelan milik HB II buatan tahun 1752 berupa ketipung (gendang kecil) dan wilahan boning penembung yang terbuat dari kayu dan perunggu berwarna merah dan kuning. Seluruh &quot;wilahan&quot; atau besinya masih asli, hanya kayu gamelan saja yang sudah diganti karena lapuk termakan usia. Juga terdapat sepasang meriam di depan serta satu meriam di sebelah timur pendopo.<br />\r\nSelain tembok jebol, Padasan dan Batu Comboran, peninggalan pangeran lainnya terdapat di Magelang (Kitab Al Qur&#39;an, Cangkir dan Teko, Jubah Pangeran serta Empat Kursi Satu Meja), di Museum Satria Mandala Jakarta (Pelana Kuda dan Tombak) serta sebuah keris milik Pangeran yang belum dikembalikan dan masih disimpan di Belanda.</p>\r\n</body>\r\n</html>\r\n', '', 'Sasana Wiratama Monument Museum of Prince Diponegoro', '', 'Pangeran Diponegoro Monumen Sasana Wiratama Museum adalah museum khusus dengan koleksi berupa peninggalan-peninggalan Pangeran Diponegoro. Pengelolaannya dilakukan oleh Yayasan Sasana Wiratama.', '', 1, 'location', 'cdn/2023/10/14.jpg', 'Jl. HOS Cokroaminoto TR-III/430, Tegalrejo, Tegalrejo, Kec. Tegalrejo, Kota Yogyakarta, Daerah Istim', '-7.7865891', '110.35144729999999', 'Sasana Wiratama Monument Museum of Prince Diponegoro', '', 'Sasana Wiratama Monument Museum of Prince Diponegoro', 0, 0, '00:45:00', 2700, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
(88, 'jogokariyan-mosque', 1000, '2023-02-10 22:19:15', '2023-10-09 01:21:31', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Masjid Jogokariyan terletak di Jalan Jogokaryan, No. 36, Mantrijeron, Kota Yogyakarta, Daerah Istimewa Yogyakarta, DIY. Masjid ini merupakan salah satu masjid yang ramai dikunjungi untuk melakukan sholat berjamaah ketika subuh. Bagaimana latar belakang dari Masjid Jogokariyan?<br />\r\n<br />\r\nMasjid ini berdiri sejak Agustus 1967 yang telah diresmikan oleh ketua Pimpinan Daerah Muhammadiyah (PDM) Kota Yogyakarta. Tanah seluas 600m2 dibeli oleh masyarakat atas bantuan pengusaha batik yang tergabung dalam Koperasi Batik Karang Tunggal dan Koperasi Tenun Tri Jaya.<br />\r\n<br />\r\nIde dalam pembangunan Masjid Jogokariyan berawal dari seorang pengusaha batik asal Karangkajen bernama H. Jazuli yang kebetulan memiliki rumah di kampung Jogokariyan. Kemudian, dengan niatnya yang ingin membangun masjid, disampaikanlah kepada tokoh masyarakat setempat, seperti Bapak Zarkoni, Bapak Abdul Manan, H. Amin Said (satu-satunya warga yang sudah menjalankan ibadah haji pada tahu 1957 di tempat itu), Bapak Hadits Hadi Sutarno, KRT Widyodiningrat, Ibu Margoni, dan beberapa tokoh yang lain.<br />\r\n<br />\r\nMasjid ini memiliki keunikan yaitu tidak membuang unsur budaya setempat dalam pembangunan masjidnya. Hal tersebut dapat dilihat pada logo masjidnya yang menggunakan tiga bahasa, yaitu Bahasa Arab, indonesia, dan Jawa.<br />\r\n<br />\r\nPada tahun 2016, Kementeian Agama Republik Indonesia Masjid Jogokariyan ditetapkan sebagai salah satu masjid percontohan dalam bidang pengelolaan masjid (idarah). Ustaz H. Muhammad Jazir ASP menjelaskan bahwa dalam penetapan Masjid Jogokariyan sebagai masjid percontohan telah melalui beberapa seleksi. Mulai dari tingkat kecamatan, kota, provinsi, dan tingkat nasional.<br />\r\n<br />\r\nMasjid ini memiliki keunikan yaitu tidak membuang unsur budaya setempat dalam pembangunan masjidnya. Hal tersebut dapat dilihat pada logo masjidnya yang menggunakan tiga bahasa, yaitu Bahasa Arab, indonesia, dan Jawa.</p>\r\n</body>\r\n</html>\r\n', '', 'Jogokariyan Mosque', '', 'Masjid Jogokariyan merupakan sebuah masjid yang terletak di Kampus Jogokariyan, berlokasi di Jalan Jogokariyan No. 36, Kecamatan Mantirjeron, Kota Yogyakarta. Masjid ini milai dibangun pertama kali pada 20 September 1965.  Masjid Jogokariyan memmiliki jangkauan syiar yang terdiri atas 4 RW (RW 9-12) dan 18 RT (30-47).', '', 1, 'location', 'cdn/2023/10/jogokariyan-mosque.jpg', 'Jl. Jogokaryan No.36, Mantrijeron, Yogyakarta City, Special Region of Yogyakarta 55143, Indonesia', '-7.824260799999999', '110.3644095', 'Jogokariyan Mosque', '', 'Jogokariyan Mosque', 1, 0, '01:00:00', 3600, 4.8, 'D.I. Yogyakarta', 0, 0, 0),
(89, 'soko-tunggal-mosque', 1000, '2023-02-10 22:19:15', '2023-10-08 21:58:18', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Berkunjung ke objek wisata Tamansari Kelurahan Patehan, Kemantren Kraton pasti akan tertuju pada salah satu bangunan masjid di depan pintu masuk. Sebuah masjid dengan arsitektur unik dan menarik milik Kraton Yogyakarta.&nbsp;<br />\r\nDisebut Soko Tunggal karena hanya ada satu tiang penyangga di masjid tesebut padahal dalam bangunan tradisional Jawa biasanya terdapat empat tiang penyangga. Kondisi itu menjadikan masjid Soko Tunggal menjadi unik dan tiada duanya. Masjid Soko Tunggal dibangun atas inisiatif warga sekitar diatas tanah wakaf Sri Sultan Hamengku Buwana IX dan pembangunannya dibantu Presiden Suharto. Selesai pembangunannya pada Jumat Pon tanggal 21 Rajab tahun Be/1392 H &nbsp;yang ditandai dengan candra sengkala &ldquo;Hanembah Trus Gunaning Janma&rdquo; dan suryo sengkolo &quot;Nayana Resi Anggatra Gusti&quot; (1 September 1972 M).<br />\r\nMasjid Soko Tunggal juga dihiasi dengan aneka ukiran seperti Praba yang berarti bumi atau wibawa, Saton yang berarti sawiji, Sorot yang berarti sinar cahaya matahari, ukiran Tlancap yang berarti tabah, Ceplok-ceplok yang berarti pemberantas angkara murka, Mirong yang berarti nisan dan dimaknai smua orang kelak akan meninggal dunia. Tetesan embun diantara daun dan bunga yang terdapat di balok ileng berarti siapa yang salat di masjid akan mendapat anugerah Alloh SWT.<br />\r\nSedangkan dari aspek konstruksi bangunan juga memiliki makna filosofi yang dalam seperti bagian yang berbentuk bahu dayung yang dimaknai bahwa orang yang salat di masjid ini akan menjadi orang yang kuat menghadapi godaan iblis yang datang dari empat penjuru dan lima pancer. Sunduk berarti menjalar dalam mencapai tujuan, Santen berarti kejujuran, Uleng berarti wibawa, Singup artimya keramat, Bandoga tempat harta karun, Tawonan berarti gana, manis.<br />\r\nDemikian juga dengan rangka-rangkanya juga memiliki makna misalnya, Saka Brunjung dilambangkan sebagai upaya mencapai keluhuran wibawa melalui lambang tawonan, Dudur merupakan lambang cita-cita kesempurnaan hidup &nbsp;melalui unsir Bandoga dan Balok atau Soko bindi lambang cita-cita kesempurnaan hidup melalui lambang gonjo.</p>\r\n</body>\r\n</html>\r\n', '', 'Soko Tunggal Mosque', '', 'Masjid Saka Tunggal adalah sebuah masjid yang terletak di kawasan Tamansari, Kelurahan Patehan Kecamatan Kraton, Kota Yogyakarta. Berada di kawasan Njeron Beteng Kraton Yogyakarta, masjid ini berada tepat di depan pintu masuk objek wisata Tamansari. Disebut Soko Tunggal karena hanya ada satu tiang penyangga di masjid tesebut padahal dalam bangunan tradisional Jawa biasanya terdapat empat tiang penyangga. Kondisi itu menjadikan masjid Soko Tunggal menjadi unik dan tiada duanya.', '', 1, 'location', 'cdn/2023/10/21.jpg', 'Jl. Taman 1 No.318, Patehan, Kraton, Yogyakarta City, Special Region of Yogyakarta 55133, Indonesia', '-7.810374599999999', '110.3606882', 'Soko Tunggal Mosque', '', 'Soko Tunggal Mosque', 0, 0, '01:30:00', 5400, 4.8, 'D.I. Yogyakarta', 0, 0, 0),
(90, 'maritime-museum-jogja', 1000, '2023-02-10 22:19:15', '2023-10-08 22:25:01', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Kehadiran museum bertema maritim di tengah persoalan yang sedang dihadapi bangsa Indonesia &nbsp;pudarnya budaya dan pola pikir maritim &nbsp;sangat relevan. Budaya maritim yang begitu kaya membutuhkan ruang untuk terus lestari dan berkembang. Kekayaan dan keberagaman budaya maritim akan hilang apabila tidak dikomunikasikan kepada khalayak dan diberi ruang untuk terus hidup. Terlebih lagi, di tengah dinamika sosial dan budaya yang berkembang begitu cepat, museum bertema maritim dapat menjadi media alternatif pendidikan non-formal yang berfungsi untuk merekonstruksi pola pikir maritim dan wawasan Nusantara. Hal itu ditegaskan oleh Sutan Takdir Alisjahbana dalam tulisannya yang mengatakan bahwa museum sebagai alat pendidikan zaman modern akan senantiasa menyesuaikan dengan perkembangan dunia modern itu sendiri.[3] Sama seperti museum-museum pada umumnya, museum bertema maritim di Indonesia juga memiliki tanggung jawab dan fungsi untuk melestarikan, membina, sekaligus mengembangkan budaya maritim baik yang berwujud maupun yang tidak berwujud. Melalui pesan-pesan yang dirangkai lewat display dan ruang pameran, museum bertemakan maritim di Indonesia berfungsi sebagai sarana komunikasi dan jembatan penghubung yang dapat memicu kesadaran dan pengetahuan bagi masyarakat.</p>\r\n\r\n<p>Keberadaan museum bertema maritim di Indonesia menjadi sangat penting mengingat museum tidak hanya memiliki fungsi sebagai pelindung benda cagar budaya, melainkan juga sebagai tempat pembentukan ideologi, disiplin, dan pengembangan pengetahuan bagi publik. Hal itu juga ditegaskan dalam kode etik ICOM, &nbsp;Museum memiliki tugas penting untuk mengembangkan peran pendidikan dan menarik pengunjung lebih luas dari kalangan masyarakat, lokalitas, atau kelompok yang dilayaninya. Interaksi dengan masyarakat pendukung dan pembinaan serta promosi warisan yang diampunya merupakan bagian integral dari pendidikan yang harus dilaksanakan oleh museum.</p>\r\n</body>\r\n</html>\r\n', '', 'Maritime Museum - Jogja', '', 'Museum Maritim adalah museum yang menjadikan aspek kemaritiman sebagai tema utamanya. Di dalam museum maritim, dipamerkan berbagai benda bersejarah seperti kapal, lukisan, senjata angkatan laut, atau benda-benda lain yang berhubungan dengan dunia maritim.', '', 1, 'location', 'cdn/2023/10/maritime.jpg', 'Jl. R. E. Martadinata No.69, Wirobrajan, Bantul Regency, Special Region of Yogyakarta 55182, Indones', '-7.801140599999999', '110.3493008', 'Maritime Museum - Jogja', '', 'Maritime Museum - Jogja', 0, 2000, '01:00:00', 3600, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
(91, 'indonesian-education-museum-1', 1000, '2023-02-10 22:19:15', '2023-10-09 01:17:22', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Museum Pendidikan Indonesia atau MPI didirikan sebagai dedikasi bagi Universitas Negeri Yogyakarta (UNY). Melalui museum ini disampaikan bahwa kejayaan bangsa ini merupakan hasil dari harmonisasi antara tujuan perjuangan dan semangat untuk menuntut ilmu.<br />\r\n<br />\r\nMuseum Pendidikan Indonesia dibangun sebagai bentuk penghargaan bagi para perintis, tokoh, dan pejuang pendidikan nasional. Museum ini banyak menyimpan koleksi mengenai perkembangan pendidikan di Indonesia. Museum ini menjadi museum pendidikan pertama yang dibangun di Indonesia. Museum ini dibangun oleh Gubernur Daerah Istimewa Yogyakarta, Sri Sultan Hamengku Buwono X dan dibangun atas gagasan oleh Prof. Dr. Sugeng Mardiono, Phd., Rektor Universitas Negeri Yogyakarta.<br />\r\n<br />\r\nTerdapat beberapa foto menteri pendidikan Indonesia dari yang pertama kali menjabat, diorama ruang kelas tahun 1960-an, peralatan tulis kuno, replika sepeda guru, dan foto sejarah pendidikan di Indonesia. Museum ini juga menyediakan ruang pembelajaran media berisi berbagai peralatan yang digunakan sebagai media pembelajaran baik elektronik maupun manual.<br />\r\n<br />\r\nDi Museum Pendidikan Indonesia ini juga terdapat sebuah ruang cinema. Ruang tersebut berkapasitas 116 tempat duduk dan sudah dilengkapi dengan dolby sound system dengan koleksi berbagai film-film bertema pendidikan.</p>\r\n</body>\r\n</html>\r\n', '', 'Indonesian Education Museum', '', 'Sudah lebih dari 10 tahun Museum Pendidikan Indonesia (MPI) menjadi salah satu destinasi wisata pendidikan di Yogyakarta. Upaya pengembangan museum terus dilakukan oleh Universitas Negeri Yogyakarta untuk memperkuat pendidikan karakter sekaligus mendukung citra Yogyakarta sebagai Kota Pelajar dan Kota Budaya. Museum ini mengelola berbagai koleksi, seperti: buku sekolah, arsip kependidikan, media pembelajaran, dan benda-benda bersejarah lainnya. Saat ini, MPI UNY memiliki 6 ruang utama: (1) Ruang Galeri 1 sebagai Ruang Memorabilia UNY, (2) Ruang Galeri 2 berisi peralatan sekolah dan tokoh-tokoh pendidikan, (3) Ruang Galeri 3 berisi koleksi media pembelajaran, (4) Ruang Apresiasi Karya sebagai ruang pameran temporer, (5) Ruang Realia Kelas, dan (6) Ruang Cinema. Selain itu, MPI UNY juga sedang mengembangkan souvenir shop, perpustakaan dan cafe museum. Pengunjung dapat menyaksikan film bertema pendidikan di ruang cinema yang kapasitasnya mencapai 116 kursi dengan kualitas suara dolby surround. Kurator dan edukator museum ini juga siap memandu kunjungan tematik sesuai dengan kebutuhan pengunjung dalam rangka mendukung pembelajaran di sekolah. MPI UNY juga menawarkan paket wisata kampus karena lokasinya berada persis di pusat aktivitas kampus Universitas Negeri Yogyakarta.', '', 1, 'location', 'cdn/2023/10/indonesian-education-museum.jpg', 'Kampus Pusat Universitas Negeri Yogyakarta, Jalan Colombo No. 1,, Caturtunggal,, Depok,, Karang Mala', '-7.774809599999999', '110.38720149999999', 'Indonesian Education Museum', '', 'Indonesian Education Museum', 1, 2500, '01:30:00', 5400, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(92, 'kampoeng-gerabah-kasongan', 1000, '2023-02-10 22:19:15', '2023-10-09 01:23:58', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Menurut cerita yang beredar, pada zaman dahulu di Desa Wisata Kasongan ada seekor kuda yang mati di area persawahan milik warga setempat. Kuda yang mati ini ternyata milik seorang perwira Belanda. Singkat cerita, pemilik persawahan ini takut jika nanti akan diberi hukuman oleh tentara Belanda karena kudanya mati di tanah miliknya.<br />\r\n<br />\r\nKarena rasa ketakutan yang besar itulah pemilik lahan melepaskan hak kepemilikan tanah bersama warga lainnya. Dari sini bisa dibayangkan kengerian penjajahan yang dialami oleh warga Indonesia. Mereka bahkan sangat takut hanya karena ada kuda mati milik Belanda di atas tanah mereka. Dapat dibayangkan hukuman yang didapatkan akan sangat menyakiti mereka sampai-sampai hak kepemilikan tanah mereka lepaskan.<br />\r\n<br />\r\nArea persawahan yang sudah dilepaskan hak kepemilikannya, akhirnya diambil oleh warga yang datang dari desa lain. Para penduduk yang baru datang ini melakukan aktivitas baru di desa itu. Aktivitas yang baru ini merupakan kegiatan mengolah tanah liat untuk dijadikan perlengkapan dapur dan dijadikan beberapa mainan untuk anak-anak mereka.<br />\r\n<br />\r\nSetelah mengetahui ketahanan barang yang dibuat dari tanah liat, maka para penduduk ini mulai membuat bentuk lain yang lebih beraneka ragam sesuai dengan kebutuhan. Ada alat perlengkapan dapur, mainan, perlengkapan rumah tangga dan masih banyak lagi. Kerajinan yang mereka buat dari tanah liat ini lalu dikenal dengan sebutan kerajinan tembikar atau gerabah. Mulai dari sinilah kerajinan gerabah diwariskan secara turun temurun di desa ini.<br />\r\n<br />\r\nSejak saat itu, perkembangan kerajinan gerabah di desa ini mulai naik secara signifikan hingga saat ini. Banyak produk yang dihasilkan sesuai dengan pesanan dan minat pasar. Bahkan saat ini bukan hanya kerajinan dari tanah liat yang dihasilkan dari desa ini. Masyarakat juga menggunakan bahan lain di sekitar yang bisa diolah menjadi barang bernilai tinggi, misalnya bambu, rotan, batok kelapa, kayu dan sebagainya.<br />\r\n<br />\r\nPada saat ini desa ini menjadi ikon pusat gerabah daerah Bantul Yogyakarta. Desa Wisata Kasongan mulai dipenuhi pengunjung saat hari libur tiba. Banyak wisatawan yang datang ke tempat ini untuk belajar bagaimana cara mengolah tanah liat.<br />\r\n<br />\r\nAda kerajinan yang sangat terkenal dari desa wisata ini. Patung Loro Blonyo menjadi sebuah tanda jika Anda pernah mengunjungi tempat ini. patung Loro Blonyo berwujud sebagai sepasang pengantin yang menurut kepercayaan bisa membawa keberuntungan apabila ditaruh dalam rumah Anda.<br />\r\n<br />\r\n<strong>Harga Tiket Masuk Desa Wisata Kasongan Jogja</strong><br />\r\nHarga tiket Desa Wisata Kasongan sangat murah meriah. Berapa? Gratis. Anda tidak akan dikenakan biaya tiket masuk jika datang ke tempat ini. Apabila datang ke tempat ini, Anda hanya akan dikenakan biaya parkir sebesar Rp5.000 hingga Rp10.000 saja. Namun jika Anda ingin ikut belajar membuat gerabah sendiri, Anda akan dikenakan biaya sebesar Rp50.000 saja. Hasil gerabah yang Anda buat pun bisa dibawa pulang.</p>\r\n</body>\r\n</html>\r\n', '', 'KAMPOENG GERABAH KASONGAN', '', 'Desa Wisata Kasongan menjadi salah satu wisata yang ikut berperan aktif dalam kepopuleran indahnya Kota Yogyakarta. Lokasi Desa Wisata Kasongan tak pernah sepi oleh pengunjung baik dari dalam negeri maupun dari luar negeri. Objek wisata ini menjadi salah satu sarana untuk melestarikan budaya yang ada di Indonesia.', '', 1, 'location', 'cdn/2023/10/kampoeng-gerabah-kasongan.jpg', 'Jalan Raya Kasongan Sentanan RT.06, Kajen, Bangunjiwo, Kec. Kasihan, Kabupaten Bantul, Daerah Istime', '-7.845220899999999', '110.3374788', 'KAMPOENG GERABAH KASONGAN', '', 'KAMPOENG GERABAH KASONGAN', 0, 0, '00:30:00', 1800, 4.5, 'D.I. Yogyakarta', 0, 0, 0),
(93, 'seribu-batu-songgo-langit-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:48:31', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Berkunjung ke kawasan Kecamatan Dlingo, Kabupaten Bantul, Yogyakarta tak lengkap rasanya bila hanya mengunjungi hutan pinusnya saja. Disekitar hutan pinus ternyata masih banyak tempat wisata yang wajib dikunjungi, salah satunya adalah Seribu Batu Songgo Langit.&nbsp;<br />\r\nNama Seribu Batu Songgo Langit memiliki makna tersendiri. Sebelum jadi tempat wisata, di lokasi ini terdapat ratusan bahkan ribuan batu dan pastinya hutan pinus. Songgo langit berarti penyangga langit, hal ini dikarenakan di Seribu Baru Songgo Langit terdapat bukit yang seakan akan merupakan tiang dari langit .Seribu Batu Songgo Langit merupakan tempat wisata di kawasan Dlingo yang menawarkan berbagai macam atraksi wisata, namun kebanyakan adalah spot foto. Spot foto di Seribu Batu hampir semuanya anti mainstream. Anda akan menemui beberapa spot foto dalam empat bagian di tempat wisata ini.<br />\r\nSpot selanjutnya merupakan spot puncak dari tempat wisata Seribu Batu Songgo Langit, yaitu Bukit Songgo Langit itu sendiri. Berjarak sekitar 800 meter atau hampir 1 kilometer dari rumah Hobbit, anda diharapkan menyiapkan stamina untuk melibas track menuju Songgo Langit. Dalam perjalanan menuju Bukit Songgo Langit, anda akan menikmati hamparan ratusan pohon pinus yang tinggi. Di beberapa titik dalam perjalanan juga telah disiapkan papan petunjuk menuju Bukit Songgo Langit dan beberapa tempat untuk beristirahat.<br />\r\nTidak hanya keseruan dari wahana dan nuansa alam yang ditawarkan, pengunjung juga dapat menghabiskan malam di Seribu Batu Songgo Langit. Pihak pengelola menyediakan area glamping (glamour camping) berupa pengalaman bermalam di hutan dengan fasilitas hotel. Bermalam ditemani dengan nuansa alam yang tenang, udara sejuk dan suara khas hutan di malam hari, tentu saja akan sangat menyenangkan sambil menikmati secangkir kopi atau teh hangat di balkon kamar.<br />\r\nPengunjung akan dikenai tiket masuk Seribu Batu Songgo Langit dengan harga yang terjangkau yaitu sebesar Rp 3.000 per orang. Kendaraan yang dibawa akan dikenai biaya parkir sebesar Rp 2.000 untuk motor, Rp 5.000 untuk mobil, dan Rp 20.000 untuk bus. Bila pengunjung ingin merasakan sensasi bermalam di glampcamp, mereka akan dikenai biaya sebesar Rp 500.000 per kamar dan sudah termasuk 1 meals dan welcome drink.<br />\r\nSeribu Batu Songgo Langit berjarak sekitar 21 km dari pusat kota Jogja dan dapat ditempuh sekitar 40-45 menit dengan kendaraan roda dua, roda empat, atau bus. Dari pusat kota, ambil arah selatan ke Jalan Imogiri Barat. Ikuti jalan dan belok ke arah kiri ke Jalan Bakulan Imogiri lwat area Alun-alun Imogiri. Perjalanan berlanjut ke arah Mangunan dan terus ikuti jalan itu untuk sampai di Seribu Batu Songgo Langit.</p>\r\n</body>\r\n</html>\r\n', '', 'Seribu Batu Songgo Langit', '', 'Seribu Batu Songgo Langit atau juga dikenal dengan Rumah Hobbit berada di Sukarame, Mangunan Dlingo. sesuai dengan namanya, di tempat ini terdapat ribuan batu yang sangat indah dan bisa dijadikan sebagai spot selfie paling favorit. Seribu Batu Songgo Langit memiliki spot foto yang unik dengan nuansa alam, tempat rekreasi dan aktivitas outdoor menarik, hingga bermalam di tengah hutan pinus. Pengunjung tak perlu khawatir saat akan berkunjung ke sana karena fasilitas yang tersedia cukup lengkap. Selain itu, tersedia spot foto yang tak boleh terlewatkan, mulai dari gardu pandang, bebatuan besar yang fotogenik, pepohonan yang indah nan rimbun, sampai Rumah Hobbit yang tak kalah hits dari yang lainnya di tempat ini. Tak hanya itu saja, buat kamu yang gemar menguji adrenalin, di tempat ini kamu bisa menjajal Flying Fox di Seribu Batu Songgo Langit Yogaykarta ini.', '', 1, 'location', 'cdn/2023/10/16.jpg', 'Jl. Hutan Pinus Nganjir, Sukorame, Mangunan, Dlingo, Bantul Regency, Special Region of Yogyakarta 55', '-7.9310984', '110.43091899999999', 'Seribu Batu Songgo Langit', '', 'Seribu Batu Songgo Langit', 0, 2500, '02:00:00', 7200, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(94, 'grogol-tourism-village-1', 1000, '2023-02-10 22:19:15', '2023-10-09 01:08:57', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Desa ini dikenal karena keindahan alamnya yang memesona, tradisi lokal yang kaya, kuliner yang khas dan keramahan masyarakatnya. Desa Wisata Grogol menjadi tempat yang populer bagi wisatawan yang ingin menikmati kehidupan pedesaan yang tenang dan keindahan alam yang memukau. Salah satu daya tarik utama Desa Wisata Grogol adalah keasrian pemandangan alamnya. Dikelilingi oleh pepohonan hijau yang rimbun, persawahan yang luas, dan sungai yang mengalir jernih, desa ini menawarkan pemandangan alam yang memanjakan mata. Wisatawan dapat menjelajahi desa dengan berjalan kaki sambil menikmati udara segar dan pemandangan yang indah.</p>\r\n\r\n<p>Desa Wisata Grogol awalnya didirikan pada tahun 2001 berawal dari perbincangan antara Bapak Anto, Bapak Ageng dan Bapak Bugiman. Selama 11 tahun hingga 2012, Desa Wisata Grogol hanya berfokuskan pada pengenalan dan pelestarian kegiatan-kegiatan yang bertemakan budaya jawa. Mulai tahun 2012 Desa Wisata Grogol mengembangkan suatu konsep wisata yang lebih komersial dengan menggabungkan kekayaan budaya lokal dengan pesona alam pedesaan yang mencakup persawahan yang luas, sungai yang mengalir, dan mata air yang melimpah. Hingga sekarang Desa Wisata Grogol sudah menjadi desa wisata mandiri di Kabupaten Sleman.</p>\r\n</body>\r\n</html>\r\n', '', 'Grogol Tourism Village', '', 'Desa wisata ini berada di kawasan Grogol, Margodadi, Seyegan, Sleman, DIY. Lokasi ini tidak jauh dari pusat kota. Akses jalan menuju Desa Wisata Grogol juga cukup mudah, jika anda bergerak dari pusat kota Jogja anda bisa melaju ke arah Jalan Godean. Ikuti Jalan Godean hingga menjumpai Psar Godean, dari pasar belok ke arah kanan atau ke sisi utara jalan. Terus ikuti jalan kurang lebih sejauh 3,5 km hingga anda menjumpai lapangan yang berada di kanan jalan. Lalu ikuti papan petunjuk arah menuju Desa Wisata Grogol.', '', 1, 'location', '', 'Grogol, Kadipiro, Margodadi, Kec. Seyegan, Kabupaten Sleman, Daerah Istimewa Yogyakarta 55561, Indon', '-7.7399571', '110.3024078', 'Grogol Tourism Village', '', 'Grogol Tourism Village', 4, 0, '01:00:00', 3600, 4.3, 'D.I. Yogyakarta', 0, 0, 0),
(95, 'kampung-wisata-basen', 1000, '2023-02-10 22:19:15', '2023-10-09 20:58:09', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Kampung wisata basen yang terletak dikelurahan Purabayan, kecamatan Kotagede, provinsi DIY, memiliki potensi yang besar dalam bidang kerajinan perak. Selama ini kampung basen telah dikenal sebagai pengrajin logam khususnya perak dengan motif klasik sejak masa kerajaan mataram kuno. Keahlian membuat kerajinan perak buaatan tangan tersebut telah dilakukan secara turin temurun. Pada masa itu kegiatan mengrajin perak dilaksanakan oleh abdi dalem. Namun, perkembangannya para abdi dalem yang tinggal didaerah tersebut mengajari warga sekitar bagaimana membuat kerajinan perak, hingga menjadi rutinitas secara turun temurun.<br />\r\n<br />\r\nKampung ini menawarkan pengalaman berwisata yang belum pernah ditemui sebelumnya. Kalian akan merasakan pengalaman secara langsung dari pengrajin tentang bagaimana proses pembuatan kerajinan-kerajinan logam, seperti tembaga,perak,dan kuningan di kampung Basen.<br />\r\n<br />\r\nKalian juga akan diajak untuk mengunjungi sanggar kesenian keroncong yaitu Kembar Sekawan dan Kethoprak Srikandi Mataram sehingga pengunjung dapat melihat langsung belajar kesenian tradisional tersebut.<br />\r\n<br />\r\nKampung Basen juga memiliki sajian makanan dan minuman tradisional khas kotagede, yang dapat kalian nikmati seperti, kipo,kembang waru,baceman, intipan, dll.<br />\r\n<br />\r\nSelain itu pengunjung dapat menikmati kehidupan sehari-hari masyarakat kampung basen yang ramah dan bersahabat kepada siapapun yang berkunjung dan bermalam di homestay yang telah disediakan.</p>\r\n</body>\r\n</html>\r\n', '', 'Kampung Wisata Basen', '', 'Kotagede memiliki kekhasan pengrajin peraknya. Setiap kelurahan di sana memiliki sentra kerajinan perak. Salah satunya adalah Basen yang berada di sisi timur utara Masjid Gedhe Mataram. Selain dikenal dengan hasil kerajinannya, terdapat pula bangunan-bangunan historis seperti halnya kampung Prenggan dan Kampung Purbayan. Bangunan tersebut berdiri di sisi jalan menuju Basen. Arsitektur Jawa-Belanda dapat dilihat pada rumah-rumah warga dan toko-toko yang ada di sepanjang jalan Kampung Wisata Basen. Jika hanya sekedar masuk untuk berkeliling dan foto-foto tidak dipungut biaya retribusi. Tapi, bagi pengunjung yang ingin menikmati paket wisata yang ditawarkan dapat melakukan reservasi satu hari sebelumnya melalui sekretariat kampung wisata.', '', 1, 'location', '', 'Jl. Kemasan No.53, Purbayan, Kotagede, Yogyakarta City, Special Region of Yogyakarta 55173, Indonesi', '-7.824373899999999', '110.40049049999999', 'Kampung Wisata Basen', '', 'Kampung Wisata Basen', 1, 0, '00:45:00', 2700, 4.3, 'D.I. Yogyakarta', 0, 0, 0);
