(96, 'yogyakarta-southern-square-1', 1000, '2023-02-10 22:19:15', '2023-10-09 20:25:37', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Alun-alun Kidul yang biasa disingkat Alkid atau dalam Bahasa Indonesia berarti Alun-alun Selatan, merupakan wilayah bagian selatan dari Kraton Yogyakarta. Saat ini Alkid menjadi sebuah ruang publik bagi masyarakat. Berbagai macam kegiatan dapat dijumpai di Alkid. Menjelang sore hingga malam hari, Alkid menjelma sebuah tempat rekreasi rakyat yang tentunya sayang untuk dilewatkan.</p>\r\n\r\n<p>Berbagai penjual makanan dapat dijumpai di Alkid.&nbsp; Selain itu, pada malam hari kawasan Alkid ini juga menjadi wisata bersepeda. Berjajar sepeda tandem hingga becak yang telah dimodifikasi sedemikian rupa dengan hiasan lampu yang mencolok disewakan oleh sejumlah pemilik sewa sepeda. Alkid juga menjadi area olahraga yang diminati oleh masyarakat Yogyakarta.</p>\r\n\r\n<p>Pada bagian tengah alun-alun terdapat dua buah pohon beringin yang usianya cukup tua dan keduanya dibatasi oleh pagar benteng yang kokoh. Pohon Beringin ini pun menjadi sebuah obyek permainan yang menarik. Berawal dari kepercayaan masyarakat Yogyakarta tentang orang yang berhasil melewati kedua Pohon Beringin tersebut dengan menutup mata, maka akan dipermudah dalam meraih cita-citanya, maka saat ini banyak wisatawan yang menyempatkan waktu untuk berkunjung mencoba permainan tersebut.</p>\r\n\r\n<p>Terdapat kandang gajah di Alun-alun Kidul. Gajah yang berada di dalam kandang ini adalah milik Kraton Yogyakarta. Dahulu gajah ini sering dinaiki oleh anak-anak sebagai sarana hiburan. Tetapi saat ini hiburan ini memang sudah berkurang walaupun istilah kandang gajah masih cukup familiar di telinga masyarakat.</p>\r\n\r\n<p>Letak Alun-alun Kidul yang berada di wilayah selatan Kraton Yogyakarta memudahkan wisatawan untuk berkunjung. Anda hanya perlu menemukan Kraton Yogyakarta dan mengikuti jalan ke arah selatan, maka anda akan langsung menemukan alun-alun Selatan Yogyakarta.</p>\r\n</body>\r\n</html>\r\n', '', 'Yogyakarta Southern Square', '', 'Di masa kerajaan Mataram, Alun-alun Kidul berfungsi untuk menyiapkan suatu kondisi yang menunjang kelancaran hubungan antara keraton dengan dunia luar. Alun-alun Kidul juga melambangkan kesatuan kekuasaan yang sakral antara raja dan para bangsawan yang tinggal di sekitar alun-alun. Sedangkan Alun-alun Lor berfungsi untuk menyediakan persyaratan bagi berlangsungnya kekuasaan raja.\r\nAlun-alun Kidul ini merupakan bagian belakang Keraton Yogyakarta. Menurut sejarahnya, alun-alun Kidul dibuat untuk mengubah suasana bagian belakang keraton menjadi seperti bagian depan karena Gunung Merapi, Keraton Yogyakarta, dan laut Selatan Pulau Jawa jika ditarik dalam satu garis imajiner akan membentuk satu garis lurus. Agar posisi Keraton Yogyakarta tidak seperti membelakangi laut Selatan, maka dibangunlah Alun-alun Selatan.', '', 1, 'location', '', '59Q7+87Q, Jl. Gading, Patehan, Kraton, Yogyakarta City, Special Region of Yogyakarta 55133, Indonesi', '-7.8116718999999994', '110.363238', 'Yogyakarta Southern Square', '', 'Yogyakarta Southern Square', 0, 0, '02:00:00', 7200, 4.7, 'D.I. Yogyakarta', 0, 0, 0),
(97, 'citragrand-mutiara-waterpark-yogyakarta-1', 1000, '2023-02-10 22:19:15', '2023-10-12 11:01:51', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Berada di dalam komplek&nbsp;Perumahan CitraGrand Mutiara&nbsp;Yogyakarta, tepatnya di Jalan Wates KM 9, Balecatur, Kabupaten Sleman, Waterpark ini menjadi salah satu objek wisata air favorit untuk keluarga. Mengusung tema&nbsp;<em>Treasure Adventure</em>,&nbsp;<strong>CitraGrand Mutiara Waterpark</strong>&nbsp;Yogya menghadirkan berbagai wahana permainan air yang akan membawa pengunjung seolah berpetualang bersama bajak laut. Tema bajak laut ini tampak jelas dari keberadaan sebuah kapal besar ditengah area waterpark. Sosok bajak laut di ujung kapal nampak gagah mengawasi keadaan sekitar. Di sisi lain, ada Burung Kakatua Biru (<em>Blue Parrot</em>) berparas ramah yang seolah menjadi penjaga harta karun. Pengunjung yang ingin merasakan serunya bermain di water park ini tidak perlu khawatir menghabiskan banyak biaya. Harga tiket masuk CitraGrand Mutiara Waterpark bisa dikatakan cukup terjangkau. Tiket masuk ditawarkan mulai dari Rp35.000 &ndash; Rp55.000.</p>\r\n\r\n<p style=\"text-align: justify;\">Selain sebagai destinasi wisata rekreasi air, Water park ini juga memiliki konsep eduwisata. Hal ini diwujudkan dengan menyediakan kolam semi-olimpik yang bisa digunakan untuk kegiatan akademik pelajaran olahraga atau sejenisnya.&nbsp;Begitu menariknya Water park ini sebagai destinasi wisata keluarga, menjadikannya selalu ramai pengunjung terutama saat akhir pekan. Apalagi, waterpark ini juga&nbsp;<strong>menggratiskan biaya masuk bagi anak dengan tinggi badan dibawah 80 cm dan lansia diatas 60 tahun</strong>. Guna mengakomodir kebutuhan untuk berbagai rentang usia tersebut, CitraGrand Mutiara Waterpark menyediakan berbagai pilihan wahana dan fasilitas yang terbilang lengkap.</p>\r\n</body>\r\n</html>\r\n', '', 'CitraGrand Mutiara Waterpark Yogyakarta', '', 'CitraGrand Mutiara Waterpark Yogya berada di dalam komplek Perumahan CitraGrand Mutiara Yogyakarta, tepatnya di Jalan Wates KM 9, Balecatur, Kabupaten Sleman. Waterpark ini menjadi salah satu objek wisata air favorit untuk keluarga. Mengusung tema Treasure Adventure dan menghadirkan berbagai wahana permainan air yang akan membawa pengunjung seolah berpetualang bersama bajak laut.', '', 1, 'location', 'cdn/2023/10/citragrand-mutiara-waterpark.jpg', 'Perumahan Citra Grand Mutiara, Jl. Wates, Perengdawe, Balecatur, Kec. Gamping, Kabupaten Sleman, Dae', '-7.813734299999999', '110.28318379999999', 'CitraGrand Mutiara Waterpark Yogyakarta', 'CitraGrand Mutiara Waterpark Yogyakarta', 'CitraGrand Mutiara Waterpark Yogyakarta', 0, 55000, '01:30:00', 5400, 4.3, 'D.I. Yogyakarta', 0, 0, 0),
(98, 'cemeti-institute-for-art-and-society', 1000, '2023-02-10 22:19:15', '2023-10-12 10:54:13', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>Cemeti &ndash; Institut untuk Seni dan Masyarakat</strong>&nbsp;(sebelumnya &lsquo;Galeri Cemeti&rsquo;, kemudian &lsquo;Rumah Seni Cemeti&rsquo;) adalah platform tertua seni kontemporer di Indonesia, didirikan di Yogyakarta tahun 1988 oleh Mella Jaarsma dan Nindityo Adipurnomo. Cemeti menawarkan platform bagi seniman dan praktisi kebudayaan untuk mengembangkan, menyajikan, dan mempraktikkan aktivitas mereka lewat kolaborasi bersama kurator, peneliti, aktivis, penulis dan performer, serta komunitas lokal di Yogyakarta.</p>\r\n\r\n<p>Program-program pada platform ini mengambil bentuk pameran, lokakarya, diskusi, pertemuan, publikasi, proyek penelitian jangka panjang, dan program residensi seniman selama tiga bulan (diadakan dua kali setahun).</p>\r\n\r\n<p>Slogan &lsquo;Institut untuk Seni dan Masyarakat&rsquo; mulai digunakan tahun 2017 dalam rangka mengekspresikan komitmen organisasi terhadap praktik artistik yang terlibat secara sosial dan politik, mengeksplorasi kemungkinan galeri untuk bertindak sebagai situs penting bagi aksi-aksi sipil.</p>\r\n\r\n<ul>\r\n	<li>Buka Selasa - Sabtu pukul 09.00 - 17.00 WIB</li>\r\n	<li>Minggu-Senin : Libur</li>\r\n	<li>Agenda pameran menyesuaikan</li>\r\n</ul>\r\n\r\n<p>Menampilkan berbagai macam Pameran lukisan, foto, grafis, patung keramik, seni tradisional : Setrika Lawasan, Radio Lawasan, Keramik Kuno, Lampu Kuno, Jam Kuno, Penggeli Hati, Pawukon, Tjap Petruk, Pameran Wuwungan, Ning Tem bok, Celengan Malo; putar film bulanan, diskusi buku, pentas kesenian tradisional &amp; pertunjukan musik jazz (jazzmbensenen)</p>\r\n</body>\r\n</html>\r\n', '', 'Cemeti - Institute for Art and Society', '', 'Rumah Seni Cemeti sejak 1988 telah secara aktif memamerkan dan mengkomunikasikan karya dari seniman-seniman kontemporer baik dari Indonesia maupun dari mancanegara. Setiap tahun diselenggarakan paling sedikit sebelas proyek pameran. Baik pameran tunggal, pameran kelompok, seni pertunjukkan, site specific maupun happening art, diskusi, presentasi slide serta perbincangan seniman.', '', 1, 'location', 'cdn/2023/10/cemeti.jpg', 'Jl. DI Panjaitan No.41, Mantrijeron, Yogyakarta City, Special Region of Yogyakarta 55143, Indonesia', '-7.817791799999999', '110.3623492', 'Cemeti - Institute for Art and Society', 'Cemeti - Institute for Art and Society', 'Cemeti - Institute for Art and Society', 0, 0, '01:00:00', 3600, 4.6, 'D.I. Yogyakarta', 0, 0, 0),
(99, 'selfie-park-jogja-1', 1000, '2023-02-10 22:19:15', '2023-10-08 21:45:07', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Selfie Park Jogja terletak di kawasan XT Square, tepatnya di Jalan Veteran Nomer 150-151, Pandeyan, Umbulharjo, Jogjakarta.<br />\r\nTaman ini menawarkan 7 spot foto berbeda dan menarik bagi para pengunjung, diantaranya adalah spot foto berbentuk lingkaran, spot foto berbentuk sumur kayu, sangkar burung, dan beberapa bentuk menarik lainya.<br />\r\nDi objek wisata ini terdapat pasar kerajinan, dimana pengunjung dapat membeli berbagai kerajinan tangan khas kota Jogja. Bagi pengunjung yang datang dari luar kota, pasar ini menjadi salah satu spot yang menyenangkan. Dengan harga yang terjangkau, pengunjung dapat membeli berbagai kerajinan khas Jogja yang unik ini.<br />\r\nSelain itu, layaknya tempat wisata pada umumnya, di sini pengunjung bisa menikmati berbagai kuliner outdoor yang disediakan. Pengunjung bisa menikmati berbagai makanan khas Jogja yang selalu menjadi favorit para wisatawan.</p>\r\n</body>\r\n</html>\r\n', '', 'Selfie Park Jogja', '', 'Selfie Park Jogja merupakan sebuah objek wisata yang menyuguhkan berbagai spot foto menarik yang diberi nama Taman Pule. Penamaan taman pule sendiri, diambil dari nama Pohon Pule yang terletak di lingkungan XT Square dan sudah ada sejak dulu. Lahan seluas 1088m2 yang terletak di lingkungan XT Square disulap menjadi taman selfi yang apik dan mengundang perhatian pengunjung. Harga tiket masuk Rp 10.000/orang. Disarankan untuk mengunjungi diwaktu senja, karena kualitas foto akan lebih bagus dengan pencahayaan lampu-lampu.', '', 1, 'location', 'cdn/2023/10/15.jpg', 'Jl. Veteran No.150-151, Pandeyan, Umbulharjo, Yogyakarta City, Special Region of Yogyakarta 55161, I', '-7.816513499999999', '110.38660619999999', 'Selfie Park Jogja', '', 'Selfie Park Jogja', 0, 10000, '01:30:00', 5400, 4.4, 'D.I. Yogyakarta', 0, 0, 0),
